INSERT INTO `comments` VALUES (6,237,5,'10','Excelente maestro! Le encanta tirar desmadre y hay que saber darle cuerda. Te diviertes muchisimo al mismo tiempo en el que aprendes. Sube puntos y siempre hace curvas de 6 puntitos por parcial.','NA','201.133.197.181','0000-00-00 00:00:00',0),(7,9,5,'6','Falta mucho a clases y te deja salir temprano. la clase en general es de puras presentaciones de powerpoint pero a la hora del examen vienen preguntas de cosas que dijo en clase... sus exámenes son todos de multiple choice y por lo regular tienen muchos errores en la revisión. En general la maestra es buen rollo pero dudo que aprendas mucho...','NA','131.178.108.41','2007-12-11 16:18:47',0),(8,9,5,'9','Es buena maestra, conoce sobre el tema y se porta bien con los alumnos. casi siempre deja salir temprano y además ayuda a veces con puntos extra. no hace la clase muy aburrida. si volvería a meter clase con ella.','NA','207.248.39.254','2007-12-11 16:18:47',0),(10,237,5,'2','Pasas. Da puntos y no pasa las faltas aunque te pases. peeero... Todos los dias te grita, la clase es malísima y el \"desmadre\" que tira es pasadito, si te gusta aguantar personas prepotentes este es el bueno. si no te gusta dia a dia vas a salir quejandote. en lo personal malísimo.','NA','201.128.139.234','2007-12-11 16:18:47',0),(11,237,5,'2','Lo bueno es que pasas... pasas porque le da hueva dar revision, tira carro pesado, si eres chava no hay problema pero si eres hombre preparate para carro pesado y prepotencia al maximo... si eres alguien ke toma apuntes no te lo recomiendo... no te deja tomarlos y nada mas esta friegue y friegue pero lo bueno es que pasas','NA','201.135.14.144','0000-00-00 00:00:00',0),(13,418,5,'10','Barquisimo, deja sacar acordeones en el examen, hasta avisa cuando se va a parar, es buena gente y naco jajaja con el sacas de 90 para arriba FINAL','NA','131.178.79.238','0000-00-00 00:00:00',0),(14,9,5,'5','Yo la lleve en linea con ella, y la verdad esta facil, pero siempre se equivoca a la hora de calificar. Tengan cuidado con los trabajos en equipo. La verdad ha de ser buena maestra, pero si la agarras de malas te puede tratar muy mal. Y como no la conoces no hay muchos puntos extras.','NA','201.133.210.249','0000-00-00 00:00:00',0),(15,237,5,'7','Esta super x su clase. la vdd derrepente da flojera pq siempre se desvia cañon de los temas de la clase. se pone a platicar de \"cuando el trabajaba para la mercedes... los rayados...\" nunca te deja tomar notas ni sube nada a BB. tienes que conseguir las notas por otros lados. te hecha sermones todos los dias pq no estudias lo que te encarga (para el leer no es estudiar) y siempre amenza con que va a asegurarse de que todo mundo repruebe. pero a la hora de la hora da puntos extras. dependiendo d','NA','201.133.208.45','2007-12-11 16:18:47',0),(16,293,5,'10','Este maestro es lo mejor! Super inteligente, tiene miles de maestrias y doctorados y cursos y de mas. Yo la lleve Virtual, y fue de lo mejor. El maestro siempre te apoya en todo, resuelve dudas, etc. Es medio perro para calificar, pero no es injusto. Y pone en promedio 2 actividades por semana. EL MAESTRO ES ALTAMENTE RECOMENDABLE. Si la quieres meter virtual te recomiendo que escojas muy bien a tu equipo, por que lo vas a necesitar todo el semestre.','NA','201.135.4.1','0000-00-00 00:00:00',0),(18,396,5,'10','Excelente Profesora, aprendes mucho en su clase y por lo general deja trabajos extras, aunke si eres huevon ya te la pelaste (bueno en casi cualquier clase) muy recomendada','NA','207.248.39.254','0000-00-00 00:00:00',0),(19,66,5,'2','No comentan el error de su vida en meter esta clase con el, esta aburridisima, no explica bien, los examenes super dificiles, le preguntas algo no te responde, cuando tienes algo bien en el examen y te lo califico mal no te lo cambia, muchisima tarea.... en conclusion NO','NA','201.128.162.13','0000-00-00 00:00:00',0),(20,362,5,'10','Se puede decir que es buen maestro.. el problema es que falta mucho y manda a otro mono que lo unico que sabe es contar chistes malos y poner un video del cual tomas notas y te vienen preguntas en el examen. Sus clases estan bien si quieres te puedes dormir en sus clases todo el semestre y a el le vale.. a pero si hablas eso si esta mal. No toma lista asi que te la puedes volar siempre y para los examenes solo estudia las slides que estan en bb y ya la hiciste facil sacas el 9. Eso si, si te las','NA','200.39.228.135','0000-00-00 00:00:00',0),(21,362,5,'9','Es buen profe aunque es completamente diferente a todos los de admin. El hace los examenes solo para el grupo y de hecho el libro que llevan es uno que el hizo y con el es el unico grupo que lo usa. Siempre hay tareas pero estan faciles. Leyendo las slides que hay en cursos la haces con un 8 minimo, en 1er y 3er parcial acostumbra dar puntos extra por un trabajo y casi siempre te pone 10 en tareas y trabajos, es cuestion que le pongas rollo.','NA','200.39.228.135','0000-00-00 00:00:00',0),(22,362,5,'9','Buen maestro, pero su clase parece monólogo un poco, le encanta hablar de sí mismo y lo que ha hecho, pero la clase esta tranquila, no toma lista, pero se enoja cuando hablas o te ries en clase y se te queda viendo bien raro jaja, es todo un personaje, pero es cierto, falta mucho...\"El lic. Juan Gerardo es una persona muy ocupada\" te dira el Mares, que es su asistente, es buena onda tmb, nomas que esta medio raro jaja...','NA','131.178.110.245','2007-12-11 16:18:47',0),(24,9,5,'7','Da la clase medio aburrida puras presentaciones y los examenes siempre los revisa mal y al ultimo tienes que andar reclamando. pero a la mayoria si le caes bien te pasa.','NA','201.133.56.171','0000-00-00 00:00:00',0),(26,418,5,'10','Excelente maestro!, explica muy bien, es muy barco, te ayuda en todo, da puntos extras, eso si.. siempre hay exposiciones pero todo en equipo (facil!!), los examenes son faciles, pero en el final agarrate es departamental!.. si haces todo sacas arriba de 90 final','NA','200.52.4.114','0000-00-00 00:00:00',0),(27,237,5,'10','Ps la neta es atodisima madre, esta ogete que la clase es namas a las 7am y eso no es nada recomendable pero tira madreada chida y es super aliviane. Lo malo es que grita, no puedes tomar apuntes (otros profes suben el mismo material a Bb y de ahi lo sacas) y esta de mal humor todas las mananas aunque se aliviana de rato.','NA','201.153.36.143','0000-00-00 00:00:00',0),(28,237,5,'8','La clase es bastante amena (si tu disfrutas de ver a los profes burlandose de los \"stupids\"), como persona tiene bastante experiencia de la materia... de hecho las filminas casi ni las pela, se la pasa hablando de los ejemplos de su vida, encarga pocas tareas, pero en los examenes siempre pone preguntas que parecen tener más de 1 respuesta correcta... por eso nadie saca 100... Si la vas a meter con él, acostumbrate a sus regaños grupales DIARIOS... si los tomas con gracia en lugar de personal','NA','201.135.27.130','2007-12-11 16:18:47',0),(29,237,5,'4','Es un grosero, burlista. No te deja tomar apuntes, están súper difíciles sus exámenes, da puntos pero porque nadie puede sacar 100. Te encarga estudiar todas las clases y te da un sermón al iniciar la clase, te regaña por llegar un minuto tarde. Es la peor clase para empezar el día.','NA','207.248.39.254','2007-12-11 16:18:47',0),(31,9,5,'6','llevar administracion en linea con ella es la muerte porque califica bien mal las tareas.. si no tiene colores la tarea y no esta presentable o le importa que el contenido sea bueno .. y a parte sde repente cambia las fechas de entrega de tareas o examenes y pues si no estas cheque y cheque te va super mal.','NA','201.153.65.38','0000-00-00 00:00:00',0),(33,418,5,'10','super agusto. en la clase sólo ves presentaciones, no hay quizes, pero siempre hay resumenes del libro en equipo y hacer todos los terminos claves. da muhcos puntos extras por hacer buenas presentaciones.','NA','207.248.47.101','2007-12-11 16:18:47',0),(34,237,5,'10','lo unico malo es que es a las 7 y que derrepente se pone a regañar gente pero eso de que no da apuntes son quejas de ñoños porque no necesitas tener apuntes ya que al final nunca en su historia a reprobado a alguien, es garantia que todos pasan asi que no averiguen mucho y los ñoños por favor no opinen estupideses','NA','200.77.127.253','2007-12-11 16:18:47',0),(36,66,5,'1','si la metes con el estas en el hoyo, te vas a querer suicidar en sus clases y deja mucha tarea','NA','201.132.21.135','0000-00-00 00:00:00',0),(37,418,5,'9','Este profe es lo de lo mas flojo para dar la clase... pq la vdd hasta batalla para pararse...pero la clase son puras presentaciones powerpoint y siempre pasas a exponer en equipo. El nunca va a dar una clase. Eso si, da muchos puntos extras si le gustan tus presentaciones y por otras cosas... Encarga siempre de tarea hacer a mano terminos clave del libro y resumenes de los capitulos... Trabajas pero pasas agusto...','NA','201.135.12.115','0000-00-00 00:00:00',0),(38,9,5,'5','Llega tarde a clases, falta, no se si sea por su culpa , si haga ella los examenes, pero en ellos no vienen nada de lo que estudias, porque te dice que estudies todo y luego vienen conceptos que ni vieron nunca... es buena gente pero creo que pueden encontrar un mejor maestro con el que pueden aprender mas','NA','201.145.99.244','0000-00-00 00:00:00',0),(39,9,5,'5','Llega tarde a clases, falta, no se si sea por su culpa , si haga ella los examenes, pero en ellos no vienen nada de lo que estudias, porque te dice que estudies todo y luego vienen conceptos que ni vieron nunca... es buena gente pero creo que pueden encontrar un mejor maestro con el que pueden aprender mas','NA','201.145.99.244','0000-00-00 00:00:00',0),(41,396,5,'10','Una maestra muy tranquila en su forma de ser, para explicar solamente te echa un rollo de los slices que ella tiene en blackboard, te encarga muchos trabajos pero a todos les va bien, son en equipo y a veces individual, te toca exponer un tema en equipo en todo el semestre, es barca para calificar, da puntos extras a los mejores trabajos, si uno pone atención los examenes parciales están bien tranquilos y casi casi regalados para sacar arriba de 90, pero si te acostumbras a este ritmo y no le ','NA','201.153.71.202','2007-12-11 16:18:47',0),(42,9,5,'10','es buena maestra, sus exemenes un poco dificles y en clase ves pura powerpoint y las tareas como nunca t avisa tienes que estar checando bb, pero es buena y si todos en el salon se ponen de acuerdo para pedir curva o asi si se las pone','NA','201.145.14.43','0000-00-00 00:00:00',0),(43,362,5,'10','Es super buen maestro, explica super bien, pero sus examenes son preguntas abiertas, NUNCA toma lista pero siempre hay tarea, siempre pone como 10 puntos extra cada parcial y al final si no hiciste tareas te deja mandarselas por mail.. metanla con el.. sabe demasiadas cosas y su clase esta muy interesante.','NA','201.133.210.191','0000-00-00 00:00:00',0),(46,66,5,'5','De flojera su clase. En las clases siempre hay examen rapido y el maestro solo lee las presentaciones , da ejemplos de flojera y pide tareas que no vienen al caso, aparte el corrector es super exigente que te ponen mala calificacion aunque este completo el trabajo. Lo unico bueno esque casi siempre se acaba la clase antes.','NA','207.248.35.139','0000-00-00 00:00:00',0),(47,411,6,'10','Excelente Profesor. Muy buenas clases. Lo unico es que mucha de la materia que te ponen a estudiar del libro no te la explican en clase. No hay mucha tarea.','NA','207.248.39.254','0000-00-00 00:00:00',0),(48,411,6,'10','Es un excelente profesor y si hay bastantes tareas pero no son dificiles','NA','131.178.97.208','0000-00-00 00:00:00',0),(49,411,6,'10','La materia es gorrosa, sin embargo la asistente que da algunas clases lo compensa. Me parece muy accesible, creo que se llama Cinthya o Cindy.','NA','148.245.101.238','0000-00-00 00:00:00',0),(50,127,8,'10','A esta profesora la odias o la amas. Yo la amo, me cae super bien y en todas sus materias he sacado arriba de 95. Es muy raro que alguien truene con ella. Sin embargo, a muchos les caen mal sus bromas y dicen que es muy fresa. Se la pasa hablando de sus viajes a París, pero de manera interesante. Eso sí, hay que trabajar, ya que no te acepta una tarea aunque te hayas pasado por un minuto. Califica bien y por fortuna no checa código. Sus clases están reba, no les voy a decir que aprenden much','NA','201.133.209.101','2007-12-11 16:18:47',0),(51,127,8,'9','El mensaje de arriba tiene razón, no puedes entregar tareas tarde... en ocasiones toma lista antes de k suene la campana... sus exámenes son tal cual las filminas que da, generalmente de opción múltiple... no hay de otra para esta clase, así que lean el material bien y ya...','NA','148.240.195.120','2007-12-11 16:18:47',0),(52,127,8,'10','También da Producción de Sistemas para los ISIs y no hay opción. Es cierto que la odias o la amas. Yo la odié. Tienes que hacerle la barba como a nadie jamás se la has hecho en tu vida y si no le caiste bien no te ayudará con nada, es odiosa. Tip: Barbéale y sonríele siempre (aunque por dentro desees atropellarla).','NA','201.145.69.2','2007-12-11 16:18:47',0),(53,127,8,'7','En sus clases no aprendes nada... sigue con cobol... un upgrade le vendría bien a sus clases y a su conocimiento... =P','NA','201.137.188.32','2007-12-11 16:18:47',0),(55,334,11,'10','La materia es fácil, y el profesor hace que lo sea aún más. En clase de martes y jueves te deja salir como media hora temprano. Los exámenes son muy fáciles, con que leas la haces. Cada parcial da muchos puntos extra, por cosas simples, como que le lleves una foto, hagas barquitos de papel, o que subas tu info a Blackboard. Clase fácil y amena.','NA','200.76.155.70','2007-12-11 16:18:47',0),(57,95,11,'10','el profe explica la clase bien y da ejemplos si quieres si aprendes y si no quieres es lo mismo sus examenes estan facilisimos son de abc y un problema no toma lista hasta el tercer parcial y encarga muy pocas tareas, los alumnos le ponen ponderacion al a las tareas y examenes, la verdad esta facilisima esta materia con el nunca me precupe por esta materia ni siquiera al final soloes de poner atencion y si no pues estudiar un dia antes del examen.','NA','201.133.245.105','0000-00-00 00:00:00',0),(59,95,11,'10','este profe es la neta, todas las cosas explica muy bien, pero si no te interesa la clase puedes no ir NUNCA y no pasa nada.','NA','201.138.169.8','0000-00-00 00:00:00',0),(61,172,11,'6','Te pone a trabajar en una materia que no tiene caso, los examenes estan muy dificiles, metanla si con ella si quedan maestros muy estrictos en administracion de la manufactura, no es muy recomendable.','NA','201.153.41.61','0000-00-00 00:00:00',0),(62,172,11,'8','No sabes de donde saca sus examenes, siempre hay minimo un problema que no viste en facil, te dice estudia de ahi son 20 slides piensas que va a estar facil y no, en 2 parcial dices tal vez lo saco de o que dice en clase, vas y tampoco sacas buena calif. tienes que estudair demasiado para que te vaya bien. Pero da 5 ptos extras por tareas, y el final no es acumulativo, y si haces chronos y un buen proyecto final, la puedes pasar.. pero no hay necesidad de hacer tan dificil adm.','NA','201.130.66.244','0000-00-00 00:00:00',0),(63,172,11,'3','Mala maestra, es muy cerrada en sus conocimientos, no puedes argumentarle nada porque no sirve para nada. Nomas sus concentidos sacan buena calificacion, los examenes son muy dificil y los trabajos son mas dificiles todavia. Si es pasable con ella, pero vas a sufrir un rato para una materia que no deberias de sufir.','NA','200.126.252.144','0000-00-00 00:00:00',0),(64,172,11,'10','Que burros, esta super facil con esa maestra.. es la unica que te deja problemas de numeros (digamosle asi) en esa materia pero la verdad estan de peras y manzanas y vaya que yo no soy para nada de mates. Es una maestra super linda y una clase facil. Pongan atención, sin se la viven platicando 