s arriba de 90 al final,','NA','200.64.168.92','2007-12-11 16:18:47',0),(75,172,19,'10','Es muy buena maestraa...yo llevé con ella administración de la manufactura también y pues tal vez si sea de las más díficiles en esa materia pero vale la penaaa...pues aprendes y además es bien linda. explica bien y pues ya te conocerá para cuando la metas en administración de operaciones en la que es mucho mejooor aun, yo sí la metería de nuevo con ella y se las recomiendo muchoo. que no les de miedo estudiar','NA','201.145.99.95','2007-12-11 16:18:47',0),(76,7,23,'10','Buen maestro. La clase es muy entretenida.. Solo deja 2 tareas en el semestre, pero cada mes hay que entregar un avance del proyecto final..','NA','201.129.83.194','0000-00-00 00:00:00',0),(79,7,23,'5','El profesor es algo terco y muy detallado para que le hagas los trabajos. Es muy exigente si no lo haces a su manera o le parece.','NA','200.34.72.196','0000-00-00 00:00:00',0),(81,149,25,'6','La maestra conoce el tema, PERO es injusta, siempre hice mis tareas y NUNCA JAMAS me puso ni a mi ni a mis compañeros 100 !! Lo peor esque le pides asesoria y siempre está ocupada!! Es demasiado teórica y en el examen te pone todo muy práctico. Además falta mucho y manda a su asistente que para variar no sabe del tema y solo se limita a poner las actividades. Miguel Angel Pérez (el deditos) es la mejor opción!','NA','131.178.5.30','2007-12-11 16:18:47',0),(83,347,27,'10','Este maestro es de lo mejor!! La clase esta super light, es muy buena onda, se nota que le apasionan las ventas. Comprometido con que en un futuro podamos ser buenos vendedores jaja. Si te llevas bien con el, la clase la tienes pasada. Un tip, si al inicio de la clase te dice que quien le ayuda en la compu, levanta la mano!!, porque pregunta mucho sobre lo que anda exponiendo, aunque le puedes decir cualquier cosa y esta bien, pero si estas en la compu tienes asegurado que no te va a preguntar n','NA','201.145.68.247','0000-00-00 00:00:00',0),(84,46,29,'10