e sus examenes son iguales a los problemas que pone ahi. Sus examenes son en equipo, el final es en equipo, esta muy facil y por si fuera poco solo tienen que hacer muy pocas tareas d','NA','201.128.177.245','0000-00-00 00:00:00',0),(93,291,32,'10','Es un muy buen maestro, conoce mucho del tema, enseña bien y la clase se pasa muy rápido porque hace comentarios sobre aplicaciones a la vida real. Aunque muchos dicen que está dificil la verdad es que en los examenes pone problemas muy parecidos a los que haces de tarea y también te da puntos extra cada parcial por no faltar.','NA','207.248.39.254','2007-12-11 16:18:47',0),(94,107,32,'8','La profe es buena onda, la verdad tiene fama de barca, pero no lo creo así. ya que si bien es cierto da oportunidad de tener muchos puntos extras, tambien tienes que trabajar muy duro para tenerlos. Además tiene algunas tecnicas especiales para ajusticiarse a los que no trabajan como en mi caso. ya que si tienes un buen equipo y no trabajas en el proyecto final, podria esperarse que si ellos te califican bien saques todos los puntos. pero en realidad ella hace un quiz rapido el ultimo dia en e','NA','201.135.58.125','2007-12-11 16:18:47',0),(97,291,32,'10','Es el mejor maestro que he llevado. Le dicen y se dice a si mismo \"el perro aguayo\" pero nadamas para asustar. Explica super bien y tiene mucha paciencia, aparte de que tiene buen humor. Super lo recomiendo.','NA','200.78.66.183','0000-00-00 00:00:00',0),(99,199,32,'8','El Maestro más barco que he conocido en toda mi vida,no aprendes nada,sabe mucho pero no lo sabe explicar primer parcial matemáticas financieras no lo explica como debe ser. pasas bien facil.','NA','207.248.39.254','2007-12-11 16:18:47',0),(100,291,32,'10','Es la neta este profe !!!; muchos dicen que es perro pero no es cierto, no es barco xque te pone a pensar en los examenes, nada del otro mundo,si eres lic. te conviene xque mas adelante te van a servir sus clases, si aprendes y te pone cosas super practicas; aparte el profe siempre te cuenta anecdotas reales aplicadas a la materia, es super a todo dar, lo recomiendo ampliamente. Eso del Perro Aguayo nomas para asustar a los burros.','NA','131.178.77.104','0000-00-00 00:00:00',0),(101,413,32,'3','Nunca la metan con el, maliiiisimo para expplicar va super rapido.. las tareas \"extras\" son suuper pesadas y bien complicadas todo tiene que ser a su manera. Horribleee.','NA','207.248.37.35','0000-00-00 00:00:00',0),(102,413,32,'8','esta super pesada la clase...pero al final terminas pasando, eso si, tienes que tener un buen equipo porque los trabajos mensuales valen un buen, pero de si es una clase que quieres aprender no la metas con el, solo si la quieres pasar.','NA','201.138.169.8','0000-00-00 00:00:00',0),(103,413,32,'1','Sin duda alguna el PEOOOOR profesor que he tenido en el tec. Si está enojado se desquita con el grupo y luego ahí anda pidiendo disculpas, si le preguntas algo te contesta con refranes, se la pasa diciendo chistes que no causan gracia. Aparte es perro, encarga demaciada tarea (aunque son por entregar, bien te las puedes copiar). Pero es exageradamente mal maestro. JAMÃS volvería a meter algo con él.','NA','201.130.66.249','2007-12-11 16:18:47',0),(104,306,32,'10','El mejor maestro que existe en la faz de la tierra, te diviertes, aprendes, no te estresas, es super buen pedo y pasas... deberían haber más maestros como él de que son buenos maestros pork aprendes y no son perros...','NA','148.221.53.165','2007-12-11 16:18:47',0),(107,291,32,'10','Excelente profesor, explica muy bien y sus examenes solamente son acerca de lo que ves en clase, si no faltas te da puntos extra. Es justo en su forma de evaluar y muy buena gente. Para salir bien ve a asesorias y haz las tareas porque eso puede ser la diferencia entre pasar o no pasar','NA','200.78.84.111','0000-00-00 00:00:00',0),(112,53,39,'3','Maestro muy sangrón y con muy mal humor. NO LA METAN CON EL.','NA','201.128.129.10','2007-12-11 16:18:47',0),(113,53,39,