 maestro.. si le va mal al salón te vuelve a poner el examén, la clave es antes del parcial ir a su cubiculo a que te explique algunos problemas, aunque el final esta imposible de resolver como quiera no cuenta tanto..y para todo dice ufff...','NA','201.153.89.82','2007-12-11 16:18:47',0),(152,141,44,'10','Excelente profesor. Conoce acerca de todo lo que enseña, se prepara muy bien para cada clase. La hace bien interesante. Yo la tomé virtual y fue de lo más flexible, da muchos puntos extra, y es súper interesante.','NA','200.76.155.70','2007-12-11 16:18:47',0),(153,187,44,'8','Una clase convertida en la practica, y no vista tanto sobre la teoria. Como esta en frances, los casos analizados fueron mas bien de la union europea, y viendo paginas en frances. La clase esta bien, aunque los conceptos un poco flojos al final (ser profesor no es mucho de su vocacion)','NA','131.178.189.45','0000-00-00 00:00:00',0),(154,184,44,'10','Una maestra super barca, nomas que su clase es de 3 horas, pero nomas te llevas tu lap, te la pasas chateando y expones un tema cada 3 semanas. Los parciales y el final son por internet asi que todo el grupo se junta y de ley que sacas arriba de 95 aun sin saber nada. Nomas que la mera verdad a mi se me hizo tirar a la basura una optativa intercultural metiendo esa materia, hubier preferido algun idioma, aleman o frances.','NA','131.178.77.205','0000-00-00 00:00:00',0),(155,141,44,'10','Da super bien la clase.. es muy buena onda y te da mucha chance de entregar los trabajos despues de la fecha. Es bastante flexible y alivianado. La clase con el no esta nada dificil y si siento que aprendi bastante.','NA','201.153.37.214','0000-00-00 00:00:00',0),(156,20,44,'9','La clase está muy buena, es interesante, aprendes mucho y la maestra es sabe muchísimo del tema. Si piensas meter clase con ella, prepárate para tomar notas durante la clase y (lo peor de todo) a hacer mucha, pero de verdad MUCHA tarea. Todos los días hay trabajos, todos los lunes hay quiz