ntenidos, sin embargo, es uno de los mejores profesores de computación, asi que si recomiendo que metan esta clase con él. Si haces todas las tareas y le echas ganas a los proyectos te irá bien. Los exámenes son de nivel aceptable, y si pusiste atención en clase todo tranquilo.','NA','201.128.170.33','2007-12-11 16:18:47',0),(164,415,47,'10','Muy buen profesor. Especialmente comparado con el otro que da esta clase. Dicen que el otro no sabia explicar, y cuando fueron los de la otra clase con Luis Humberto, dijeron que era mucho mejor. Metanla con el. Les combiene. Los examenes son los mismos para todos los grupos, entonces vayanse pro el profe bueno.','NA','201.135.30.105','0000-00-00 00:00:00',0),(165,338,51,'4','Si quieren sufrir, metanla con el, no te ayuda si lo necesitas, si explica bien pero los examenes siempre son confuzos y con problemas no vistos en clase. No es nada recomendable','NA','148.244.155.63','0000-00-00 00:00:00',0),(167,183,51,'10','Es super buena maestra, toma lista, casi no encarga tareas y con que entreges todas o la mayoria te pone todos los puntos de tareas. Al final te encarga un problema q lo sacas de Internet y ya. Aparte de que explica super bien!','NA','201.153.89.224','0000-00-00 00:00:00',0),(168,215,51,'10','No deja tareas, en los problemas viene los problemas vistos en clase pero revueltos. Metanla con él si van a practicar los problemas que deja como tareas opcionales (no los tienes que entregar) si no los vas a hacer antes de que el los resuelva en clase por que no valen nada pues mejor no la metan, todo te lo explica super ordenado y bien, siempre que tengas tus apuntes y practiques los problemas te va a ir super bien. Si quieres flojear y no practicar durante el semestre pues no.','NA','200.77.78.210','2007-12-11 16:18:47',0),(169,338,51,'5','Si quieres tronar metela con el........... sin comentarios, se la da de ue explica super bien, pero entonces si es buen maestro porque reprueban tantos, acaso es porque es perro? o demasiado malo para enseniar.......','NA','201.145.80.12','0000-00-00 00:00:00',0),(170,338,51,'7','Sus clases no son aburridas, si participas te regala un punto. puedes acomular hasta 10 puntos por parcial, no mas que lo examenes estas dificilones, si le hechas ganas puedes pasar, si no tienen de otra agarrenla con el','NA','207.248.39.162','0000-00-00 00:00:00',0),(171,215,52,'8','No toma lista no tienes que ir a sus clases, no deja tarea, lo unico que tienes que hacer es presentar los tres parciales y el final. Para esto hay muchisimas versiones de sus parciales entonces estudias de ahi y segurito te toca un problema de alguno de los exámenes que ya tienes, solo ve al primer, segundo y cuarto parcial que son los mas complicados, el tercero te lo pueden explicar fácilmente un día antes del examen. No esta suuuper fácil pero solo tienes que estudiar dias antes de los e','NA','148.221.53.165','2007-12-11 16:18:47',0),(172,251,52,'8','Casi nadie lo conoce, aguas, solo abren su grupo en tardías. Hay tareas todos los días pero no las checa sino hasta ya el último día de clases, y es mas puedes hcaer de q eproblemas al azar y te va bien. Los examenes están fáciles y puedes conseguirlos de personas qe la hayan llevado con el. Es muy tranquilo, nada mas no hagan mucho desmadre en el salon. No es taan barco peor al final si hiciste todo y no faltaste si te pasa. Si vas a sus asesorias grupales (qe son 3 al semestre) te da pun','NA','201.153.40.124','2007-12-11 16:18:47',0),(174,315,53,'10','Excelente maestro. Muy buena clase, es alivianado al revisar los ensayos. No encarga mucha tarea, es más es muy raro que encargue tarea a excepto de los ensayos que equivalen al parcial y biografías pequeñas de los escritores que se ven en clase. Si lo recomiendo. Es buena onda y comprensible.','NA','201.130.66.1','2007-12-11 16:18:47',0),(176,6,53,'10','La clase estaba muy bien. Nada aburrida y bastante fluida. Y lo mejor de todo... muchos puntos extras.','NA','207.248.33.254','0000-00-00 00:00:00',0),(179,47,53,'10','Muy buena maestra. Enseña muy bien y la clase es muy activa. Yo la lleve y mi calificacion fue muy alta y no fue 100 solo porque un ensayo lo entregue tarde y me bajo puntos por entrgar tarde. No califica perro ni es muy exigente, es flexible mas es estricta cuando lo requiere, casi nunca es asi.','NA','201.137.176.229','2007-12-11 16:18:47',0),(185,47,53,'10','La maestra domina los temas. tienes que hacer mucho trabajo colaborativo en clase, nunca hay tareas mas que los ensayos que son la calificacion parcial y el ensayo final. y es todo, en general una maestra muy agradable','NA','200.76.138.123','0000-00-00 00:00:00',0),(188,283,53,'5','Es una materia de lo mÃ s aburrida, y todavia tiene el descaro de enojarse si te quedas dormido. Los examenes son puros trabajos los cuales son muy lavoriosos y muy estrictamente calificados. Para ella la bibliografia es lo mÃ ximo.','NA','201.128.168.93','0000-00-00 00:00:00',0),(189,17,53,'9','Es buena onda, pero casi nadie le pone atencion, es recomendable sentarse lo mÃ s serca posible de ella, para que hagas relacion con ella y es muy comprensible','NA','201.133.232.188','0000-00-00 00:00:00',0),(192,315,53,'10','Este maestro me encanta. Se la vive poniendote peliculas padres. La verdad es super lindo y su clase esta entretenida. Con tal de hacer la tarea ya tienes 100. La unica razon por que tienes abajo de 90 es porque no haces la tarea. Su tarea consite en el ensayo de cada parcial y el research assignment. La verdad osea ni le hechas muchas ganas y te pone 100. COnt al de que te vea participando y hagas las tareas el maestro te va a querer. Ves muchas peliculas. Esta divertido','NA','201.138.168.2','0000-00-00 00:00:00',0),(194,147,53,'10','La maestra es muy buena onda... llegas a su clases, abres el libro y te empieza a decir todas las respuestas...','NA','207.248.45.19','0000-00-00 00:00:00',0),(195,6,53,'8','Buena clase, solo que para las tareas es recomendable ir a las asesorias, para que ella te ayude y saques 100 en la materia. Tiene poca paciencia, asi que comportense por que si no se vuelve bien perra. Experiencia propia.','NA','131.178.76.36','0000-00-00 00:00:00',0),(197,6,53,'10','Abril es buena maestra, se porta bien y te da la oportunidad de 5 puntos extras por mes si le haces una reseña de una actividad de difusion cultural. Los ensayos la verdad si estan de flojera, pero tienes chance de que ella te lo retroalimente y asi seguro sacas un 10, segun yo si es buena maestra, aparte hace concursos en clase y trata de hacer la clase amena.','NA','201.128.168.65','2007-12-11 16:18:47',0),(199,6,53,'10','Muy muy buena maestra. si te toca en su salón preferido te puede hacer colchonzasos para el parcial desde 5 puntos, por la reseña, hasta de 10, y tiene traumas con los gansitos. Es muy estricta para calificar, pero te pone todo en claro desde el principio. Yo la volveria a meter con ella','NA','207.248.39.254','2007-12-11 16:18:47',0),(201,147,53,'10','Esta conmadre, llegas y te hace abrir el libro a disque hacerlo pero practicamente te dice todas las respuestas. Califica super bien y te ayuda en todo.','NA','201.135.29.73','0000-00-00 00:00:00',0),(203,6,53,'10','Es cierto lo de su obsesión por los gansitos. jajaja, pero la intención es lo que cuenta. la considero barco a gusto. tienes que hacer tus tareas pero no es muy estricta al revisar y si quieres sacar 100 puedes pedirle que lo cheque antes de la fecha de entrega.','NA','131.178.108.41','2007-12-11 16:18:47',0),(206,295,53,'10','Muy buen profe, super buena onda que te enseña muy bien ademas que si te retroalimenta los ensayos y lo que necesites de la materia. No es barco ni nada pero en serio que si vale la pena meter clase con el.','NA','201.130.66.249','2007-12-11 16:18:47',0),(207,19,53,'1','Se supone que esta materia es para levantarte promedio pues de todas las materias que llevaba era la disque fácil. En todo el semestre fue en la única materia que me la estuve pelando para pasar. Es 