eir y lo que tu quieras pero eso no tiene nada que ver porque como quiera los trabajos te los califica bien mal y te trata de joder con lo que puede.','NA','201.133.239.119','0000-00-00 00:00:00',0),(224,242,53,'10','es suuuper buen maestroo hace la clase super padre, bien divertida y amena, si te agarra para echarte carro te dura todo el semestre jeje pero es super buen maestro','NA','207.248.39.254','0000-00-00 00:00:00',0),(225,31,53,'2','se la paso burlandose de la gente y si no le caes bien ya valiste.. siempre busca con que fregarte y hacerte sentir mal... no aprendes nada esta trankila la clase, pero se pone perro cuando califica.. tonz no keda!','NA','207.248.39.254','0000-00-00 00:00:00',0),(226,283,53,'3','A esta maestra nunca la pude complacer con las bibliografias y siempre le preguntaba como se hacian, me respondia pero nunca le gustaba como lo hacia. En los trabajos no quiere nada, te pide una ching...ra de trabajos y tienes que cumplir al pie de la letra P.S: si mencione que nunca vas a tener bien la bibliografia? (sarcasmo)','NA','131.178.185.120','0000-00-00 00:00:00',0),(227,6,53,'10','es una maestra super linda, no haces nada o casi nada en la clase. Pero si le tienes que hechar muchas ganas a los ensayos de cada mes. Califica super bien, y da un chingooooo de puntos extras. Hay veces que no se acuerda de todo lo que dijo que valia puntos extras y al final terminas sacando un 120','NA','148.221.48.191','0000-00-00 00:00:00',0),(231,75,53,'8','Es muy buen profe y buena onda también. Deja pocas tareas pero cuando deja hazlas porque te puede afectar. Siempre pasa lista pero no te trata de afectar con eso. Siempre da asesorias así que no tienes motivo para decir que el ensayo te salió mal.','NA','131.178.76.94','2007-12-11 16:18:47',0),(232,315,53,'8','Muy barco, sin esforzarte sacas más de 90 y es muy fácil sacar 100. El problema es que no se adapta a los contenidos del curso y no aprendes nada en su materia. Te pone películas todo el tiempo y nunca 