','2007-12-11 16:18:47',0),(400,262,144,'7','buen maestro pero divaga mucho es medio perro al calificar los examenes porke no cheka procedimiento.. pero al final redondea de 65 a 70','NA','24.1.175.25','0000-00-00 00:00:00',0),(401,262,144,'9','Es bueno para explicar, pero divaga demasiado. Es muy gritón, y si haces preguntas tontas te puede contestar feo. En general lo considero buen maestro, pero quizás hay mejores. Tip: Sus exámenes son muy parecidos a los de semestres anteriores.','NA','201.153.64.169','2007-12-11 16:18:47',0),(402,262,144,'10','Es buen maestro, en los examenes no califica procedimiento asi que aguas. Habla muy golpeado y que no te sorprenda que en la clase terminen hablando de politica, es buen pedo.','NA','207.248.33.32','0000-00-00 00:00:00',0),(403,262,144,'8','jejeje este profe es la neta!! te hace reír un chorro en clase con sus frases y anécdotas, ah pero eso sí, da bien poquita clase por que se desvía mucho del tema, hace como .7 circuitos por clase. A final de cuentas es chido por que es ligeramente perro pero aprendes con él por el autoestudio. Lo recomiendo.','NA','201.145.99.1','2007-12-11 16:18:47',0),(404,262,144,'10','Sin duda es uno de los mejores maestros de la historia del ITESM. Con cerca de 40 años de experiencia, templanza y dominio absoluto de ingenieria electrica, a eso agregale un muy atinado sentido del humor, sus clases son como Poesia. No puedo negar que aveces se sale del tema, es verdad lo hace, pero les aseguro que no se van de circuitos 1 sin entenderle a algun tema, el maestro jamas titubea, conoce a la perfección todo, es un experto no solo en circuitos sino enseñando, te sabe llevar por ','NA','207.248.39.5','2007-12-11 16:18:47',0),(405,273,145,'9','Explica bastante bien la teoria, y deja varios problemas de tarea (a veces se resuelven en clase). Conoce bastante del tema, aunque a veces se desespera y se enoja cuando el grupo no hace tareas. Sus examenes pueden variar de muy faciles a dificiles, aunque cuando al grupo le va mal por lo regular hace curva. Hay 5 pts extras de la califa final si le das una carpeta con apuntes de todos los temas vistos en clase','NA','207.248.41.177','0000-00-00 00:00:00',0),(406,273,145,'6','La calificación grupal siempre es bajísima, aprendes mucho pero te la pelas horrible, igual y no truenas pero no esperes pasar con un promedio muy alto.','NA','207.248.33.254','2007-12-11 16:18:47',0),(408,135,145,'9','Muy buena profesora, es muy buena gente y explica super bien. Los examenes son algo retadores pero si pones atencion y haces las tareas la haces. Tiene mucha experiencia en el tema y siempre da tips y consejos para que implementes lo aprendido en la vida real.','NA','201.137.176.229','0000-00-00 00:00:00',0),(409,135,145,'9','Es una buena persona. Pero llevar dos materias con ella en el mismo semestre no se lo recomiendo a nadie. Exige mucho y encarga muchas tareas, Electronica y CCII con Cinthia Castro implica que le dediques la mayor parte de tu tiempo. Los examenes tienen sus truquitos y si es importante estudiar para ellos. Al final si haces las tareas te sube el promedio y muy pocos truenan por las tareas, pero si te trae cortito todo el semestre.','NA','200.76.138.11','0000-00-00 00:00:00',0),(411,305,145,'10','La mamada... es uno de los mejores maestros del tec, es a toda madre, un poco perro pero nada del otro mundo, lo recomendaria al 100! Da Circuitos I, II, Energia, Actuadores','NA','207.248.39.254','0000-00-00 00:00:00',0),(412,262,145,'9','Este profe es todo un personaje. En su clase se la pasa gritando y hablando sobre la CFE. Normalmente se sale de tema pero si le pides que te explique cualquier cosa, lo hace de buena gana. Sus examenes no son tan sencillos pero de todos modos vale la pena llevarla con él.','NA','201.130.66.249','2007-12-11 16:18:47',0),(413,339,145,'6','Esta medio perdido el profe... la verdad no explica bien y no conoce el tema. Es buen pedo y le hace la lucha, pero no aprendes nada. Si lo importante es pasar... adelante. Ã?l es el indicado.','NA','200.76.152.5','0000-00-00 00:00:00',0),(414,273,145,'10','lo unico que no debes de hacer es hacerlo enojar, un compañero necio en tu salon puede arruinarles a todos el promedio final y siempre que les diga que va a dar clase el sabado diganle que si y vallan en esas clases resuelve problemas de examen','NA','201.153.16.221','2007-12-11 16:18:47',0),(415,135,145,'9','Muy buena maestra, no se pasa con tareas, te hace el paro con los examenes, explica muy bien, reparte los examenes en chiquitos y uno grande asi no te atora nomas en uno,','NA','148.221.94.89','0000-00-00 00:00:00',0),(416,135,145,'9','Es muy buena maestra, explica bien. Pone de vez en cuando ejemplos de la vida real que te hacen relacionar conceptos de la clase. Explica despacio, haciendo enfasis en lo importante y no se molesta cuando preguntan cosas que ya haya explicado. Las tareas no son tan pesadas, pero son bastante utiles para el examen. El unico pero que le veo es que los parciales son largos, ademas de que pone otro en parejas, y a veces uno para llevar, te llevas una semana haciendo sus 3 parciales... Asesoria nunca','NA','201.153.89.69','0000-00-00 00:00:00',0),(417,273,145,'6','Pues normalmente yo sabia que homero era normalon, griton pero normalon, pero lo que es muy cierto es que este semestre agosto-dic 2005, se puso mas perro, llevaba tronados a casi todo el salon excepto a como 4 , yo era de los mejores de los mas tronados en los tres parciales llevaba 67 . Como que antes le preocupaba tronar a muchos pero ahora ya no.','NA','200.65.134.12','0000-00-00 00:00:00',0),(418,273,145,'10','muy buen maestro las explicaciones de los temas las hace muy bien y si alguien no entiende repite explicaciones. da buenas asesorias. Este semestre ago Dic 2005 estuvo algo dificil. pero con algo de auto estudio todo salio bien al final todo el tiempo de clase se la pasa en el pizarron y una que otra filmina Muy recomendado. yo la trone el semestre pasado con el p