ue ya no dará conta administrativa.','NA','207.248.39.254','2007-12-11 16:18:47',0),(646,190,203,'7','La verdad no aprendí gran cosa en la clase, porque al profe realmente no le interesa mucho si participas o no. Puedes estar en la compu y no te dice nada. En los exámenes le encanta llegar tarde y poner problemas en inglés que luego están algo fumados, pero después en la revisión te echa la mano.','NA','201.153.103.210','2007-12-11 16:18:47',0),(647,190,203,'2','No explica nada siempre llegas super tarde se la pasa solo haciendo problemas en el salon pero 0 que te explica los examenes estan perros te puedes copiar pero nadie sabe nada.','NA','201.128.177.90','0000-00-00 00:00:00',0),(648,109,203,'8','Es super buena maestra pero tienen que llevarsela muy bien con ella para que no los agarre en carro, no hablen en clase y traten de ser participativos, sus examenes son faciles y casi todos los pasan, lo unico malo es que si hay que leer el libro si esperan que les vaya bien. Otra cosa ella muchas veces no toma lista y falta mucho porque esta de viaje muy seguido. Es garantia, metanla con ella.','NA','201.128.177.245','0000-00-00 00:00:00',0),(649,107,203,'10','Excelente maestra, da muchos puntos extras, muy accesible. Da bastante tarea pero vale la pena. Metanla con ella si hacen tareas y apuntan en clase, ya que asi es un 90 para arriba asegurado. Los examenes son libro abierto.','NA','201.153.103.133','0000-00-00 00:00:00',0),(650,107,203,'1','Esta maestra es la peor maestra que he tenido en mi carrera. Es la unica materia que he reprobado y todo porque no le caia bien. No explica bien, es una grocera, teniendo super buena calificacion me reprobo al final y no me quiso dar revision. Yo la verdad no les recomientdo meterla con ella. La califico con 1 porque no hay 0.','NA','200.78.66.183','0000-00-00 00:00:00',0),(652,377,203,'10','Excelente maestro','NA','131.178.110.138','0000-00-00 00:00:00',0),(653,107,203,'10','Es la mejor profe de todas. Te da puntos y si ve que