,45,'10','Estricto hasta morir, pero buen maestro','NA','131.178.203.12','0000-00-00 00:00:00',0),(166,440,51,'10','Excelente profesor los parciales son lo mismo que viste durante la clase la clase es de hora y media pero siempre deja salir temprano cada parcial pone un ejercicio para puntos extras explica super bien las tareas no hay problema si se las entregas tarde es super flexible y el final solo vienen dos temas y no es acumulativo la verdad esta super agusto su clase y a veces toma lista pero la mayoria del tiempo casi no','NA','201.153.92.104','0000-00-00 00:00:00',0),(173,680,55,'8','Muy buena Maestra, pero muy exigente! Arriba de 85 garantizado!!','NA','201.145.5.175','0000-00-00 00:00:00',0),(175,494,53,'8','La clase esta mas o menos, no es tediosa pero siempre ven lo que esta en el libro y todo se apega al libro. Las tareas son ensayos de lecturas, y hay un proyecto final que es en parejas. Sales bien si cumples los lineamientos al pie de la letra, no demanda mucho esfuerzo solo cumplir con lo que pide aunque no sea de alta calidad. Toma lista.','NA','201.133.243.191','0000-00-00 00:00:00',0),(177,681,53,'7','Es buena, pero muy estricta con el protocolo a seguir para los ensayos y a los que no sabes escribir si los atora. Si sabes de alguien mejor paga para que te hagan los ensayos.','NA','201.133.56.118','0000-00-00 00:00:00',0),(178,681,53,'6','La clase esta bieeen aburrida y nunca haces nada. Para mi estaba toda divertida porque nos burlabamos de todo, por cierto, la maestra habla como si estuviera borracha. Si le sacas platica ya la hiciste, y el tema clave es el cine, asi que ya sabes nomas pregúntale qué película vio ese fin de semana. En los ensayos los califica BIEN perros porque se fija demasiado en el formato más que en el contenido.. y pos ... porque está borracha.','NA','207.248.33.254','2007-12-11 16:18:47',0),(180,494,53,'10','No batallé en lo más mínimo con esta materia para ésta clase. Haz todas las tareas siguiendo bien los lineamientos 