aestra que hay, no puede ser que haya una persona como ella, encarga miles de tareas, explica una cosa y luego te dice \"no perdón asi no era\" y borra todo y lo vuelve a hacer y así, los exámenes estan revueltísisisisisismos y no vale la pena la verdad, explica muy revuelto. NO LA RECOMIENDO PARA NADA','NA','201.153.39.47','2007-12-11 16:18:47',0),(342,463,124,'10','Es una excelente tutora y muy amigable. Sacarás siempre cien con ella y si te la quieres llevar tranquilamente, no lo debe dudar. Métela con ella.','NA','131.178.109.50','2007-12-11 16:18:47',0),(346,439,125,'7','Sus explicaciones en clase son un poco complicadas, se traba cuando habla y es dificil entenderle. Pero si lees el tema antes de llegar a la clase entiendes mucho más fácil lo que va a explicar. Sus examenes son muy muy dificiles de entender por que no sabe formular muy bien las preguntas. Si pueden exijanle que esté en la clase el día del examen y pregunten que es lo que quiere que le contesten. Pero en fin es bueno y aparte es el único que la da.','NA','207.248.39.254','2007-12-11 16:18:47',0),(347,439,125,'8','te hace estudiar el tema, es un poco complicado, mas que nada hace preguntas muy especificas, pero de verdad aprendes','NA','201.135.45.168','0000-00-00 00:00:00',0),(348,439,125,'5','En \"Biología Mediocre\" Se revuelve al explicar y la verdad la clase empieza bien pero conforme avanza el curso y los temas se complican Zertuche no sirve para explicarlos, si le hacen preguntas siempre contesta con un \"luego lo veremos\" y ese luego nunca llega. La verdad su explicación es demasiado simple. Solo el entiende lo que quiere que le pongas en el exámen. La materia con el no es dificil, pero si de verdad te gusta aprender no la metas con él.','NA','131.178.98.206','2007-12-11 16:18:47',0),(349,439,125,'6','El profesor se confunde al explicar. La clase no es nada dinámica porque toda la clase la da con diapositivas. En el examen nunca sabes lo que el profesor quiere que contestes.','NA','200.78.84.57','2007-12-11 16:18:47',0),(350,439,125,'7','La mera neta sabe un chingo el wey, pero no sabe explicarlo... le haces preguntas y te dice....\"Reformula tu pregunta, estoy seguro que eso no es lo que me queria preguntar\" y cuando estas resolviendo sus examenes sientes ganas de decirle lo mismo, porque hace sus preguntas muy generales y quiere respuestas muy especificas, puedes contestarle una pregunta bien y te la pone mal porque no es lo que queria. Al igual que sus slides no les entiendes mucho, menos a las que pone en ingles y español','NA','201.129.121.85','2007-12-11 16:18:47',0),(351,439,125,'9','Pues a mi si me gusto como da la clase los temas ya para finalizar el curso si estan mas complicados pero la neta yo con nada mas estudiar las slides y poniendo atencion la pase con 82 asi ke si con el minimo esfuerzo se puede sacar eso pues yo creo ke esta super bien aparte interesante','NA','207.248.39.254','0000-00-00 00:00:00',0),(352,439,125,'2','Â¨Pues como dice la demas raza, el w sabe pero te explica de la ching... lastima de materia ya que esta muy fregona en lo personal pero es algo tediosa y aburrida la manera en que se ve, los examenes los hace de las diapositivas asi que no le busques mucho al libro, es estricto a la hora de revisar los examens y las tareas tienes que pensar como el. Si no es exactamente como quiere esta mal','NA','131.178.26.213','0000-00-00 00:00:00',0),(353,439,125,'1','Porque no tienen calificacion 0? jajaja la neta es mal maestro, no explica bien , se revuelve solo y esta perdido sin el proyector. Una vez se quedo sin proyector y dijo lo mismo durante media hora. La neta yo me dormia en sus clases y a veces ni iba porque aprendi mas en un libro y con mi hermano que con el. Pero sobre todo, sus examenes es a como el le paresca, si no le gusto lo que escribiste te quita muchos puntos. No te ense;a a pensar libremente sino te ense;a a pensar como el.','NA','201.139.55.199','0000-00-00 00:00:00',0),(354,439,125,'2','Su clase es super tediosa, sabra mucho, pero deberia tomar una maestra en educacion ya que su metodo de ense;anza y aprendizaje es pesimo. No sabe explicar. Ademas de que es el unico que da la materia, asi que ... suerte.','NA','207.248.39.219','0000-00-00 00:00:00',0),(355,468,127,'9','Es buena porfe, explica bastante bien. Sabe bastante pero la neta aun se le van muchas cosas, sabra mucho de Biologia pero en quimica si se queda corta. La mera neta es mucho mejor que Zertuche. Y como recomendacion no falten a las clases, con ella si se te va el hilo de la clase.','NA','201.139.55.199','0000-00-00 00:00:00',0),(356,468,126,'5','No me agradó su clase. La verdad deberían juntar Biología Moderna y Molecular porque son cosas de machete que no tiene caso ver durante 2 semestres. En los examenes te pregunta cosas super exactas \"cuanto mide el ADN? 2, 3, 4, ó 5 nm?\". Sus examenes son de \"confusión múltiple\" porque es española y parece ke no se le da redactar con claridad las preguntas. No sabe mucho de química... su clase me durmió.','NA','131.178.99.29','2007-12-11 16:18:47',0),(359,538,129,'10','Ahora si, un excelente profesor, da ejemplos sencillos y resuelve todas tus dudas, la clase es amena aunque hay gente que dice que es aburrida a mi me parecio interesante. Además aprendes de muchas otras cosas, y los exámenes estan tranquilos','NA','201.129.108.241','2007-12-11 16:18:47',0),(374,505,137,'10','Su metodo de enseñanza es demasiado útil! porque busca desarrollar tanto las habilidades de lectura, escritura y verbales. Además de que siempre proporciona datos útiles sobre la cultura china, es muy agradable.. los examenes solo son difíciles si de plano no le pusiste atención. Al principio se batalla un poco con su acento pero despúes de la segunda clase todo se hace mucho más ameno y le encanta tomar fotos y video a sus alumnitos así que pues derrepente dense una manita de gato. Ade','NA','207.248.39.254','2007-12-11 16:18:47',0),(375,505,137,'10','Clase muy muy facil la verdad! Como que en China no comprenden el concepto de hacer trampa. Si quieres aprender si es muy buena maestra aunque el libro que se usa en la clase es medio chafo y aprendes pura tonteria, nada realmente util. La maestra es muy buena y muy inocente, un 90+ facil la verdad (almenos que de neta no te apliques). Escojeria esto por mucho en lugar de cualquier otro idioma.','NA','201.130.66.249','0000-00-00 00:00:00',0),(377,601,144,'9','Es un profesor un poco frio, pero explica todo muy bien y muy claro, sin encargar muchas tareas. Cuando yo la lleve con el sus examenes estaban tranquilos y no habia laboratorio, pero al parecer ahora los pone mas perros y tambien agrego lab.','NA','207.248.41.177','0000-00-00 00:00:00',0),(379,601,144,'9','Es bien barco!!!!!!!','NA','201.130.66.1','0000-00-00 00:00:00',0),(381,550,144,'10','Excelente maestro. Es perrísimo, pero aprendes un chorro y a diferencia con otros maestros como Homero Nuñez o asi, este maestro es conmadre y explica mejor. No esperes salir con muy buena calificación y vas a batallar mucho en los examenes, pero siempre da como 10 puntos extras (con los que alcanzas el 70) y si llevas todas las tareas y no faltas, si vas a su oficina a asesorias, a fuerzas te pasa.','NA','207.248.33.254','2007-12-11 16:18:47',0),(382,550,144,'9','Muy buen profesor, sabe mucho y no solo de la clase que da, si no tiene mucha experiencia laboral y te da muy buenos tips en proyectos y actividades. El unico defecto es que es medio perro pero si le echas ganas pansas con un 70, los promedios mas altos con el son como de 80 asi que un 70 es bueno. Da puntos por investigaciones y proyectos.','NA','201.137.176.229','0000-00-00 00:00:00',0),(383,601,144,'7','Podría explicar mejor. Además creo que vemos muy pocos ejemplos en clase. En vez de ver muchos ejemplos diferentes, nos explica unos cuantos muy a fondo. Y eso a veces perjudica en el examen si te pone uno diferente. No sé si metería de nuevo con él.','NA','201.133.209.211','2007-12-11 16:18:47',0),(385,601,144,'6','Cuando la llevé creí que era buen maestro, porque explicaba algunos ejemplos a fondo y también algo de teoría. Pero después, en materias como circuitos 2 o electrónica te das cuenta de que todos saben cosas importantes que tú no sabes porque guzmán no te las enseñó. Su clase es muy fácil, pero después sufres por eso.','NA','201.133.57.80','2007-12-11 16:18:47',0),(387,636,144,'1','pesima profesora, al igual que en estatica esta profesroa simplemente no sabe nada, por mas que trata de hacer algun problema del libro, no es capaz de resolver ninguno. Ella es la que termina aprendiendo de los alumnos, talvez escuches que es barca pero no es, asi, no enseña practicamente tu eres el que tienes que ver la forma de entender los temas, la unica ventaja es que los examenes son iguales al del libro de texto, pero te recomiendo que no desperdicies tu dinero en ella.','NA','201.129.84.172','2007-12-11 16:18:47',0),(388,636,144,'1','NO SABE EXPLICAR NADA, VAS A LA CLASE A HACERTE WEY PORQUE NO VAS A APRENDER, LOS EXAMENES LOS SACA DEL LIBRO PERO LOS QUE NO TIENEN RESPUESTA TONZ TE LA TIENES QUE PELAR ESTUDIANDO YA SEA CON ALGUIEN QUE SEPA O POR TU PROPIA CUENTA ESTUDIALE PORQUE SI NO NO LA HICISTE. NO METAN CON ELLA NUNCA NADA, NO SABE NADA, NO PARECE QUE SEA MAESTRA DEL TEC.','NA','207.248.39.254','0000-00-00 00:00:00',0),(389,636,144,'1','por lo general hay varios weyes haciendo relajo en el salón por lo cual le ponen más atención a ellos que a la maestra, no tiene control sobre el grupo, los nerds del salón son los que explican la clase ya que la maestra no sabe NADA pero asi NADAAAAAA asi que si no hay otro maestro mejor dejala para el otro semestre porque echaras a perder tu dinero','NA','207.248.38.48','2007-12-11 16:18:47',0),(391,601,144,'10','Es muy buen maestro. Las tareas que te deja son las que vienen en el examen, todo lo hace muy meticulosamente lo cual hace la clase un poco lenta, pero es muy inteligente, y si vas a asesorías definitivamente te ayuda. Los laboratorios son buenos y te ayudan a forjar conceptos.','NA','207.248.42.244','2007-12-11 16:18:47',0),(395,601,144,'10','Muchos se quejan de este maestro pero es justo, el problema es que el maestro *si* encarga problemas del libro pero te dice que nunca los va a revisar, entonces nadie los hace, pero con hacerlos es suficiente para salir con un 95 en el examen. Sus examenes no son complicados, viene exactamente lo que encargo del libro (en el tercer parcial incluso era un problema era el mismo) y es muy paciente. Siempre podras preguntar algo que no entendiste.','NA','200.79.113.162','0000-00-00 00:00:00',0),(397,601,144,'10','Es un buen profesor, explica lo básico durante la clase y los exámenes estan al nivel. No viene nada que no hayas visto en clase. Durante el semestre te va encargando problemas de tarea para que al final se los entreges y te sube puntos en la nota final. Los laboratorios que implemente si son algo largos pero te ayudan a aprender. Es una clase tranquila y vez todo el temario bien.','NA','201.137.207.136','2007-12-11 16:18:47',0),(407,437,145,'10','Excelente profesor, no es perro ni muy barco.. Muy buena opción y sobre todo comparando los demás maestros que dan esta materia. Lleva la clase a un ritmo normal, que todos entienden, las tareas son como los problemas de la clase y los examenes igual. Es un poco injusto a la hora de calificar en el sentido en que te baja muchos puntos por cualquier cosita, pero si vas y le reclamas te los sube. Haciendo todas las tareas pasas a fuerzas porque los examenes son iguales a las tareas.','NA','207.248.33.254','2007-12-11 16:18:47',0),(410,498,145,'10','Excelente maestra, me atreveria a decir que es la maestra que mejor explica en el tecnologico. La maestra es super inteligente. Los examenes estan normales. Si en el examen final sacas calificacion superior a la que aspirabas, te deja la calificacion del examen final (i.e. si sacando un 100 en el examen final alcanzabas 85 final final, y sacaste 90, te deja el 90 final final). Super recomendable. No solo da circuitos II da otras materias pero la van rotando. Si la ves mete con ella.','NA','148.221.96.156','0000-00-00 00:00:00',0),(429,686,176,'10','Lo lamento pero si sabe de C++ y si es buena maestra, en respecto a asesorias, ni sé. saludos =)','NA','201.133.243.117','2007-12-11 16:18:47',0),(432,645,176,'7','Al principio tuvimos muchos problemas con Ã¨l, nunca se pudo adaptar a nuestro grupo e hizo que el ambiente de trabajo fuera muy malo. Ya despuÃ¨s se fue mejorando. Te pone trabajos interesantes, critica mucho y tienes que saber aceptar sus criticas','NA','207.248.42.159','0000-00-00 00:00:00',0),(436,645,176,'2','Es un maestro sumamente estricto, es cierto que batalla mucho al adaptarse a los grupos ya que con el nuestro paso lo mismo.. critica mucho a veces demasiado, te hace ser competitivo pero a la vez te dice que no debes serlo, es muy raro igual que su clase.. solo que si explota demasiado tu lado creativo eso es lo bueno de su clase aunque califica como quiere y nunca te dice que sacas en los trbajas tu calificacion es una sorpresa.. aveces no muy buena','NA','201.133.219.106','0000-00-00 00:00:00',0),(444,645,176,'7','- No es muy objetivo en su clase, a veces improvisa un poco. - Es una persona algo especial en cuanto a caracter, puede ser algo hablador. - Como muchos, tiene sus favoritos. - Si la metes con el, se muy barbero y dale por su lado, es raro que repruebe gente. - Es flexible en cuanto a retardos. - Lo unico que quiere es interes. - Esta bien un solo curso con el y ya, ya que explota tu lado creativo te hace ir evolucionando.','NA','200.52.7.58','0000-00-00 00:00:00',0),(451,686,179,'10','Excelente maestra. Aprendes perfectamente y orenadamanete con ella el lenguaje C++. Muchos dirían que es bien perra pero no es cierto. sus examenes tiene un nivel de dificultad normal. Ni dificil ni facil. Si tienes algun problema ella es accesible.','NA','201.153.125.45','2007-12-11 16:18:47',0),(452,431,179,'10','Alias \"La pejelagarta\" Es muy chistosa y divertida, por lo que la clase super amena... solamente pon atención en clase y listo...','NA','201.130.66.1','2007-12-11 16:18:47',0),(454,686,179,'9','Es muy buena gente, aveces no puede controlar al salon, pero si hace paros por que encarga mucha tarea, pero de que aprendes, aprendes, y los examenes estan faciles.','NA','201.133.56.118','0000-00-00 00:00:00',0),(455,686,179,'10','Excelente maestra, es toda paciente. los examenes y tareas son parecidos que los demas grupos entonces en eso no hay ventaja, la ventaja está en que se lleva la clase bien tranquilo y le puedes preguntar lo que sea y te ayuda.','NA','207.248.33.254','2007-12-11 16:18:47',0),(456,431,179,'8','Un poco enferma con Java, osea, habla de él como si fuera a resolver el hambre en el mundo y el racismo y erradicar a los judios y homosexuales de la faz de la tierra, pero si aprendes y es chida','NA','201.145.10.169','2007-12-11 16:18:47',0),(457,431,179,'10','Yo no tuve ningún problema en esta clase... Sólo es cuestión de poner atención y hacer las tareas. En general creo que es buena maestra.','NA','201.133.209.211','2007-12-11 16:18:47',0),(458,519,179,'8','Es buena maestra, pero creo que hay mejores. No explica muy bien los conceptos, pero a la hora de calificar, es muy alivianda... Tambien da buenas asesorias..','NA','201.130.66.1','0000-00-00 00:00:00',0),(461,686,179,'10','Excelente maestra. Los examenes estan faciles. Si haces las tareas, ya la hiciste.','NA','131.178.202.12','0000-00-00 00:00:00',0),(462,686,179,'1','Fatal...califica pesimo y no te da ningun punto. si no le entiendes ni te ayuda. Si no eres bueno para compu y necesitas mas ayuda..ni la metas con ella','NA','207.248.43.68','0000-00-00 00:00:00',0),(463,686,179,'1','AMIGO HAZME CASO NO LA METAS CON ELLA no se quien escribio eso que es buena maestra y no se que seguro un geek ñoño que se volvio su dscipulo, sus tareas estan bien perras, te encarga un trabajo 