.100','0000-00-00 00:00:00',0),(477,431,179,'10','es barquisima pasas pq pasas llevala con ella es conmadre','NA','207.248.46.250','0000-00-00 00:00:00',0),(478,686,179,'10','Nose quien escribio tantas cosas feas de esta maestra, pero realmente vale la pena meter la materia con ella... es super paciente y muy buena gente. Sabe muchisimo de programacion en C++... No le pongo un 15 porque no se puede... Metanla con ella.... si van a aprender C++','NA','207.248.39.252','0000-00-00 00:00:00',0),(482,545,180,'8','Explica muy bien, pero tienes que poner atención, la clase no es muy divertida y tienes que practicar mucho, si te toca proyecto es de dedicarle mucho tiempo por que ella quiere avances muy rápido y juntas.','NA','201.133.56.118','2007-12-11 16:18:47',0),(489,545,180,'3','Es muy mala maestra, no explica bien ya que nada mas se sienta en su escritorio y hace el programa en la compu. Es bien pesada para revisar los examenes y el final esta impasable.','NA','131.178.47.21','0000-00-00 00:00:00',0),(490,499,180,'4','en clases explica mal, siempre c equivoca en todo, y si la llevas en ingles ya date por muerto no vas a entender nada mejor juntate con un nerdillo y que te explique mejor.','NA','207.248.39.249','0000-00-00 00:00:00',0),(491,545,180,'1','no le gusta dar clases, no explica bien. SI es en ingles ya la regaste por meterla con ella, no sabe hablar en ingles.','NA','207.248.39.249','0000-00-00 00:00:00',0),(493,499,180,'1','De lo PEOR!!!! No sabe explicar!!! la clase es muy aburrida, y sus explicaciones un poco peor. A veces dice \"chistes\" de los cuales te ries solo por lastima =| Los examenes están muy perros, y el final parece imposible. Si tienes que hacer proyecto, vas a sufrir mucho con los entregables, y aunk te kede muy chido, si tienes algo mal con los entregables, ya perdiste muchos puntos, y vale un chingo ese proyecto (como 40 ptos) Ni sikiera es util bajar los programas que sube ya que hace demaciadas ','NA','131.178.77.54','2007-12-11 16:18:47',0),(494,499,180,'2','la maestra no da una, no sabe explicar, no hace bien los ejemplos, los examenes los hace con ganas de fregarte...','NA','131.178.200.236','0000-00-00 00:00:00',0),(495,444,180,'10','Yo llevé esta materia en el verano, ya que no sabía nada de c++, ya que había llevado java en otro campus. Es super buena onda, salí con muy muy buena calificación así es que es la mejor opción si eres mecatrónico, ya que con las otras dos maestras (Olivia Barrón y Martha Sordia) he conocido gente super ñoña que reprueba esa materia.','NA','207.248.39.254','2007-12-11 16:18:47',0),(496,545,180,'7','Esta maestra es un mixed bag. Uno siente que no le gusta dar su clase. Pero al mismo tiempo siempre te le puedes acercar a preguntarle. La clase si requiere de tu atencion e investigacion; consiguete buenos companieros. Eso si, no sabe ingles; HEARTH!','NA','200.64.140.176','0000-00-00 00:00:00',0),(497,545,180,'4','Malisima maestra, no se preocupa por sus alumnos, le vale si aprendes o no, lo unico que le importa es fregarte en el final. No explica, le da hueva dar las clases, y al final si tronaste no te pasa por ningun motivo, ni aunque tengas 69.99, si metes clase con ella, haz todos los resumenes y asiste a todas las juntas con ella.','NA','201.153.37.18','0000-00-00 00:00:00',0),(498,499,180,'2','Es una maestra muy mala, no sabe hablar el inglés y si se junta con Olga Barrón tu pesadilla se vuelve aún peor. No la metas con ella en inglés. Los entregables y proyecto los califica muy a fondo. Busca otras opcion. Sus exámenes estan algo confusos porque no sabe redactar los problemas y es perra pra calificar','NA','201.137.207.136','2007-12-11 16:18:47',0),(499,545,180,'1','Pesima maestra!!! no recomendable!!!! salvate a ti mismo. es mejor aprender por ti mismo.','NA','201.137.207.136','0000-00-00 00:00:00',0),(500,545,180,'9','Explica bien, y sí es paciente aunque muchos digan que no, o sea, si le preguntas algo que ya explicó te va hacer una cara de desesperación pero de todas formas te lo va a explicar. Es muy accesible para dudas del proyecto. Sí es estricta para calificar, pero si le echas ganas te debe ir bien en la materia. Y pues de acuerdo a la impresión de varias personas, creo que es mejor que Sordia.','NA','201.153.64.169','2007-12-11 16:18:47',0),(501,499,180,'1','PÃ?SIMA maestra, probablemente la peor qeu he tenido en mi historial académico. sí conoce los temas, pero NO EXPLICA NADA, en al clase prende el monitor y nomás teclea lo qeu le digas, lo prueba y sale error, y no te dice porqué, hasta que el ñoño le dice cómo hacerlo, y cuando el programa sale bien, no dice porqué. Además cuando vas a pedirle asesorías, no se cómo, pero te deja con más dudas y no te ocntesta NADA. sus exámenes estás demasiado difíciles y largos, en clase de 1.5 h','NA','207.248.35.105','2007-12-11 16:18:47',0),(502,499,180,'3','al shile esta maestra nomas no!! en la clase no explica nada, se pone a teclear y no sabes ni lo que esta haciendo.. a final de cuentas ni compila su programa y dice \"les mando el ejemplo al mail para k lo revisen\" (que tmpoco ayuda mucho) en asesoria solo contesta diciendo que \"algo debe estar mal\" (de vdd?!?!? o_0), no dice nada concreto, te deja con las mismas o mas dudas, sus examenes estan dificiles y tienes k dedicarle mucho tiempo al proyecto y sus entregables','NA','201.128.137.155','0000-00-00 00:00:00',0),(503,545,180,'9','A veces si te hace cara de fuchi si no entendiste bien lo que explicó, pero de cualquier manera siempre te ayuda. Es súper paciente para asesorarte con el proyecto, y si le pides ayuda te la da... lo que si hay que reconocerle es que califica más suave que Sordia, y los exámenes los pone mucho más fáciles...','NA','148.233.239.24','2007-12-11 16:18:47',0),(504,545,180,'8','Pues de que la materia está difícil, esta MUY difícil, pero esta materia (si eres IEC, IMT, o IFI) solamente la dan ella y Martha Sordia, y es mucho mejor llevarla con Barrón; el examen es el mismo, pero Barrón califica mucho mejor que Sordia, te da puntos hasta por haber empezado a hacer el problema; no está nada fácil pasarla pero entre las dos opciones de maestras, es mucho mas probable que la pases con Barrón.','NA','201.133.210.182','2007-12-11 16:18:47',0),(512,490,181,'10','Excelente maestro muy tranquila su clase, encarga tareas faciles y los examenes parciales son con libro abierto, siempre te deja salir temprano. no batallas nada lo recomiendo','NA','201.128.177.90','0000-00-00 00:00:00',0),(514,490,181,'9','excelente clases ..las tareas facilisimas y dos de ellas valen mas que un examen parcial ..es de ley que pasas la materia..','NA','207.248.39.254','0000-00-00 00:00:00',0),(520,490,181,'10','sus examenes super super sencillos, son a libro abierto y regala hasta 20 puntos.. metanla con el.. no mas hagan todas las tareas por que cuentan mucho.. si las haces ya pasaste','NA','207.248.39.162','0000-00-00 00:00:00',0),(525,465,182,'8','Esta maestra es lo maximo. Es bien linda y explica super bien. Es bien accesible para dare asesorias. Siempre te ayuda y su clase tiene un ambinete agradable. Sus examenes estan medio dificiles pero si haces el laboratorio de ley te va bien.','NA','201.138.168.2','0000-00-00 00:00:00',0),(528,444,182,'10','exelente maestra, explica super bien, es muy tratable, no encarga tantas tareas, los examenenes son faciles y es muy alivianada a la hora de calificar; definitivamente lleven esta materia con ella','NA','200.94.212.125','0000-00-00 00:00:00',0),(529,465,182,'10','Su clase es muy pero muy aburrida.!!! Pero pasas al final..','NA','201.135.35.145','0000-00-00 00:00:00',0),(530,650,182,'9','Suuuper buen maestro, explica bien, te ayuda demasiado, si eres chava y le caes bien ya la hiciste porque te da puntos por nada. Muy buena onda, y demasiado barco al revisar los exámenes. Es de los mejores en compu.','NA','201.128.180.113','2007-12-11 16:18:47',0),(532,465,182,'10','Suuuper linda maestra, es toda buena, te puedes copiar en sus examene