upo. los parciales son en parejas, en los discursos es muy flexible y da mucha confianza. en fin...metanla con ell!','NA','131.178.77.27','0000-00-00 00:00:00',0),(606,433,189,'10','Madya es la mejor. Te hace reir bastante la clase es super amena, se lleva super con todos. No es barca pero es buena, sabe lo que hace y es muy agradable. Le encanta la onda del karma y esas cosas raras por lo que sabe como tratar a la gente. Ampliamente recomendada.','NA','207.248.39.254','0000-00-00 00:00:00',0),(608,567,189,'10','muy buena maestra... da su clase de relax.. lo unico estresante de su clase es el pasar al frente.. es objetiva en sus comentarios de las areas a mejorar lo hace con la intencion de ayudar.. y sobre todo es una profe que se muestra como amiga con sus estudiantes.. le encanta el chisme y hacerla de cupido..','NA','207.248.39.254','0000-00-00 00:00:00',0),(611,433,189,'7','MM pues... la verdad como maestra es pesima...y es poco eso...lo bueno es que se la pasa hablando de todo menos de la clase, platica su vida aburrida miles de veces,,, y nunca da clase,.. pero en sus examenes si te pone todo y califica medio mal.. te pondera la misma cosa varias veces...','NA','131.178.201.27','0000-00-00 00:00:00',0),(612,433,189,'7','No se que hacen en el tec, no explica nada y sus examenes stan bien largos y medio complicados.','NA','201.130.66.249','0000-00-00 00:00:00',0),(614,656,189,'10','Metanla con ella, no hace nada califica conmadre con que llenes lo que te pide y los examenes son en equipo y mas facil que si fuera con libro abierto','NA','201.135.5.53','0000-00-00 00:00:00',0),(615,656,189,'10','La neta yo le ponía 9, no 10, pero se lo dejo para no bajarle el promedio, jajaja. Si es muy buena maestra, y su clase es muy amena. Ella escribió el libro y pues como que, dado que sabe más, usa más su criterio y no es tan rígida para seguir el programa, como sí son algunos otros profes.','NA','131.178.77.23','2007-12-11 16:18:47',0),(616,449,189,'7','Es muy buena onda, 