!.','NA','131.178.200.139','2007-12-11 16:18:47',0),(633,554,191,'8','Profesor muy preparado académicamente, con 2 licenciaturas y doctorado...lastima que no sepa mantener el control del grupo.Más de 90 asegurado. Muchos puntos extras Las clases pueden llegar a ser cansadas por su tono de voz y un muy limitado repertorio de movimientos corporales ( vease el hipnótico movimiento de sus manos).','NA','131.178.200.191','2007-12-11 16:18:47',0),(634,554,191,'10','El es el autor de el libro sobre el mismo tema, Fallido intento de ganar una diputación federal por ende no le sirvió de nada escribir el libro, es un hombre sentimental, se intenta de preocupar por el grupo pero no tiene el control, es muy buena gente demasiado para le gusto de todos y tendrás un 10 asegurado porque solo alguien que sea muy imbecil sacaría nueve con el, excelente para relajarte si tienes sobrecarga, lo recomiendo totalmente pero no si quieres aprender de masâ?¦','NA','131.178.200.139','2007-12-11 16:18:47',0),(635,554,191,'4','Es un profesor con un fuerte sentido ético pero nada más; la clase da para mucho pero él no. Es un regalo y si necesitas puntos y quieres perder el tiempo métela con él pero si tus horizontes no son tan limitados y pequeños, definitavemnte NO.','NA','131.178.203.79','2007-12-11 16:18:47',0),(637,554,191,'10','El profe sabe un chingo, pero es chido ya que todos pasan con 100, no se amarga la vida. La clase de repe da hueva pero si quieres pasarla alivinado este es el bueno...','NA','201.153.121.119','0000-00-00 00:00:00',0),(638,554,191,'5','El profe sabe mucho y la materia da para mucho, pero no enseña nada. Cuando la llevé los quedábamos las clase éramos nosotros cuando exponíamos los capítulos del libro por equipo. Creo que es introvertido y le cuesta controlar el grupo y pararse enfrente a exponer todo lo que sabe.','NA','131.178.128.160','2007-12-11 16:18:47',0),(639,554,191,'10','MUCHAS GRACIAS por sus comentarios. Soy su amigo Oscar Ochoa ejerciendo mi DERECHO DE R