e mal). Se confunde al explicar (fue muy divertido cuando empezó a contradecirse en lo del derecho a la revolución y el derecho de la revolución).','NA','207.248.39.252','2007-12-11 16:18:47',0),(901,91,254,'10','imparte derecho procesal, y es muy buen maestro, nada mala onda como algunos pesimos maestros, al contrario muy buena onda. vale mucho la pena. aprendes con el.','NA','207.248.39.252','0000-00-00 00:00:00',0),(902,300,264,'8','El profe es una eminencia y lo sabe. La verdad no explica tanto en clase. Da ejemplos de lo que puedes hacer, pero no te _enseña_ cómo hacerlo. Es prácticamente autoestudio, así que tienes que saber medir tu avance. Lo que sí me gustó es que te exige, no por perro o porque truenes, sino porque quiere que las cosas queden bien hechas. Muchos le reclaman esto, pero sí le doy la razón. Si participas y ve que estás interesado en la materia, te echa la mano. Da buenas asesorías.','NA','201.153.103.210','2007-12-11 16:18:47',0),(903,300,264,'5','Es demasiado exigente, nunca sabes exactamente cómo vas (a excepción de las revisiones del proyecto). Se tardan como un mes en darte los resultados de las prácticas (que es lo que más vale). Por lo menos a mí nunca me dio una buena asesoría, siempre te dice que cheques en Google. Te encarga cosas bien perras, pero casi no te explica cómo hacerlas. Aprendes igual si te agarras tutoriales de PHP, CSS y JavaScript. Si no tienes un buen equipo o si te falta aunque sea una sola práctica, olvÃ','NA','201.133.209.101','2007-12-11 16:18:47',0),(904,300,264,'8','jajajaja, cuando trabaje en Amazon... eso en amazon no hubiera pasado. . . jaja, es cierto se la pasa hablando de cuando trabajo en Amazon. La materia es muy interesante, yo la pase por que tuve un muy buen equipo, asi que si quieren pasar primero informense de quienes de sus companeros tambien la van a meter para establecer el equipo desde antes, aqui si se necesita que TODOS trabajen','NA','207.248.39.254','0000-00-00 00:00:00',0),(905,300,264,'8',