inal te ayuda. Lo bueno es que ni encarga tareas solo 1 al mes.','NA','207.248.44.74','2007-12-11 16:18:47',0),(1124,589,320,'8','Explica bien, pero no es barco. Para salir bien hay que poner atencion, hacer todas las tareas y estudiar bien para el examen, no hay que confiarse por que cuando el explica si le entiendes pero en el examen batallas. Si toma lista, y se pone exigente con eso. Tiene su reglamento y se apega mucho a el. Es buena opcion si quieres aprender, pero no para flojear esperando salir bien.','NA','201.133.243.191','0000-00-00 00:00:00',0),(1125,605,320,'10','Examenes Tranquilos, explica bien la mayoria de los temas, encarga tareas suficientes pero rapidas, y es buena onda','NA','207.248.41.177','0000-00-00 00:00:00',0),(1126,558,320,'10','Bastante perro. Explica bien rapido y no modula su voz, asi que sus clases se pueden tornar algo desesperantes... pero su letra es Times New Roman en el pizarron y siempre tiene todo ordenado asi que eso ayuda mucho para estructurar todo en la mente. Se aprende un chorro con ese maestro y si se te da la materia ya la hiciste. Es medio perro en los examenes pero lo chido es que le puedes preguntar LO QUE SEA durante el examen y te lo contesta entonces es un aliviane. Te deja sacar cualquier cosa,','NA','207.248.33.254','0000-00-00 00:00:00',0),(1127,589,320,'9','Bastante buen profesor. Si tienes cualquier duda te la aclara bastante bien y demuestra que domina la materia. Al calificar es bastante justo. Tiene ya definido hasta que parte de cada problema te da cuantos puntos y así, por lo que su forma de calificar es muy objetiva.','NA','201.133.209.211','2007-12-11 16:18:47',0),(1129,460,320,'9','Es buena maestra, enseña muy bien y algunas vecez si le caes bien te ayuda bastante, califica bien y encarga pocas tareas aunque estas un poco largas.','NA','207.248.38.251','2007-12-11 16:18:47',0),(1130,542,320,'10','ESE BATO ES LA MAMADA!!! esta de agua la clase, explica con madre, lleva asi como ke un paso asi bien, no 