e sentimientos.','NA','201.129.121.172','2007-12-11 16:18:47',0),(1151,460,320,'9','La clase esta normalona. Cuano encargue leer o investigar... haganlo para entender mejor la clase. Antes de cada parcial, encarga una tarea integradora que es muuy parecida al examen, igual haganla porque tambien vale un chorro. Una gran persona y maestra. Siempre abierta ha ascesorias y dudas. Encarga unos PBL fumadones, pero salen con esfuezo. Lo único que no me gusto es que los equipos ella los hace, y si no estas con uno trabajador, te afecta mucho.','NA','201.129.100.126','2007-12-11 16:18:47',0),(1152,563,321,'9','Da Muy bien la clase. Sabe del tema de hablar en publico. SU clase es powerpoint y videos lo que es interesante. Tu calificacion se divide en muchos puntos asi que casi no puedes faltar y tu speech lo califican ella y toda la clase.Siempre cuenta de sus experiencias personales para los ejemplos','NA','207.248.37.183','0000-00-00 00:00:00',0),(1153,563,321,'9','Super buena onda esta profe! la reocmiendo mucho, no pone examaenes parciales ni final, por ke sabe ke es inutil hacerlo... sus clases son puras presentacione s de power point, para los cuales no es necesari poner atencion! eso si.. si kiers pasar y salir bien, haz todas las actividades ke te ponga ( ke son super faciles), y pues echale ganas a las exposiciones.. ke en realidad de ahi es donde sale la calif... !! pero en si te garantizo un semestre super padre con ella','NA','201.135.45.178','0000-00-00 00:00:00',0),(1157,667,327,'10','Explica muy bien, con un amplio conocimiento del tema. Es muy buena onda, pero derrepente en los examenes parciales pone algun problema confuso con truco, pero los demas problemas trankilos. Su examen final es el mas dificil que he presentado en toda la carrera hasta ahorita. A pesar de eso es muy recomendable y te recuperas comoquiera con las tareas y el proyecto','NA','207.248.41.177','0000-00-00 00:00:00',0),(1159,561,327,'9','Muy buen profesor, se puede decir que explica bien 