imiento, asi que no esperes pasar con puros puntos que te regalen. ','NA','201.129.122.102','0000-00-00 00:00:00',0),(1231,522,361,'6','En cuanto a conocimiento es buena, es perra en carácter y en dar puntos, explica bien, pero los exámenes estan tan perros que ni ella los resuelve a la primera...','NA','207.248.45.19','2007-12-11 16:18:47',0),(1234,636,361,'1','Esta maestra no te explica, tu le explicas a ella. Su clase es aburridísima y califica estúpidamente. Jamás te da un punto extra, ni tampoco pone tareas para que te de unos puntillos, y lo más improtante... ELLA NO SABE ESTÃTICA! NO LA METAS CON ELLA.','NA','131.178.33.248','2007-12-11 16:18:47',0),(1238,522,361,'9','Es buena onda, explica muy claro, y no le molesta responder dudas, sus examenes son muy sencillos y parecidos a las tareas. Haces puros problemas en clase pero con eso aprendes La recomiendo mucho','NA','207.248.45.19','0000-00-00 00:00:00',0),(1240,522,361,'10','Sabe su materia si, pero la sabe como una alumna, no como maestra. Es muy chida, no te pone menos de 50, no se si es una regla de estatica pero no menos de 50. que te vea en clase, asiste a todas.No hagas broma pesadas porque si no te va a tachar de alumno ignorante.','NA','201.135.46.86','0000-00-00 00:00:00',0),(1241,636,361,'1','esta maestra no tiene ni idea de lo que es estatica, yo la lleve con ella y pase, y si eres mecanico menos la metas, por que despues te van a atorar en mecanica de materiales por que la maestra no explica y no sabe ni aunque vayas a asesorias le salen los problemas te dice que regreses mas al rato por que va a mandar un mail a la editorial para que le manden la respuesta porq ue ella no pudo despues de largas horas invertidas haciendo los problemas','NA','131.178.62.151','0000-00-00 00:00:00',0),(1242,522,361,'5','No sabe de estática y peor de dinámica; de hecho, los problemas que hace en el salón son ejemplos del libro, y aún así le cuesta mucho trabajo hacerlos. Sobre las calificaciones, es de las más barc