.254','0000-00-00 00:00:00',0),(1261,522,361,'10','Super buena maestra! Explica solo lo que tienes que saber de estatic ay te explica con bolitas y palitos... Es bien buena onda y mas si eres hombre.. Super recomendable la verdad.. y lo minimo que pone es 50.. ve siemrpe a las clases y muestra un chorro de interes y te da puntos bien facil...','NA','201.135.4.65','0000-00-00 00:00:00',0),(1263,522,361,'9','Los ejemplos que utiliza son unicamente para explicar y sin comparacion alguna a la de los examenes, me refiero a que la dificultad de los problemas de los examenes es mayor que a los que hace en clase. El contenido lo da muy dirigido y facil de entender, me dijeron que era buena onda pero no siempre','NA','131.178.99.154','0000-00-00 00:00:00',0),(1276,638,383,'7','Por lo que me cuentan esta clase es excelente o era excelente con Narvaez, la acabo de llevar con RMM y honestamente, es una porqueria, las clases terminaron 4 semanas antes de que acabara el curso, y el trabajo final tu haces todo y el no te ayuda ni te guia.','NA','207.248.39.228','0000-00-00 00:00:00',0),(1281,618,388,'7','No encarga muchas tarea. los examenes son un poco dificiles, sales bajo, pero no repruebas, y pone ejercicios para puntos extras. Eso si, esta muuy de hueva, hace la clase aburrida a mas nopoder.','NA','201.145.88.8','0000-00-00 00:00:00',0),(1284,618,388,'8','El prfe es buena onda, NI YUDA NI PERJUDICA, no le interesa si pasase o reprobaste tu calificacion es tu calificacion, pero SIEMPRE esta MUY dispuesto a dar asesorias y es muy buena gete en clase y SEMPRE esta dispuesto a resolver tus dudas y no hace NADA por hacerte mal, lo que ya es ganancia. La materia es en si lo dificil, no el profesor, salvo aue te gusten MUCHO las mates financieras. Recomendado, pero NADA barco.','NA','84.99.208.29','0000-00-00 00:00:00',0),(1286,677,404,'9','Excelente maestro. Explica muy bien y sabe mucho de lo que enseña. El problema es que pone examenes extraños y dificiles. Es la persona mas desorganizada para calificar: te entrega tu calificacion del parcial un mes despues de presentar. Llega al dia del examen final sin saber tu calificacion del tercer parcial.','NA','207.248.39.254','2007-12-11 16:18:47',0),(1287,677,404,'8','Asi es... llega el final y no sabes tu 3er parcial, pone un proyeccto final que te consume mucho tiempo. Explica muy bien, sus examenes si estan algo complicados. Hay una frase que se dice y es muy cierta: \"Con Vicente, ni se siente.\"','NA','131.178.99.20','0000-00-00 00:00:00',0),(1288,677,404,'6','Nunca te dice tus calificaciones a tiempo...no me gusta su forma de calificar...es demasiado desorganizado y encarga un proyecto final que te quita demasiado tiempo y que tal parece que ni lo ve!!! Alrededor de 8 tronados en un grupo de 40, osea no esta mal (yo pase!) pero la calificación que te da no es la que mereces (puede que eso te favorezca o no)...Yo no metería otra clase con el de plano, no me gusta estar con la incertidumbre de \"como me habrá ido?\"...Eso si, aprendes mucho.','NA','131.178.97.208','2007-12-11 16:18:47',0),(1292,443,408,'10','No es barco, pero no es perra, la verdad es muy buena maestra, explica demasiado bien y te resuelve tus dudas, tiene mucha paciencia, las clases con ella para nada son aburridas, es buena onda, no tienes que ser super inteligente para entenderle con ella pork repito explica super bien. Solo haces las tareas, y estudias unos dias antes para los parciales y ya, toma apuntes, pero no esta pesada ni estresante, MUY BUENA OPCION.','NA','148.221.53.165','0000-00-00 00:00:00',0),(1298,448,396,'10','Es muy buena maestra. Dicen que es perra pero la vdd no es.. pero si es algo estrictilla.. o sea le tienes que poner atención y estudiarle algo para el examen porque sus examenes son muy conceptuales. Si te va mal de ta chance y puede poner reposición.','NA','207.248.33.254','2007-12-11 16:18:47',0),(1310,672,396,'7','Sinceramente no lo recomiendo. El profe se la pasa pasando diapositivas de lo mismito