en profesor, se esfuerza por explicar y por que salgas bien, en los examenes es fácil copiar y las tareas no son tan díficiles, ni los trbajos, da asesorias y no es tan barco, solo que a veces se confunde en sus explicaciones y ps tambien te confunde a ti, en el final les va mal a todos no importa que este fácil, como que es necesario reprobarlos a todos.','NA','201.124.148.150','2007-12-11 16:18:47',0),(1364,604,396,'9','Este es buen pedo, explica bien mientras le pongas atencion, y si no ,siempre da 1 o 2 asesorias a la semana, si le caes bien y vas a asesorias de vez en cuando y cumplas con tareas ya chingaste','NA','200.94.194.67','0000-00-00 00:00:00',0),(1373,604,396,'8','Es una chingonada de persona, no sabe ni madre pero te diviertes, da muchos puntos','NA','207.248.39.252','0000-00-00 00:00:00',0),(1374,672,396,'9','Es una clase difícil. Es común criticar los métodos de enseñanza cuando no se tiene el éxito deseado. El maestro sabe mucho del tema, es sólo cuestión de provechar lo que sabe. Si vas a asesoría con las dudas que tengas, él te las resuelve claramente. No se puede hacer todo en el aula, y más con todos los temas que se ven. El tiempo de los exámenes puede estar un poco apretado, pero son de moderada dificultad. No hay nada de malo en meter la materia con él, desde mi punto de vista. E','NA','131.178.108.163','2007-12-11 16:18:47',0),(1375,672,396,'7','Es muy mal maestro, no aprendes nada y solamente te hace batallar todo el semestre. De cualquier manera no es dificil pasar los parciales y el final que yo sepa nadie que la curso conmigo la reprobo.','NA','201.135.45.79','0000-00-00 00:00:00',0),(1376,672,396,'1','Ni piensen meterla con el, estarian enfermos si lo hacen, solo se pone a leer presentaciones en power point y deja unas tareas perrisimas que nunaca te explica, pero al final te ayuda a pasar la materia pero no aprendes ni madres','NA','131.178.98.113','0000-00-00 00:00:00',0),(1377,604,396,'2','Te explica, y al final del problema, se da 