o para el semestre.Lo único que podría decir en contra es que los criterios para calificar a veces son inconstante y poco claros. Otro detalle es que algunos exámenes son en pareja (La maestra es quien realiza los equipos, a veces es al azar), pero lejos de que esto pueda ser una ayuda, ','NA','131.178.78.146','2007-12-11 16:18:47',0),(1610,483,488,'7','Aprendes pero te malviajas cuando revises tus trabajos revisados. Te puedes desvelar y seguir las instrucciones y te sale que no que está mal.','NA','207.248.39.254','2007-12-11 16:18:47',0),(1611,573,490,'10','Muy buen profesor metanla con el si te truena los parciales pero t hecha la mano es muy bueno y si aprendes al final','NA','201.127.71.226','0000-00-00 00:00:00',0),(1612,573,490,'10','Es un maestro tan tranquilo pero linda gente. El no te dice aprendete esto, el te enseña a buscar realmente lo que es y no te dice mentiras. A veces te desespera su clase pero si sirve y te ayuda. Vale la pena.','NA','201.153.69.172','2007-12-11 16:18:47',0),(1614,602,503,'7','Es un buen profesor su clase es relativamente fácil hasta que llegan los examenes en los cuales te ira mal si no te preparas bien... los examenes son demasiado parecidos a las tareas asi es que si no puedes hacer un problema de tarea probablemente sera el que venga en el examen.','NA','201.129.122.55','2007-12-11 16:18:47',0),(1616,602,503,'10','Excelente maestro. Explica muy bien, y la clase es amena; los exámenes son un poco duros, pero nada fuera de lo que se ve en clase. Aprendes más que en los demás grupos de control.','NA','201.153.120.89','2007-12-11 16:18:47',0),(1617,626,503,'10','Es muy buen profesor, explica bastante bien y la clase esta alivianada aunque a veces no se entiende todo debido a que se manejan muchos conceptos nuevos, pero el material de blackboard esta muy completo y hechandole ganas le entiendes. Sus examenes estan duros, pero los proyectos y tareas valen un chingo y casi siempre te ponen 100 mientras las tengas completas, asi que