NA','201.132.21.135','0000-00-00 00:00:00',0),(1823,371,673,'7','Una maestra muy estricta, no te esmeres por hacer un trabajo que creas qaue es magnífico. Me explico: \"Muy buen trabajo, la verdad no me esperaba algo así\" y resulta que sacas 78 porque te falló la conclusión. Si quieres aprender investigación, es de lo mejor, pues aprendes a cómo aplicar la metodología de trabajo. Es llevada y buena onda, pero todo es estructura.Me cae bien.','NA','131.178.78.0','2007-12-11 16:18:47',0),(1824,371,673,'6','Para hacer los trabajos necesitas convertirte en mago, en adivino, no se sabe lo que quiere. Es super estricta al momento de evaluar, a veces, sospecho, creo que inventa los errores. Tiene muchos prejuicios cuando evalúa y la única manera en que te puede ir bien es adivinar su siguiente movida (recomiendo hacerse su amigo personal no para tener una nueva amistad, sino para saber cómo es su psicología), o escoger un tema para el trabajo de lo más \"x\" y que no sea uno de los pilares de la mat','NA','131.178.78.0','2007-12-11 16:18:47',0),(1825,371,673,'10','Qué? No entiendo los comentarios anteriores. Una maestra como Judith es lo mejor que le pudo pasar a las materias de letras. Estricta y talvez no la mejor para tener un 100 seguro, pero aprendes muchísimo.','NA','207.248.45.27','2007-12-11 16:18:47',0),(1826,371,673,'7','Las clases son interesantes aunque llegan a ser pesadas. Las obras leídas en clase son a base de sus gustos así que olviden la poesía e incluso un poco a la novela a menos que sea el Quijote a quien ama con locura junto con Lope de Vega. En cuanto a la hora de los ensayos, la base se encuentra en el tiempo invertido para el ensayo. Entre menos horas sean, mejor calificación obtendrás pues un trabajo bien hecho, como lo han dicho los otros comentarios, no son evaluados conforme a su esfuerzo','NA','201.153.99.86','2007-12-11 16:18:47',0),(1827,371,673,'7','Pese a las altas y las bajas, definitivamente no te puedes graduar del Tec sin haber llevad