sta que apunten todo en el pizarrón disque explicando.. bienvenido... serás el mejor estudiante si no.. ni entres','NA','201.130.66.1','2007-12-11 16:18:47',0),(1982,243,723,'9','Tiene mucho conocimiento, todas las clases se las sabe de memoria, y las explica bastante bien. Regularmente se pone a platicar de otras cosas en clase, especialmente de su vida familiar, pero se repone despues. No pasa lista. Sus examenes son acumulativos, asi que siempre hay que estar repasando todo lo anterior, pero al llegar al final ya te lo sabes todo','NA','207.248.41.177','0000-00-00 00:00:00',0),(1983,51,723,'10','Con el a huevo que te va bien, aparte que si enseña chido. Y por si fuera poco, cuenta chistes y hace actos de magia.','NA','201.130.66.1','2007-12-11 16:18:47',0),(1985,98,723,'10','Con este profe pasas porque pasas... Las clases son super tranquilas, y los examenes estas facilisimos. La gran mayoria de los problemas en los examenes son problemas que vienen en las tareas. Y como te deja llevar hasta la laptop a los examenes ( y tambien abre las soluciones de las tareas vistas dias antes del examen ) pues a mucha gente se le facilita abrir las tareas en pleno examen y checar la solucion. Si aprendes, pero es mas de auto estudio.','NA','201.129.122.102','0000-00-00 00:00:00',0),(1987,51,723,'8','Es un buen profe pero muy tradicional. Hace 1000 ejemplos en el pizarron para el mismo, no te da oportunidad de resolverlos tu solo, y pues a la hora de calificar, si no eres chavaa, es medio perro.. Aunque para calificar para el final, si te levanta un poco el promedio.','NA','201.130.66.1','0000-00-00 00:00:00',0),(1988,13,723,'9','muy buena maestra, sabe mucho y te tiene mucha pasciencia, explica super bien y da puntos extras... sus exámenes no están tan dificiles, solo el final... tmb da mate 1 para lics, mate para el diseño, y mate 1 para los inges','NA','201.135.34.213','2007-12-11 16:18:47',0),(1990,243,723,'5','Pues, da la clase de manera muy diferente a los demas profes, e