ger ya que esta parado. Es buen maestro si le pones atencion. No te puedes copiar, ah y aparte encarga tareas todos los dias.','NA','201.135.46.86','0000-00-00 00:00:00',0),(2372,329,851,'9','Es un maestro muuuuy paciente, explica muy bien. Es muy accesible a la hora de acesorias. Encarga muchas tareas pero te ayudan mucho para el examen. Yo llevo puros 90 y 100 no se como, pero la verdad es muy buen maestro aunqeu desespera con sus chistes malisimo y como habla.','NA','207.248.45.19','0000-00-00 00:00:00',0),(2373,355,851,'1','estoy llevando la materia con el. si eres ñoño y te sientas hasta adelante del salon sacas 100 pero si te vale un poquito ya valiste...','NA','201.133.209.219','2007-12-11 16:18:47',0),(2375,329,851,'10','MUUy buen profesor, te lo recomiendo ampliamente, explica muy bien, cada clase te va recordando lo que viste anteriormente, da muy buenas asesorias, no es mamon como otros profes, llevo promedio 97 y ya la pase sin el final, si quieres aprender de a madre y bien chingon metela con el, eso si, deja bastantes tareas, los examenes estan faciles y sin trucos, te deja sacar los formularios que quieras y ademas laptop en todo el semestre. Muy buen maestro te hace trabajar, aprendes y la pasas con buen','NA','131.178.202.89','0000-00-00 00:00:00',0),(2377,203,851,'10','Hay profesores con los que aprendes a golpes y tronando examenes, hay profesores con los que pasas y ni aprendiste nada, por eso yo me quedo con ella. Es lo mejor de los dos mundos.','NA','131.178.161.20','0000-00-00 00:00:00',0),(2378,38,851,'7','Este profesor si sabe de la materia, PERO no sabe explicar bien. Sus examenes son a libro y libreta abierta. Es un poco perro en los examenes. Lo unico que si te aseguro es que te vas a ir a reir a sus clases... No se si meteria otra clase con Ã¨l.','NA','201.128.168.56','0000-00-00 00:00:00',0),(2379,38,851,'1','Ocho mil pesos a la basura. Ã?ste es el modelo del profesor irrespetuoso que uno creía que ya no existia. Ya que se retire por el