eres llorar, y otros te da risa lo mal que da la clase. No tiene idea de lo que es explicar con coherencia, lógica y orden, en verdad nada más él se entiende. Tiene fama de ser barco, ok, si te puedes copiar, pero cada vez se pone más perro para que no se confíen.','NA','201.128.177.48','2007-12-11 16:18:47',0),(2388,204,851,'8','Buena onda, accesible, maneja el tema. Muucha tarea pero con eso ya estudias, en el examen no vas a sacar 100 nunca por que pone una pregunta imposible, trabajas mucho y aunque le caigas bien y en el final saques 100, te baja muchos puntos no se de donde que tu calificacion termina siendo mediocre','NA','201.129.70.123','0000-00-00 00:00:00',0),(2391,38,851,'7','Este profesor es muy grosero, en el primer dia de clase di que eres de Veracruz el no reprueba a nadie de su rancho, a menos que no entiendas nada. En General explica mas o menos, apunta todo lo que k escriba el profe en los examenes te pone problemas casi igualisimos. Nota: la tarea esta bien dificil!!!','NA','131.178.77.131','0000-00-00 00:00:00',0),(2394,329,851,'10','muy buen profe explica bien sus examenes no son dificiles y te va bien en la materia','NA','201.139.144.88','0000-00-00 00:00:00',0),(2401,328,852,'5','La carrera de arquitectura se divide en dos: los que aman a IRA y los que lo odian. Muchos dicen que si aprendes un chorro, que enseña super bien, y cosas asi, otros opinamos diferente. Si aprendes es por tu cuenta porque en la clase hace sus bromitas nada graciosas, es sarcástico, estás enojado por eso?','NA','201.153.3.69','2007-12-11 16:18:47',0),(2402,328,852,'10','La verdad es una clase pesada, pero si quieres aprender, metela con, las clases son ligeras, no toma lista, pero eso si el trabajo final esta pesadon, aunque nomas lo pesa....aguas con los examenes, ahh! ponganse 90 en el tercer parcial es autoevaluacion, a mi me sirvio mucho si no con benjamin, no hay de otra.','NA','201.145.86.205','0000-00-00 00:00:00',0),(2403,350,854,'1','Uno de los peores profeso