e mucho...','NA','201.130.66.1','2007-12-11 16:18:47',0),(1804,444,666,'8','Probablemente sea la única opción meter la clase con ella. No toma lista, solo hay que entregar las tareas y hacer los proyectos como se piden. Los examanes no estan tan dificiles y como recomendacion si quieres entenderle/aprender ve a todas las clases, por que no explica los conceptos vistos de nuevo, y le puedes perder hilo y se batalla despues para agarrarle de nuevo.','NA','201.133.243.191','2007-12-11 16:18:47',0),(1805,444,666,'10','Muy buena maestra. Domina bastante bien la materia.','NA','201.133.209.211','0000-00-00 00:00:00',0),(1806,444,666,'10','es la unica opcion para meter, a pesar de eso es muy buena maestra, solo que si tienes dudas dicelas porque si no vas a tener problemas y no por culpa suya. haz todas las tareas y ve a asesorias cuando lo necesites, es muy amable al momento de explicar y esa podria ser tambien la parte mala porque le pides que si le puedes entregar una tarea tarde y te manda a volar de una manera amable, siempre con una sonrisa.','NA','131.178.47.179','0000-00-00 00:00:00',0),(1807,444,666,'10','Esta maestra es muy buena onda y siempre está de buen humor, pacientemente explicando instrucciones de ensamblador. Las tareas están un poco difíciles si no le entiendes bien, pero es muy accesible si tienes dudas, además de que las encarga con tiempo. Si entiendes la clase y puedes hacer tareas y programas, no es necesario que estudies para el examen.','NA','207.248.39.252','2007-12-11 16:18:47',0),(1808,619,668,'10','Buen profe, la clase es divertida y se pasa rapido ademas los examenes estan tranquilos y es barco calificando, igual con las tareas, solo 1 presentacion al semestre y al final tu decides si hay o no examen final','NA','207.248.39.254','0000-00-00 00:00:00',0),(1809,467,668,'3','Fatal. Se nota que no le gusta dar la clase y se la pasa como una mamá moralista diciendo que tienes que ser un buen niño obediente y hacer todo lo que digan tus papás y tu