e gusta la quimica, ya valio la agarra contra ti, no te da tiempo para aprender bien, si es en ingles habla muy raro y tiene mal acento, en mi caso, me fue mal porque la agarro contra mi, eso si los examenes tan faciles pero te califica las justificaciones que es donde te carga. Si eres IQA o IQS o LCQ ya la hiciste.','NA','207.248.39.249','0000-00-00 00:00:00',0),(2482,83,934,'10','buenisisisima maestra, barca , buena onda, aprendes pero tambien puedes pasar facilmente, te ayuda un buen para el final, es con ganas la maestra, los examenes son facilisisismos!','NA','201.139.54.91','0000-00-00 00:00:00',0),(2483,385,934,'9','Esta maestra sabe un chingo de química, resuelve un buen de problemas en clase, solo tienes que hacer todas las tareas, entenderlas y ya tienes un buen porcentaje asegurado para el final. Sin embargo el examen final te pone un poco a pensar pero si pasaste los parciales el final no te presentará problemas.','NA','131.178.77.105','2007-12-11 16:18:47',0),(2485,145,934,'2','Profesora que tiene mucho conocimiento, pero como maestra no la recomiendo, seria un error meter clase con ella. No sabe usar la computadora, se pierde casi la mitad de la clase en buscar un documento. No tiene pasiencia. Se le va la onda al momento de calificar, también se le olvidan las cosas que te ha dicho.','NA','207.248.39.254','2007-12-11 16:18:47',0),(2487,134,934,'6','Esa profesora le caes bien si demostras que sos listo, d lo contrario, ya valiste. Es muy alterada, a veces por la misma cosa se molesta o se alegra, es muy estricta, todas sus clases son basadas en blackboard, sus examenes no son perros, pero hay algunos que los hace llorar. Ahh, en el pizarron es toda desordenada, y aun asi explica de una manera alterada.','NA','131.178.77.12','0000-00-00 00:00:00',0),(2488,83,934,'10','una de mis mejores maestras de mi carrera, supero bvuena onda..y explica super bien, puedes faltar a su clase, entrejarle tareas tarde y da muchos puntos..','NA','201.140.0.15','0000-00-00 00:00:00',0),(2491,77,934,'10','Es una fragonada de maestro, es de lo mejor que hay en el Tec, claro hay gente que ni a puntas le entra la molecula, pero si quieres aprender en serio metela con el, ademas en las asesorias tambien te puede explicar de otras materias, como fisica, mate y computacion','NA','131.178.111.203','0000-00-00 00:00:00',0),(2492,83,934,'10','Excelente maestra, en serio que ahora si aprendi quimica, aunque a lo mejor se te puede hacer lenta la clase sobre todo si es de hora y media, pero a la hora de explicar lo hace muy bien, no habia tenido tan buena maestra de esta materia y es muy recomendable meter clase con ella, se dice que es algo barca o muy barca, chance si pero no es tanto, es buena onda y las asesorias son la mamada, te explica las tareas a la perfeccion y si no se te queda lo de las asesorias es que estas bien wey','NA','201.130.66.249','0000-00-00 00:00:00',0),(2494,83,934,'10','Excelente maestra! Es super buena onda, explica demasiado bien, te da trucos para resolver fácilmente los problemas y lo mejor de todo es se le entiende todo perfectamente. Con ponerle atención en la clase es suficiente para sacar buena calificación en sus exámenes.','NA','201.129.119.236','2007-12-11 16:18:47',0),(2495,145,934,'1','De que sabe quimica, sabe quimica, es indiscutible, pero no es buena maestra. No sabe como dar la clase, ella cree que todos saben lo que ella sabe. No sabe usar la compu y tiene mala memoria, y si la agarra contra ti, va a ser imposible que pases el semestre. Califica MUY perro los examenes','NA','131.178.108.142','0000-00-00 00:00:00',0),(2496,77,934,'3','NOOOO! Nunca, Jamas.... olvidenlo... Sufri mucho en la clase. Si tiene mucho conocimiento y experiencia, pero no sabe explicar. Zero paciencia y tolerancia. Si enserio quieres meter con el, ponte las pilas y alguna mas por donde puedas, porque si no lo haces no la vas a librar.','NA','131.178.33.192','0000-00-00 00:00:00',0),(2497,424,934,'8','Es cierto, en esta clase no hay descanso, ninguna clase dejó de dejar tarea. Me gustó que tratá de aplicar todo lo que se aprende con ejemplos de la vida real. Es muy importante que si no se quieren perder en los temas, que tambien lean en el libro los temas que se estaran viendo, pues la maestra supone que ya sabes ciertas cosas.','NA','131.178.68.49','2007-12-11 16:18:47',0),(2498,134,934,'9','Muy buena maestra.. se altera un poco al explicar pero si te enseña muy bien... si eres de los nerdos k t encanta hacerle la barba a los maestro metela con ella pero si eres de los payasitos del salon ni se te ocurra... a veces reacciona de buena manera y a veces se enoja asi que cuidado con lo que dices y no digas una respuesta al menos k estes seguro de uqe esta bie sino se enoja ejeje','NA','201.130.66.249','2007-12-11 16:18:47',0),(2500,77,934,'10','este profe sabe bastante del tema, si pones atencion ya la hiciste, sus clases son muy divertidas y sus examenes de opcion multiple, te ayuda si le pones atencion en clase, le puedes entregar las tareas hasta dias despues de haber presentado..','NA','131.178.111.17','0000-00-00 00:00:00',0),(2502,311,934,'8','Explica bastante bien y sabe de lo que habla. Con él les recomiendo meter la clase si piensan ir y poner atención, de otra manera te confundirías. En general sus clases son buenas y en los exámenes da medios punto, tres cuartos de punto, dos tercios de punto, etc... Si es buen profesor pero no el mejor. (Sus clases son a las 7 y a las 8 de la mañana: un defecto muy grande). La volvería a meter con él pero no a las 7 de la mañana.','NA','131.178.201.27','2007-12-11 16:18:47',0),(2503,134,934,'3','No la metan con ella, siempre tienes que leer antes de cada clase o te bja puntos, tiene caracter fuerte, sus examenes son dificiles. No tiene buen trado con alumnos. Yo le dedicaba mucho tiempo y esfuerzo y pase apenas, hizo que no me gustara la quimica.','NA','207.248.39.254','0000-00-00 00:00:00',0),(2508,77,934,'5','Este profe sabe mucho y es buen pedo el wey nada mas que no sabe transmitir muy bien lo que sabe y pues te mantiene trabajado constantemente durante todo el semestre, es buena onda como persona pero como maestro no tiene paciencia con los alumnos que batallan mas en comprender los temas pero en si se la recomendaria a los alumnos que sean ya mas avanzados y les interese saber mas cosas que la materia comprende, y si no le llevas el paso al maestro definitivamente no vas a entender ni madres','NA','148.244.155.166','0000-00-00 00:00:00',0),(2509,77,934,'10','Es la mamada... El vato sabe chingo de todo el pedo ademas de otras madres, pero ponle ATENCION al huey','NA','131.178.109.252','0000-00-00 00:00:00',0),(2511,385,934,'10','Es una maestra con madre, explica chido y se le entiende muy bien, muy recomendado que la lleven con ella','NA','201.130.66.249','0000-00-00 00:00:00',0),(2513,134,934,'1','Es muy injunsta al calificar, tiene sus preferidos, y los adula en clase mientras que a los demás los hace sentir muy mal. si no le caes bien, te hace saber mucho tiempo antes que no te va a dejar pasar. Es sumamente grosera al hacerte sentir mal si contestas alguna demanda con la respuesta equivocada.','NA','131.178.98.70','2007-12-11 16:18:47',0),(2514,134,934,'2','UUUuu perrisima!! no se les ocurra meterla con ella, se altarera mucho. Escribe demasiado rapido y lueguito borra.','NA','207.248.39.254','0000-00-00 00:00:00',0),(2515,287,934,'1','Pésima! no sabe mucho...se equivoca, hace un problema...borra todo el pizarrón y cuando digo todo, es todo....hasta la fecha!!! En cuarto parcial van a clases extra, se avientan tres temas por clase....y en el examen final.......olvidenlo...ni con agua bendita.. Es una excelente persona...pero de maestra deja mucho que desear...','NA','207.200.116.10','2007-12-11 16:18:47',0),(2518,83,934,'10','Esta maestra es la mamada da chingo de puntos tira reba y las clases estan bien leves, si tira paros conadmre, cias no tomas lista masque al principio apra aprenderse los nombres