n, y resuelve todas tus dudas, es muy paciente y buena onda.','NA','201.133.255.131','2007-12-11 16:18:47',0),(2536,134,934,'1','Maestra muy alterada, como te puede llegar alegre, te puede llegar enojadisima, se irrita facilmente, explica desordenadamente, usa el pizarron para escribir garabatos, le gusta q tomes apuntes pero no te deja hacerlos porque o borra el pizarron o cambio de filmina, si eres de los nerd q sabe todo ya la hicistee porq son los consentidos, si eres lo del desma estas equivocnadote de salon porq apenas te detecta te anula, le molesta q contesten mal, te corre del salon por cualquier cosa, te encarga','NA','201.135.4.209','0000-00-00 00:00:00',0),(2537,145,934,'10','Muy buena maestra, aprendes porque aprendes. Si truenas estas wey. Pasas y aprendes.','NA','207.248.46.250','0000-00-00 00:00:00',0),(2538,385,934,'10','Excelente maestra!! explica super bien, no es barca, exámenes difíciles, pero no impasables...tareas, pocas.','NA','201.218.115.151','2007-12-11 16:18:47',0),(2539,77,934,'9','Es cierto que sabe mucho de su materia pero explica en un nivel muy elevado. Mi recomendación para aquellos que lleven química por primera vez si la quieren meter con él que sea en honors. Los exámenes como ya dijeron tienen exactamente los mismos problemas de los problemarios y los cuestrionarios, además el te da las respuestas una vez que ya entregaste cada problemari. Para que te vaya bien en el examen solo te tienes que machetear las respuestas y la teoría, no viene en el examen nada d','NA','201.133.220.98','2007-12-11 16:18:47',0),(2541,77,934,'5','Que les puedo decir...el maestro menos tolerante que me ha tocado desde que estoy en el sistema Tec, la cual considera inferior a cualquier persona que no tenga dos doctorados(ejem..creo que no muchos tienen dos doctorados hoy en dia) por lo que si batallas para entender lo que es un hidrogeno o un oxigeno...ni lo pienses, este profe pone los examenes con la teoria mas dificil, la cual raramente se la saca de 