ecturas no están manchadas y aunque no leas te explica excelente. Si lees, puedes serguir la clase demasiado bien. Es muy buena onda','NA','201.138.169.202','2007-12-11 16:18:47',0),(2779,340,1079,'10','MUY BUEN PROFESOR. De lo mejor que hay en el tec en cuanto a explicar, si pones atencion todo lo aprendes chido. Es bastante exigente, eso si, pero nunca se pasa de la raya. Los examenes y proyectos los revisa bastante bien, sin quitarte muchos puntos por errorcitos. Muy Recomendado, tambien da Teoria de la Computacion para ISC.','NA','131.178.96.179','0000-00-00 00:00:00',0),(2783,76,1081,'8','este maestro esta bien, derrepente toma lista mas te puedes ir y ni cuenta. sus examenes son de puro escribir y aplicar lo que hiciste en los temas de tarea, manuales que ni se usan, y de lo poco que se ve en clase; encarga un trabajo final, de 60 o mas slides pero el te da el tema a investigar, llega tarde a sus clases y el primer parcial si pone tareitas, pero todo es en equipo y es fexible para entregar tareas etc. es buena onda y si te va mal es porque de plano no haciste nada','NA','201.128.137.158','0000-00-00 00:00:00',0),(2784,76,1081,'8','puedes pensar que es bien barco, pero si es algo estricto, claro a este profesor solo necesitas echar rollo, pero eso si, ponle mil fotos en los trabajos y el es feliz, t puedes meter a clac y esperar a k tome lista y t sales , ni cuenta se da.. sus examenes tan medio raros, porque no estan impresos ni nada, el solo llega y t dicta unas dos preguntas y t pide todos los tipos de diseño y con solo echarle rollo ya sacast un buen promedio','NA','201.153.91.93','2007-12-11 16:18:47',0),(2785,76,1081,'10','Mas barco \"ta canion\", buen maestro muy barco con examenes de agua en los que nams tienes que echar rollo y hacer dibujitos jaja... si quieres pasar y hasta tener una buena calificacion sin hacer nada este es el maestro indicado','NA','207.248.39.254','0000-00-00 00:00:00',0),(2787,76,1081,'10','Muy divertido el maestro, empieza a hab