cta y solo te pone diapositivas y en sus examenes no sabes ni que rollo y no te pasa si tienes 69...asi que en 3 palabras....NI DE PEDO','NA','201.130.66.249','0000-00-00 00:00:00',0),(2831,482,1114,'10','Es a todo dar este profe metan materia con él, es la neta aprendes chido y nada dificil los examenes','NA','131.178.98.162','2007-12-11 16:18:47',0),(2836,652,1117,'7','Cuando esta de buen humor es muy buena onda pero no la agarres enojada por que ya valio, son 2 examenes cada parcial uno en equipo y uno individual, el de equipo es en el que haces problemas y el otro pura teoria, el problema es que si te metes en un equipo que sepa mucho y haga todo, en el final que es individual te le pelas. Ahh y no te regala ni un solo punto','NA','131.178.202.214','0000-00-00 00:00:00',0),(2841,513,1127,'7','Esta maestra toma DEMASIADO en serio su materia. Todas las clases deja tareas y estas valen como el 70% de la califa del semestre. Es buena onda pero te pone a trabajar demasiado.','NA','201.153.103.210','0000-00-00 00:00:00',0),(2892,451,945,'10','Es una buena maestra, explica todo, domina el tema. Se le pasa explicar varias cosas, pero las presentaciones y el libro te sirven para esos detalles. Sus exámenes no son difíciles si estudias lo necesario. Da muchos puntos extras, y si le pones atención no deberás tener ningún problema. Aparte ella hace el examen final departamental, y si la llevas con ella es como cualquier otro parcial!','NA','127.0.0.1','2007-12-11 16:18:47',0),(2893,26,1084,'7','Es un maestro que al principio se nota sabe de sus temas. al pasar el curso te das cuenta que solo se aprendio todo el libro de memoria ya que lleva X cantidad de anos dando la materia, no tiene criterio para revisar examenes, con una palabra mal en las preguntas abiertas tienes toda la pregunta mal, sus clases son super aburridas ya que solo se la pasa leyendo, y repitiendo lo mismo, cuando preguntas te responde de una manera poco clara, con terminos complicados, en general lo considero mal maestro','NA','127.0.0.1','2007-07-18 05:23:06',0),(2894,19,954,'4','Muy estricta, el primer parcial reprueba a la mitad del grupo... la clase es muuyy aburrida... pero despues del 2 parcial casi todas las clases te deja salir mas temprano','NA','127.0.0.1','2007-07-18 05:23:45',0),(2895,560,958,'10','meterla con él esta chido! no es barco ni nada pero vas a aprender algo sin tener q matarte, te irá chidillo si le echas ganas... no como con chaguito y esa raza...','NA','189.156.184.137','2007-12-11 16:18:47',0),(2896,119,191,'10','Excelente maestra!!Super buena onda, un poco exigente con los trabajos pero todo dentro de lo normal. La erconmiendo al 100%. Tiene mucha paciencia con los alumnos y siempre dispuesta ayudarte.','NA','189.133.50.176','2007-07-21 03:19:28',0),(2897,396,5,'4','ES BUENA MAESTRA PERO SU VOZ ES INSOPORTABLE! LA VERDAD ES MAS AUTOCONOCIMIENTO QUE ELLA LO QUE EXPLICA','ALE SALINAS','200.94.141.3','2007-07-21 06:23:40',0),(2898,480,5,'10','HERMOSA LA MISSSSS LA AMOOO\r\nDA DEMASIADOS PUNTOOOSS\r\nYO NUNCA ESTUDIÃ‰ Y SAQUÃ‰ 100 FINAL','NA','200.94.141.3','2007-07-21 06:25:16',0),(2899,495,850,'5','La miss es buena persona si le caes bien y si no nooo!!..ademas es muy aburrida la clase solo lee las filminas y ya y pues si no entiendes nimodooo .La verdad sidan ganasdse dormirse porque no es muy dinamica y por lo mismo no aprendes muchooo','NA','201.160.38.162','2007-07-21 22:18:15',0),(2900,560,957,'9','Excelente profesor. No esperes que sea barco, la clase no es fácil pero con el vas a aprender muy bien y si te esfuerzas puedes llegar a sacar buena nota.','AN','189.167.113.196','2007-12-11 16:18:47',0),(2901,503,772,'7','La verdad el profe no sabe mucho de la materia y habla mucho de su vida personal jaja aprendes por cuenta propia casi todo, pero la vdd si te entretienes en las clases y los examenes andan por todos lados.','NA','189.155.49.240','2007-07-22 11:23:12',0),(2902,669,723,'9','El maestro es muy buena gente, accesible y si te llevas bien con él lo mas seguro es que te ayude al final. Pero sus exámenes si estan bien pesados y ves mas material de lo que verías con otros. Por otro lado los viernes muchas veces manda pedir pastel por los que cumplieron años en la semana. Como persona el profe es lindísimo, pero si está difícil con él.','NA','207.248.37.109','2007-12-11 16:18:47',0),(2903,589,724,'9','EL maestro explica muy bien, sus examenes están tranquilos y si estudias lo normal te va bien en la materia. Eso si jamás le puedes pedir puntos, es mas ni puedes decirle maestro me calificó mal. Por que se enoja aunque tu tengas la razón.  ','NA','207.248.37.109','2007-12-11 16:18:47',0),(2904,621,397,'10','Excelente profesor, sabe un chorro de la materia. Es como que muy despistado y siempre llegaba tarde a clase, aparte no se da cuenta si copias en el examen, o al menos no te dice nada a menos que seas un descarado. Lo importante es que explica muy bien con ejemplos prácticos reales que uno entiende fácilmente, aparte de que los exámenes no son tan difíciles, pero si debes estudiar al menos algo... Al final hace curva!','NA','189.188.6.168','2007-12-11 16:18:47',0),(2905,680,53,'10','hmm.. no es la de la foto, jaja pero es una maestra muy chida. Su rango de calificación en las tareas son de 85 para arriba a menos de que ya seas demasiado bruto. Solamente se fija en los criterios y el formato, nunca checa el contenido. Da puntos extras por alguna tontería y hasta te puedes salir a media clase y ella no lo nota jaja, es lo mejor!','NA','189.188.6.168','2007-12-11 16:18:47',0),(2906,276,954,'7','Esta maestra es una flojera!!!, aparte de que la materia es de estar con tareas siempre, esta maestra nunca está conforme y es muy difícil poder sacar un 100 con ella. Por lo tanto si no eres de cienes mejor vete preparando y échale ganas a la materia sino te va a perjudicar el promedio. Lo peor es su horrible sonrisa jaj, pero si le caes bien, tal vez no te vaya tan mal...','NA','189.188.6.168','2007-12-11 16:18:47',0),(2907,558,320,'9','Muy buen profesor, explica muy bien... los examenes estan medio dificiles pero cuando le preguntas casi casi te da la respuesta... si haces las tareas no vas a tener ningun problema. A y al final si repruebas con 65 o algo asi casi siempre te pasa.','NA','200.78.236.82','2007-07-24 05:23:22',0),(2908,696,723,'9','Este profe es un barcazo!, es muy chido el profe, la clase no se hace tan lenta, luego hasta deja salir temprano. Su clase más que nada se basa en explcar brevemente el tema, y luego hacer muchos ejercicios en el pizarrón, de los cuales varios vienen en los 5 incisos del examen. El examen final lo pone departamental, por lo tanto si está medio tricky pero no es imposible, pues es opción multiple. Es muy flexible en la calificación, si no quieres batallar mucho en mate, y no aprender bienbien, este profe es la opcion..','NA','189.188.11.97','2007-12-11 16:18:47',0),(2909,58,1034,'10','Anne Fouquet es de las mejores maestra que hay en el tec, es muy estricta, siempre hay tarea, de hecho cualquiera que haya llevado clases con ella se habrá desvelado para sus reportes de lectura, tienes que prepararte muy bien cuando des tu explicación del autor (nadie se salva), el proyecto tiene que ser en si muy bueno y además dedicarle tiempo, y los examenes sí estén complicados. Además tiene un punto de vista muy interesante, a muchos les molesta lo que dice porque lo que ella dice es la verdad, no más ni menos. \r\n\r\nSi quieres un reto y aprender metela con ella.\r\n\r\nRealmente lo que aprendes con ella jamás lo olvidas, maestra ideal para los que estudian ciencias sociales.\r\n\r\nAh, eso si, odia que le regaten puntos extras y nunca menciones la palabra curva.','NA','189.153.215.173','2007-12-11 16:18:47',0),(2910,697,771,'7','La verdad me decepcionó, no es un maestro que esté al pendiente de los alumnos, solo llega a la clase, se pone a platicar con quien le caiga bien.\r\n\r\nHabla mucho y no aprendes, tiene muchos favoritismos.\r\n\r\nSi quieres aprender economía por ti mismo ese es tu maestro.','NA','189.153.215.173','2007-12-11 16:18:47',0),(2911,59,219,'9','Bueno la vdd si es un excelente maestroo .. pero tmb no es NADA facil.. casi trueno con el.. pero si aprendi bastante','NA','128.237.248.220','2007-07-24 19:50:46',0),(2912,697,850,'9','Muy buen profesor, sabe explicar y es muy buena onda, todos los examenes son de ocion multipli y siempre da puntos. Lo malo es que es muy favoritista, pero en buena onda, no para las calificaciones, si sacas 100 en los tres parciales te excenta, sales aprendiendo, pero si debes poner atencion.','NA','189.155.182.48','2007-07-24 20:01:46',0),(2913,396,5,'7','la vdd, si es cierto q es mas autoconocimiento y aprendizaje de las tareas q deja (siempre deja tarea) que lo q explica ella, y recuerdo q varios de mis compañeros tronaron, pero a mi si me fue muy bien porq le eche ganas','NA','189.138.188.178','2007-12-11 16:18:47',0),(2914,160,1032,'8','Aprendes si lees... Xq la verdad te deja demasiado para leer, cada clase debes de haber leído un capítulo del libro o una lectura de las que él escribe... Sí está pesada, los examenes parciales son en línea, pero por más que le busques y los hagas en equipo no sacas 100, lo aseguro... Es estricto con faltas... El semestre que yo la llevé, ene-may07 no hubo final, pero no sé si siempre sea así...\r\nSí le tienes que dedicar tiempo...','NA','12.2.142.7','2007-12-11 16:18:47',0),(2915,695,735,'8','Este profe puede que sea molesto al principio, pero hace unas cuuuuuuuuurrvas. Yo en los primeros dos laboratorios no he ido, y con tan solo que platiques con él y le caigas bien te puede perdonar los labs. También si corres maratones te hace exento de un exámen parcial o hasta final. A veces hasta se pone a jugar tennis con los alumnos los domingos. Yo si la vuelvo a meter con él. \r\n\r\nTambién da Transferencia de Energía ya esa ya es otra personalidad. ','NA','216.184.96.155','2007-12-11 16:18:47',0),(2916,203,726,'10','Esta maestra es lo mejor de mate remedial. En la clase explica bien, siempre resuelve todas las dudas, siempre resuelve los problemas. Las tareas siempre cuentan y por desgracia siempre pasa lista, pero da puntos extras kon ganas ... y trabajos de puntos extras... Es la ley, t llevas alivianado el curso ... tanto asi ke lleve mate I kon ella ... !! Busquen a esta maestra neto !! para mate remedial o mate I, y kreo ke hasta da probabilidad y estadistica. wipiiiiii','NA','201.147.157.222','2007-07-25 02:30:18',0),(2917,698,145,'6','Este profe si sabe de la materia he incluso hay laboratorio virtuales en la clase, lo cual te puede servir te colchón si los haces por si te va maso en los exámenes. Lo que si molesta son de sus \"eeeeeehhhh, eeeehhhh jóvenes\" cuando explica en clase, se le sale mucho esas muletillas. Explica entre nada y dos que tres. A veces te matas de la risa cuando trae el cinturón caído o trae la camisa muy alborotada. Es muy despistado y se le va el pedo a veces. No sé si volverla a meter con él.','NA','216.184.96.155','2007-12-11 16:18:47',0),(2918,75,1031,'8','Este profe es lo peor y lo mejor al mismo tiempo. Muchas de sus clases llegaba super crudo y me dormia, de repente despertaba y participaba tantito y ya con eso se quedaba tranquilo. Es bien dificil sacarse 100 porque no es nada barco, te echa la mano con faltas y retardos, pero es bien duro al calificar los trabajos, que no son pesados pero si aburridisimos al igual que la clase. Pero si haces los trabajos y pones atencion en las exposiciones (hay como un examen corto relacionado), si te preparas para tus exposiciones y ademas no le das lata, como platicar en clase y asi, sacas mas de 85, eso segurisimo. Si hay quien reprueba con el, pero porque no hacen nada nunca. No lo recomiendo mucho, hay otros mas barcos.','NA','189.157.107.187','2007-07-25 03:22:33',0),(2919,211,361,'9','Ok, este profesor es dificil de calificar. Lo bueno: en clase es a toda madre, te explica todas las veces que sean necesarias (a veces demasiadas), en asesorias te explica pero te hace pensar, lo cual te ayuda a la hora de hacer ejercicios por tu cuenta. La clase es divertida, ni te das cuenta que dura hora y media. Lo malo: califica como si estuvieras sentenciado a muerte, y no duda para nada en reprobarte. Es super duro en los examenes, los ejercicios de clase si los entiendes con madre, si haces las tareas con madre, haces los examenes tipo, y los entendiste todos, excelente, porque el examen modular es siempre mas dificil que todos ellos juntos y siempre es algo que te pone a pensar. En mi grupo hasta los mas matados se la pelaban para los examenes. Yo lo recomiendo si eres mecanico y tambien eres trabajador y dedicado. Si eres Industrial la vdd hay profes que valen mas la pena. Yo trone con el, pero aun asi aprendi un chingo.','NA','189.157.107.187','2007-07-25 03:31:00',0),(2920,211,361,'7','lee bien su nombre FELIPE HIDALGO! no, no, no y NO!\r\nHay profes con los que aprendes igual de con madre, pero tienes mas garantias de pasar o de un buen promedio.','NA','189.157.107.187','2007-07-25 03:33:02',0),(2921,276,392,'7','Esta maestra es bastante buena gente, sin embargo su clase no es la mas amena. Digamos que es algo agobiante. No es barco pero tampoco es demasiado exigente. Eso si, ten cuidado con las faltas.','AN','189.167.113.196','2007-07-25 04:39:42',0),(2923,260,397,'7','Yo meti Fisica 1 y 2 con este profe y la vdd siempre tuve el mismo problema: poner atencion en clase, es cierto que de repente hace bromas muy buenas y te ries, pero la mayor parte del tiempo esta hablando, te aburres, te aletargas, si no te duermes como sea en clase no entiendes muy bien, sales de la clase con muchas dudas, tus apuntes no sirven para absolutamente nada y tu unica opcion es leer el libro, ir a asesoria, porque si le caes bien ni de puro chiste truenas.\r\nUn buen profe, para aquellos que estudian mucho por su cuenta, si no, hay mas de un profe que explica mejor que este. Aunque muchos IFIs lo mamen, este profe no conviene.','NA','189.157.107.187','2007-07-25 05:11:50',0),(2924,621,398,'8','La vdd tengo mucho que recomendar de este profe para los que quieren llevarsela tranquila con fisica 3 o cualquier materia que de. Este profe es distraido, buena onda, super chistoso, hace curva, examenes de reposicion, copiar en sus examenes es tan facil como pasar una hoja de un lado a otro del salon! imaginense. En clases habia raza que juntaba varias sillas y se dormia, si estabas despierto veias a mas de la mitad dormidos. Sus examenes faciles, pero yo tengo contra el que al final no me conto muchos puntos y termine con promedio de 80 cuando yo habia calculado casi 90, pero igual casi no hice nada asi que no me quejo demasiado.\r\nDificil recomendacion.','NA','189.157.107.187','2007-07-25 05:16:27',0),(2925,542,320,'8','Cosas ciertas: le vale madre si pones atencion, le vale madre si haces la tarea, le vale madre reprobarte, si aprendes o no es lo de menos para el. Si da asesorias, si explica chido, si te echa la mano cuando no le entiendes.\r\n\r\nCosas falsas sobre el: todo lo que no puse arriba y que muchos pusieron aca abajito.\r\n\r\nLo recomiendo si le sabes a mate, integrar y derivar, basicamente lo es todo. Si no sabes bien, hay otros profes, sobre todo las que son mujeres que explican mejor.','NA','189.157.107.187','2007-07-25 05:20:17',0),(2926,160,1032,'10','El mejor profesor q te puedas encontrar, es cierto q tienes q leer pero son lecturas faciles q te haran razonar y lo mas importante: PENSAR!!! con q te consigas sus examenes de semestres pasados y participes dos veces en clase por parcial, seguro obtendras 90 o mas.','NA','189.131.28.200','2007-07-25 08:51:34',0),(2927,461,668,'2','De hueva su clase, actividades como de kinder y una exposicion donde te califica depende en como le caigas, debes echarle algo de ganas al igual q aprenderte todo lo de Covey. Si te sientes de 5 años, es tu clase','NA','189.131.28.200','2007-12-11 16:18:47',0),(2928,582,480,'9','Efectivamente Nava es uno de los mejores maestros del departamento y del tec. Tal vez sus metodos sean un poco tediosos, pero de que aprendes, aprendes. Es super buena onda, si deja tarea pero en menos de 20 minutos haces el resumen, sus lecturas estan cortas y si, se te hacen largas recuerda que no vas mas alla del 5to semestre, asi que preparate por que eso no es nada. Sus examenes estan faciles y siempre esta dispuesto a ayudarte. Lo recomiendo totalmente. Lleve 4 materias con el y es wey super alivianado. No sera la clase mas interesante de tu vida pero aprendes lo necesario. Lo recomiendo totalmente.','NA','189.133.50.176','2007-07-25 09:31:19',0),(2929,92,661,'1','Este profesor no es barco, ES EL TITANIC. Es el barco mas grande q te puedas encontrar, el problema es q hasta te sientes mal de lo malo q es, puedes no ir a clase nunca y no tendras una falta, entregarle por trabajo una copia de la biblia y ni lo notara, bueno no es para tanto. Come en clase, su ingles es malisimo y luego se toma de carrilla a varios, neta te sientes mal de llevar una clase asi. Aguas cuando lleves derecho aduanero q ahi te la veras duras debido a q no sabes nada, NO LA METAS CON EL, si hubiera un 0, eso le pondria.','NA','189.131.28.200','2007-07-25 09:42:42',0),(2930,53,786,'8','Es muy buen profesor, por lo general en sus clases hay puros extranjeros lo cual le añade cierta competencia a las cosas. Es bastante estricto al calificar pero siempre te dice los parametros y si te equivocas o sales mal, te da oportunidad de presentar un segundo trabajo. Manejo varias lenguas lo cual te habla de una persona muy bien preparada, es algo exigente y se clava mas en mostrarte las diferentes perspectivas del pais, lo recomiendo','NA','189.131.28.200','2007-12-11 16:18:47',0),(2931,168,189,'4','De flojera esta clase, se supone q deberia uno practicar el como se comunica pero ella habla una hora y la otra media la deja para ver cosas. Tienes q leer unas hojas bastante tetas y de eso se basa el examen. No es dificil sacar buena calificacion pero al final todos los del grupo ya estan desesperados de la profesora.','NA','189.131.28.200','2007-07-25 09:59:03',0),(2932,172,11,'8','Muy buena profesora, todo lo q ves en clase lo pone es sus examenes q no estan complicados, da muchos ejemplos regionales y es bastante accesible.','NA','189.131.28.200','2007-07-25 10:08:37',0),(2933,291,32,'9','buen profe te da el 10% de tu desempeño si no faltas y no suena tu celular, osea que si sacas 80 en el mes te pone 88... da muchos puntos extras en el 3er mes y estan faciles los examenes nad mas checa las notas q te dice en algunos ejercicios porque son los que pone en los examenes. le dicen el perro aguayo pero ni al pedo, la tarea esta leve y si tienes q leer para las clases si no te vas atrazando y es mucho como para ponerte al corriente un dia antes ','NA','189.130.95.197','2007-12-11 16:18:47',0),(2934,474,205,'10','Excelente maestra, la clase es muy light, divertida, le entiendes a todo lo que explica y los examanes no son pesados, ella es buena onda. Si tienes chance metanla con ella.','Anilay','189.130.39.56','2007-07-26 06:01:53',0),(2935,341,396,'10','Porfe chingon la vdd, barkillo pk da muchos puntos extras la vdd, y hace curvas aunk no les llame asi el we, su clase es bn trankila y c la pasa diciendo chistes y mmada y media, pasas pk pasas','NA','207.248.45.2','2007-07-26 06:18:26',0),(2936,139,108,'3','Se hace bolas al explicar, te confunde, sus examenes no son dificiles, pero por lo mismo no aprendes nada, y cuando llegas a termo no sabes naaaada!! no vale la pena','NA','200.56.132.86','2007-07-26 08:15:17',0),(2937,232,187,'8','No es nada estricta, no es nada dificil, sabe mucho, pero le tienes que caer bien, sino te hace la vida de caudritos con sus comentarios de burla y sarcasmo, tienes qe hallarle el lado, pase sin pena ni gloria.','NA','200.56.132.86','2007-07-26 08:17:46',0),(2938,374,678,'10','Lees los libros, los comentas en clase (si no los leiste, ahi te enteras de todo), no pone quizzes, deja tareas faciles en equipo y los examenes son ensayos, si eres rollero esta es la clase para ti, yo la pase con 95 y lei solo 1 libro, los demas me entere en el salon','NA','200.56.132.86','2007-07-26 08:21:51',0),(2939,582,699,'8','Es un maestro regular. Deja tarea A DIARIO. pero te da chance de entregarlas tarde, si tiene su grupito de fans, PERO no es nada malo como persona, no te reprueba por qe le caes mal ni nada. Sus examees son de puro rollo, pero eso si, tienes qe aprenderte todo de memoria como en la primaria, no representa un desafio intelectual para nada, mas bien trae a flote tu capacidad de memorizar. Sin pena ni gloria un 85.','NA','200.56.132.86','2007-07-26 08:29:09',0),(2940,542,320,'5','Para pasar con Olegario tienes que llegar sabiendo derivar e integrar en todas las formas habidas y por haber. Si no sabes, mejor ahorrate la molestia, porque el, ni de pedo se va a ponerte a explicar lo que segun ya deberias saber. No toma lista, le vale si vas o no vas, si aprendes, si pasas, etc. El va super quitado de la pena a dar su clase, entonces si sabes mates bien, te va a ir bien, sino sabes, mejor buscale por otro lado. ','NA','200.56.132.86','2007-07-26 08:34:25',0),(2941,461,668,'10','Lo único que no me gustó de su clase fue que nos puso a cantar o algo así, bien a la kinder. Es una profe que le late mucho la ónda de la psicología popular y autosuperación para señoras. Pasar su materia es fácil y sí aprendes una que otra cosa. Es una persona muy buena onda.','NA','207.248.40.18','2007-12-11 16:18:47',0),(2942,75,55,'5','Es a veces buena ónda, pero su clase está de hueva, incluso si te gusta el análisis literario y esas cosas. Si te vas al 2ndo piso de la biblio puedes encontrarlo dormido a veces, es porque ya está viejito. Sí es buena onda, pero no es barco... tampoco es perro; como dije, su clase está de hueva.','NA','207.248.40.18','2007-12-11 16:18:47',0),(2943,560,958,'10','Este profe es bien chido, la neta no se anda con jaladas y te enseña temas útiles y actuales/de facto (por ejemplo, TCP/IP en vez de más teoría impráctica [ALOHA, OSI]). No te aburres porque platica cosas chidas relacionadas con redes y uno que otro chiste. Al principio puede intimidar porque está grande y barbón y tiene voz de Barry White, jajaja, pero sí es chido y experto en el tema. Es ídolo de Java y Linux. Si te aplicas como debes, vas a aprender mucho y por ende pasar la materia.','NA','207.248.40.18','2007-12-11 16:18:47',0),(2944,61,180,'9','Es bueno, te pone una chinga pero aprendes!','NA','207.248.40.18','2007-07-26 09:14:24',0),(2945,415,47,'2','Mi historia difiere de las demás porque yo a Luis H. le caía mal y nunca supe por qué. El gÃ¼ey es una loca y super mamón si no le caes. Cuando llevé Algoritmos no me quizo dar revisión del final, me puso 70 y me corrió de su oficina. Si no te toca la mala sal de caerle mal, seguro no tienes problemas; de lo contrario... cuidado con la loca. De conocimientos, en desarrollo de software es relativamente bueno. En Algortimos, 2-3... hasta él se hace bolas. ','NA','207.248.40.18','2007-12-11 16:18:47',0),(2946,31,189,'8','Me la pasé chido, porque te ries de algunas de sus cosas. Es medio \"acá\". Nunca me tocó ver descriminar a nadie por \"naco\" y eso que dicen. Es medio barco, más bien tranquilo. Una vez nos dijo que hicieramos equipos por preferencia sexual... jaja que pedo con eso! Â¬Â¬','NA','207.248.40.18','2007-12-11 16:18:47',0),(2947,519,179,'9','Es muy buena y yo siempre estuve enamorado de ella. No es barca; es apasionada en su tema, pero la materia no es dífícil.','NA','207.248.40.18','2007-12-11 16:18:47',0),(2948,98,722,'2','Este profesor es el colmo, la verdad es el peor profe de mate q he tenido y les voy a decir, no salí mal, es imposible salir mal, no aprendes nada, ni siquiera tienes q ir, es una completa pérdida de tiempo, si te sabes todo lo q vas a aprender en mate I no t estreses y métela con el, si t interesa aprender algo en esa materia huye, en serio HUYE de este maestro. ','NA','189.132.235.230','2007-12-11 16:18:47',0),(2949,203,722,'10','Yo llevé Mate Remedial y Mate I con ella, y la vdd!! es 100% recomendable!! \r\nEs super linda y si no entendiste en clase se da tiempo para darte asesorias...\r\nSinceramente, yo le doy un 100!!\r\nPq aparte de ser barca, es excelente maestra!!','NA','189.156.82.189','2007-12-11 16:18:47',0),(2950,526,955,'10','WOOOOOW!! con este profeeeee saque 100 final!! \r\nEs una excelente personaaa!! se preocupa por todos sus alumnosss!! \r\nEs super buenaa ondaaa!!\r\nSus clases no son aburridaass!!\r\ny PORSUPUESTOOOOOOOO que lo recomiendooooooo!!!! Sin dudaaaaaaaaa!!\r\nMETANLA CON EL!!\r\nla vdd!!!!! este profeee es lo mejorrrrr!! tmb daaa Analisis de la Informacionnn!!\r\n','NA','189.156.82.189','2007-07-26 12:28:30',0),(2951,620,402,'10','Este profeee es lo mejorr!!\r\nen seriooo!!\r\nSi tienen oportunidad, no la piensen y metanla con el!!!\r\nEs excelente maestro, explica super bien... super accesibleee y buena ondaaaa!!!\r\nve a sus asesorias y pasas porque pasasssss!!! ','NA','189.156.82.189','2007-07-26 12:31:13',0),(2952,343,361,'8','Explica muy bien y todo el problema es que no te deja pensar. Te dice ahora ustedes hagan este problema pero te recomienda por donde empezar entonces pues no aprendes tanto. En esta clase casi todos pasan el problema es que cuando yo la lleve solo hubo un 90, como tres entre 80-89, 3 abajo de 70 y el resto entre 70-79. Si quieres sacar una buena calificacion con este maestro no es tan facil pero si nadamas la quieres pasar metela con el.','NA','189.157.155.41','2007-07-26 22:36:22',0),(2953,608,1081,'5','EL PROFESOR MAS BARCO QUE HE TENIDO','NA','189.158.237.162','2007-07-26 23:01:13',0),(2954,701,279,'10','Muy buen maestro, ni barco ni perro, su clase esta muy bien y no deja de hablar de su compañia nemak, nunca hagan mal comentario de su compañia, parciales 2-3 y el final siempre es el mismo asi que si quieren flojearle lo pueden pedir o dediquenle 2 dias y lo terminan','NA','189.194.77.6','2007-12-11 16:18:47',0),(2955,623,724,'5','Es un maldito bastardo no califica nada bien los examenes...','NA','200.94.141.3','2007-07-27 02:04:32',0),(2956,231,870,'9','Es buenisima maestra, buenisima explicando, pero la verdad si te la kieres llevar ligero, no es recomendable meterla con ella, tampoco si tu maestro de estadistica fue un barco porque entonces no vas a hayar la puerta. Yo lleve estadistica y pronos con ella, siempre me trato de lo mejor, es super respetuosa y te ayuda en todo momento y siempre k lo necesitas. La verdad sus examenes no son dificiles, solo k tienes k entender de k se trata la clase, y ella no te regala una calificacion, te la tienes que ganar.','NA','201.172.12.64','2007-07-27 02:05:02',0),(2957,459,851,'9','Esta maestra sabe demasiado, si necesitas saber de probabilidad y est para otras materias en tu carrera metela con ella. Yo la verdad me la pelé un poco porque siempre siempre encarga tarea, cosas bien estúpidas pero dan weba ella les llama actividades previas. La verdad no me acuerdo de alguna que haya sido de que numeros simplemente era de que metete a google y busca conceptos pero es todas las clases. pero lo chido es que llega el examen final departamental y te cagas de risa. Yo ni estudie y de que lo acabe en hora y media por haberla metido con salmeron. Parte llegas a otras materias como control estadistico y de que mucha gente no sabe ni madres de proba y tu sabes un putazo. Todo mundo te anda ahi preguntando.','NA','201.136.130.241','2007-12-11 16:18:47',0),(2958,198,849,'5','Es horrible esta clase, y es cierto k si te kedas dormido te pega de gritos horrible. Nunca sabe explicar nada, tienes k autoestudiar para poder entender de k fregados te esta hablando. Neta tu calificacion es de suerte, si medio entendiste y sabes buscar las preguntas en el libro. La verdad no la recomiendo yo no aprendi absolutamente nada.','NA','201.172.12.64','2007-07-27 02:15:05',0),(2959,236,398,'10','Buenisimo profesor, sabe un putazo y explica conmadre siempre tiene presentaciones PPT para dar las clases. Sus examenes no son numericos todo lo dejas expresado y son de mucho razonamiento. Yo soy un idiota para las fisicas y siempre ahi me andan pasando y con el saque 80 final no lo podia creer. Derepente da curvas bien chidas para ayudar a la raza empinada y siempre siempre esta dispuesto a dar asesorias. Con la asesoria antes del ex parcial tienes para estudiar porque ve todo. Es la mamada','NA','189.152.27.196','2007-07-27 02:16:52',0),(2960,325,320,'10','En ec diferenciales la meti con el me asustaron demasiado al principio que era un error haberla metido con el. Toda la raza que conocia lleva ec con otros profes y sus ex parciales eran de opcion multiple. Jorge Sierra los ponia abiertos y tenias que poner cada paso de tu procedimiento. Sus ex si estan bien cabrones pero la neta explica conmadre porque te enseña los tipos de ec y una vez que sepas identificarlas te enseña un proc para cada tipo de ec. La vdd yo me juntaba a estudiar con otros weyes de otras clases y de que no sabian ni madre y ahi tenia que yo andarles explicando. Llega el examen final que es departamental y de op multiple y te cagas de la risa. Aparte ni tienes que tomar apuntes porque si la llevas en el CIAP utilize el electronic blackboard y al final de la clase te manda los apuntes que genero en clase a tu mail y asi vas creando tu carpeta. La neta es la mamada ','NA','189.152.27.196','2007-12-11 16:18:47',0),(2961,20,44,'8','SI es vdd k vas a trabajar en esta clase, pero los temas son demasiado faciles e interesantes como para k no los entiendas, la vdd tendrias k ser super burro para no captar de k se trata, es mas por cultura general k por otra cosa. Es la mejor maestra de esta materia en mi opinion, sus examenes son exactamente de lo k dijo en clase mas las filminas, no puedes decir, nunca vimos eso. \r\nLo unico malo, esk si se porta mal con aquellos a los k no ve interesados en la clase, pero tmb regala ptos por todos lados, y revisa justamente las tareas.\r\nLo maaas importante, escoge bien tu equipo, si no, te espera un largo semestre.','NA','201.172.12.64','2007-07-27 02:21:35',0),(2962,415,866,'6','Igual difiero de los demas comentarios.\r\nCon este profesor, fue pura teoria y machetear... nada de practica.\r\nno aprendes, si eres bueno macheteando(por lo general los LATI\'S) te ira muy bien\r\npero si quieres aprender te recomiendo que busques otra opcion...  Jakeline es una buena opcion','NA','189.156.182.163','2007-07-27 02:22:19',0),(2963,598,254,'8','Es suuuuuper reba su clase, te cuenta cosas demasiado interesantes y le puedes preguntar lo que sea y realmente te dara su mas sincera opinion. Pero realmente te la juegas en sus examenes como puede k te sakes un 90, te sakes un 20. Todo esta en que leas toda la constitucion y pongas muchisima atencion a sus explicaciones, le gusta k sakes conclusiones por ti mismo, y no nadamas k repitas lo que el te dijo.','NA','201.172.12.64','2007-07-27 02:27:11',0),(2964,61,178,'10','Su clase es divertida, sabe mucho y si tienes dudas te las aclara siempre. No soy nada fan de programación y con él saqué 95. ','NA','207.248.40.19','2007-12-11 16:18:47',0),(2965,536,722,'1','primer parcial todos sacan explica muy bien , todos sacan arriba de 90 , todos la aman....\r\nsegundo parcial deja de explicar y dice que es autoestudio y tu le busques en internet como derivar y antiderivar y reprueban muchos\r\ntercer parcial reprueban mucho mas....\r\nfinal reprueba a muchos...\r\nsoy de los que saco 100 el primer parcial y en la calificacion final 68... no la recomiendo para nada','john doe','189.156.182.163','2007-07-27 02:35:15',0),(2966,464,55,'3','Es un asco de clase. La verdad ella no tiene idea de lo que es un ensayo, y cree k te va a enseñar a escribir. Kizas esta maestra les agrade a aquellos a los que les gusta escribir acerca de sus sentimientos y opiniones personales, y en absoluto de lo que realmente se tratan las lecturas, que para acabarla son un asco. Su trabajo es mega facil, pero ella te lo kiero hacer imposible. La vdd no la recomiendo en lo absoluto, de hecho la materia en si, es una perdida de tiempo, y con esta maestra....','NA','201.172.12.64','2007-12-11 16:18:47',0),(2967,198,870,'2','Malisiiiiiimo pero malo malo en serio.. o sea no explika absolutamente nada de nada.. si realmente le kieres entender.. tienes ke juntarte con alguien ke medio le entienda y ke ademas sea una fregonada con el excel.. de el no esperes nada, es malisimo el se mete en su rollo y segun te esta explicando pero luego le preguntas y no te contesta. Si quieres tronar seguro con el.','NA','200.64.232.169','2007-07-27 05:12:14',0),(2968,164,181,'10','Más fácil no se puede, metanla con el, no vas hacer nada y tendras buena calificación.','NA','189.152.36.103','2007-12-11 16:18:47',0),(2969,98,723,'10','Es el mejor y mas barco profesor que eh tenido en mi vida. No vas a clase nunca solo a los parciales y sacas 100 final, no te pone faltas.','NA','148.221.75.48','2007-07-27 06:38:39',0),(2970,704,243,'9','la clase es en ingles...pero casi casi te la da en español...si no entiendes te lo explica en español...\r\nda muchos puntos extra y los examenes son relativamente faciles... no deja tareas...y no hay final..solo cuarto parcial','NA','189.164.187.17','2007-12-11 16:18:47',0),(2971,699,361,'7','Este profe nadamas porque le pedi personalmente que dejara de dar sus clases a puro canon, y algunos chavos tambien se lo reclamaron, entonces empezo a explicar en el pizarron, habla como robot y no parece tener sentimientos, y si hay alguien en tu salon que saque de 90 para arriba, ten cuidado que si no hay razon para poner puntos extras este profe no los da...\r\nde mi salon pasado.. eramos facil 35+   terminamos en el salon menos de 18, para segundo parcial hasta yo me di por tronado, pero al final de todos los que nos quedamos al final del semestre, trono a 3, y me paso con 71... examenes perrisimos.. les recomiendo estudiar el hibeler statics el pdf, todos los problemas, aprendanse mas o menos como se resuelven que generalmente pone ejemplos de los perros de ahi, y aguas con friccion seca que esta bieeeeen culero con este profe entenderle...\r\nsaque en parciales... 51 52 77... pide tareas a lo wei y cuidado que ya aprendio desde nuestra clase.. y ahora pide que pongas tanto el dibujo como la explicacion del problema, asi que tomate buen tiempo para hacer los problemas, y estudia mucho... yo estudie mas de 12 horas seguidas y creanme no sirve.. tienen que estudiar minimo 1 semana antes del examen','ozico','207.248.46.8','2007-07-27 09:15:13',0),(2972,211,279,'9','Buen profesor, buena clase, y no es facil, pero como dicen por ahi.. si fuera facil cualquiera lo podria hacer... materia recomendada para la gente que le gusta meterse de lleno y aprender mas que los demas. se lleva por mucho a las clases de mancera.. y hasta eso.. no cometas errores orales como.. oiga profe queria preguntarle.. (porque te dira.. vuelve cuando me quieras preguntar y te salta), no te duermas en su clase y no faltes, y ten cuidado con los labs, recomendadisimo tener laptop con el programa que te toque. no intentes copiarte los trabajos, NO hagas lo que HIDALGO dice NO HAGAS. porque mucha gente lo hace y luego se queja.  Si tienes mal pulso, no metas con el. si no te gusta lo elaborado no metas con el. si quieres pasar la materia mete con mancera.... yo 3 dias antes de entregar mi proyecto final, temia reprobar porque no presente examen, el profe me trato a todamadre y me dijo que hablara con richard benitez el de los labs.. si no habia manera de ponerme el examen entonces me iba a ayudar.. se paso de a toda madre esa vez. al final saque 90 en el proyecto final que para tener ese profe es como tocar la gloria dos veces. saque 81 final.   te vas a volver loco con roscas jajajajaja','ozico','207.248.46.8','2007-07-27 09:20:53',0),(2973,211,279,'7','Este mm la si explica el we, y si pasas al menos q estes bien we, pero como la hace de p2 en esa clase por dios!! es bien exigente y mala onda al calificar jeje ','NA','189.152.85.8','2007-07-27 11:13:02',0),(2974,98,723,'10','ESTE ES EL MEJOR PROFE QUE EXISTE, SI QUIERES APRENDER, APRENTES... SI QUIERES SOLO PASARLA LA PASAS, ES LA MAMADA ESTE PROFE, LOS QUE NO APRENDIERON NADA CON EL FUE POR HUEVONES Q NO SE AGAN PENDEJOS','NA','189.153.115.35','2007-07-27 11:26:18',0),(2975,499,182,'4','Mala maestra, se le olvidan las cosas, encarga muchisisima tarea, y al enviarse, muchas veces se le va el avion y no te las pone, se equivoca muchisimo al escribir los programas y es perra para revisar, no recomendable','NA','189.153.115.35','2007-07-27 11:35:21',0),(2976,704,244,'8','La clase es en inglés pero si no se te da mucho igual lo explica en español. No hay tareas, y las que hay son puntos extras. El examen final termina siendo cuarto parcial. ','NA','189.188.0.3','2007-12-11 16:18:47',0),(2977,40,73,'8','En general es buena maestra. Te explica lo que tienes que saber y si en verdad pones atención a los ejercicios que se hacen en clase te va chido en el parcial. El pedo es que si te ve que andas platicando o te jeteas en su clase pues te trae siempre en la mira. Cuando yo la lleve no te dejaba sacar TI, pero ahora si la esta dejando sacar, aunque en realidad no la necesitas. Entrega las tareas, y si te juntas en equipo a estudiar con eso la haces, y cuando al grupo le va mal, da puntos extras, no es mucho pero luego te pueden alivianar.','NA','189.132.98.252','2007-12-11 16:18:47',0),(2978,339,514,'9','Es buen pedo este profe. La clase se pasa volando. Te la teoría necesaria con ejemplos cotidianos y haces muchos ejercicios. Es super paciente hasta para responder las preguntas mas tontas. Siempre abierto a cualquier comentario o sugerencia con respecto a la clase, tarea, parcial o proyecto. Le gusta el futbol y hace quinielas sobre los partidos de futbol atinandole al minuto en que cae el primer gol. Al final hace un talent show que se pone buenísimo y da puntos extras. Sus exámenes estan tranquilos, solamente ocupas ir a clase y estudiar. Si tienes alguna duda, pregúntale porque luego te puede empinar.','NA','189.132.98.252','2007-12-11 16:18:47',0);
INSERT INTO `comments` VALUES (2979,703,55,'10','Esta maestra es lo mejor, da el curso en ingles, y la vdd se pasa todo el tiempo hablando, o dejando que todos hablen y den su opinion. Esta materia es un vil relleno, pero la maestra hace que valga la pena aprender lo que te sirve despues, que es la forma en que se hacen los reportes en MLA. No es barco, pero sinceramente su clase es entretenida, la mestra es accesible y muy agradable como persona y te echa mucho la mano para los trabajos, califica bastante riguroso, pero es el punto: Aprendes.','NA','189.157.107.187','2007-07-27 20:44:07',0),(2980,460,724,'9','La maestra se maneja con las emociones que tenga. Si le caes mal, no te hace tronar, pero no hace nada por ti, osea, te afecta de un modo que no le puedes reclamar. Pero explica muy bien, muy rapido, pero se regresa si no entendiste. Entre mas temprano, mejor, incluso agradece a los que meten clase a las 7 (que esta de weba) y lo mejor de ella es que sus examenes son bien sencillos. Algunos te hacen pensar, pero si truenas con ella es por huevon o por imbecil. Muy recomendable la vdd.','NA','189.157.107.187','2007-07-27 21:20:40',0),(2981,290,724,'7','la clase con esta maesta esta conmadre, se la pasa madreando a la raza y la raza tambien puede deicr una q otra cosa a su defensa jaja la clase no se te hace muy pesada, y encuanto a las tareas no encarga muchas... la neta yo si la recomiendo, yo no soy una verga en mate y sali super bien de esta clase, y esta maestra si te ayuda si al menos no haces mucho ruido en clase, yo la recomiendo mucho porque tambien llegas aprender!','NA','207.248.45.2','2007-07-27 23:01:54',0),(2982,694,398,'6','es buena maestra, explica bien... lo unico son las tareas y los examenes... estan dificiilisimos... las tareas comoqueira todo el mundo se las copia.. pero en los examenes ella se basa en las tareas.. y aunque suene facil y padre que se base en las tareas no lo es... porque las tareas tienen los problemas mas complicados de fisica que hayas visto en tu vida que no puedes resolverlo sin antes haber visto la respuesta... apart ede que las tareas tienen como 20 problemas... y cada problema es de 30 minutos... suena exagerado pero es enserio\r\nme cae muy bien la maestra y todo.. pero con esos examenes se merece un 6... muchos reprobaron, yo pase muy apenas','Rangel Sostmann','189.156.182.163','2007-07-28 00:34:35',0),(2983,694,396,'9','la amee!!!!    es tipo chava!! sus examenes son igualitos a las tareas!!    explica medio raro eso si!! pero es super relajada!!   subio puntos en el final y la verdad nunca puse atencion y saque muy buen promedio!!','NA','209.191.208.101','2007-07-28 00:51:42',0),(2984,686,182,'8','Sabe de C++, pero no tanto, porque cuando te trabas en el proyecto y vas con ella de repente no le encuentra que estas haciendo mal, te dice \"yo lo veo bien, no se por que no funciona\" y eso la vdd la hace caer de mi gracia. Sin embargo en clase te explica bien, va a un buen ritmo para que todos entiendan, las tareas son adecuadas, el proyecto final no es imposible, tiene reto, pero hasta es divertido. La cosa es que te guste la materia o la vas a sufrir, y la maestra la hace bastante sencilla, la forma de calificar hace casi imposible que repruebes, ademas que al final, si hablas con ella y tienes razones justificables, te echa la mano.','NA','189.157.107.187','2007-07-28 00:57:30',0),(2985,291,32,'1','con el noooooooo! es el peoooor! facil te sacas un 30 en el primer parcial y explica horribleeeee aparte hace comentarios ke ni al caso\r\n\r\nmetanla con matar es un amor de profe y explica super bien!','NA','189.154.48.164','2007-07-28 01:01:58',0),(2986,61,182,'10','Clase divertidísima y dinámica. Si eres chava fresa serás la comidilla del día. Solo pon atención y no te copies las tareas porque para el quiz y el parcial te van a atorar. Lo recomiendo ampliamente.','NA','201.172.94.133','2007-12-11 16:18:47',0),(2987,174,313,'7','Callada, prepotente, sangrona, hostil a veces, con favoritismo hacia los lambiscones de la clase, no explica adecuadamente, no hace divertida la clase, son puras presentaciones. Sabe muchisimo, esa es la gran ventaja, porque si sabes hacer las preguntas adecuadas en clase, te las contesta y aprendes un chingo, pero COMO HACER LAS PREGUNTAS CORRECTAS? Eh ahi el problema. ','NA','189.157.107.187','2007-07-28 01:06:40',0),(2988,601,144,'9','Explica muy bien, y sabe mcuho sobre la materia, si ya tienes una nocion te puede dar ejemplos practicos de aplicacion a lo que ves (que en circuitos 1 es poco, porque empiezas con circuitos inutiles de forma practica). Sus examenes estan muy tranquilos, pero algo largos. Es buen profesor, te echa la mano, es bastante barco sin embargo no le busques, en mi grupo puso dos DA, no se si quedaron, pero eso fue lo que habia en la hoja pegada afuera de su oficina. Yo si lo recomiendo, sobre todo si eres estudioso o por lo menos lees el libro cuando te lo pide. ','NA','189.157.107.187','2007-07-28 01:10:03',0),(2989,621,396,'10','Este profe va mas alla de todo lo que he visto en mi vida, no podria ser mas barco si de plano fuera a platicar contigo a la clase y te pusiera 100 sin ponerte examen, en serio. No hay palabra para describir lo barco que es.','NA','189.157.107.187','2007-07-28 01:13:56',0),(2990,580,723,'3','se la mamo este wei no se entiendi ni el mismo... os examenes estan de weba y no te da ni un punto... ademas te duerme en la clase... no la metan con el ','NA','189.156.165.121','2007-07-28 01:13:59',0),(2991,349,313,'10','TE MAMOOOOOOOOOOO....este profe es la mamada no solo pase un parcial con 70 y los otros dos los trone con 50 en el final sake 70 y pase ... se la mamoooooooooooooooooooooooooooooooooooooo metanla esta conmadre ','NA','189.156.165.121','2007-07-28 01:16:20',0),(2992,466,954,'3','cree ke su clase es la unica ke tienes... encarga trabajos a morir y es super estricta para revisar... no la metan ademas sus clases dan weba','NA','189.156.165.121','2007-07-28 01:18:39',0),(2993,584,469,'9','Muy buen maestro. Su clase es dinamica y te hace reir. Metanla con el !!!! Su defecto es que pone actividades demasiado complicadas de entender.','NA','189.158.132.167','2007-07-28 05:39:40',0),(2994,22,176,'8','Pues miren, éste prof tiene su pro y su contra...\r\n\r\nSu pro: BARCO DE A MADRES (así con mayúsculas)\r\n\r\nSu contra: Llevé clase con él a las 7 de la mañana en martes y jueves, SIEMPRE te hacía llegar a la mera hora.. para que 20 mins despues \"ya muchachos, ya acabamos.. pueden irse\". Siempre le pedimos llegar más tarde, nos decía que no y nos daba una letanía que la responsabilidad y la madre... Â¬Â¬ Y es bien perro con las faltas y retardos.\r\n\r\nAsí que ya saben niños.. Quid pro quo','Gerardo','200.53.42.196','2007-12-11 16:18:47',0),(2995,620,402,'10','Es la mamada este profe... creo que ya todo mundo dijo lo que tenía que decirse. Alivianado, cool, buen profe, flexible. Si truenas es por huevon o porque de plano estás bien bruto. Un 100 súper merecido :D','NA','200.53.42.196','2007-12-11 16:18:47',0),(2996,501,879,'10','Mauricio guajardo, es uno de los mejores maestros que la carrera de Diseño pueda tener, super amable, amigable y si le caes bien es a un mejor. su materia la da como ningun otro, aprendes de la manera más dura y dificil, pero realemente al final de todo das gracias por haber llevado con el, porque en la carrera será una fuerte base!\r\n\r\nmauricio, u are the best!','Ãƒâ€°riol','189.157.130.173','2007-12-11 16:18:47',0),(2997,432,878,'8','Su unico y más grande defecto es que encarga investigaciones de la nada, cosas que no vienen al caso, pero ella las pide, en lo demás es una maestra normal, califica conforme a lo que pide, es buena onda y pues si la meten con ella, sera una materia que si ustedes quieren sacaran provecho de lo  mejor.','NA','189.157.130.173','2007-12-11 16:18:47',0),(2998,243,723,'1','EL PEOR MAESTRO QUE E TENIDO, REPRUEBA AL 65% DE LA CLASE, EXPLICA NEFASTO, A LAS CHAVAS DE LAS PASA ALBUREANDO Y SE LA PASA PRESUMIENDO SUS COSAS, ADEMAS DE REVENTAR A SU SUEGRA, SE HACE EL CHISTOSITO PERO A LA HORA TE CHINGA, EXPLICA A SU MODO, NO SIGUE EL PROGRAMA, NO SIGUE EL LIBRE, NO SIGUE NADA HACE LO QUE QUIERE, NO DA NI UN PUNTO EXTRA','NA','189.153.115.35','2007-07-28 14:38:42',0),(2999,555,219,'8','Explica muy bien, las tareas son muy dificiles y quitan mucho tiempo, en los examenes si se ven todo el material que se enseño asi que hay que estudiar TODO. El examen final estaba extremadamente dificil. Mi recomendacion: solo tome con el control digital si llevaron tambien con el ingenieria de control.','NA','148.243.40.94','2007-12-11 16:18:47',0),(3000,132,143,'5','no es buen profe, sus explicaciones son tontas, uno puede faltar la mitad de la clases y darse cuenta que siguen en lo mismo, nomas uno tiene que aprender la manera de analizar el circuito y le puede dejar de poner atencion 3 clases porque el va a seguir con lo mismo, recomiendo que estudien por fuera de la clase y llegen a a la clase y nomas le pongan un poco te atencion si no te aburre. los examenes no son dificiles (basciamente formulaso) , pero califica con un criterio raro que hace muy dificil sacar buena nota, el laboratoria vale mucho ahi es donde le tienen que hechar ganas','NA','189.157.130.173','2007-07-28 23:49:54',0),(3001,646,367,'5','clase da flojera.. la vdd. uno no hace nada. la clase es hace un problema el nomas lo pone el la pizarra y ya.. 40 minutos despues de que no pasa nada el lo resuelve, y ya.. se acabo la clase.. los examenes son faciles de hecho son de opcion multiple (asi me tocaron a mi)','NA','189.157.130.173','2007-07-29 00:01:40',0),(3002,262,144,'9','Yeomans es la onda!  buenísimo para explicar y con un dominio total del tema. Todo un master de la materia.. Si le sacas plática se puede desviar bien fácil y te pasas la clase hablando de cosas sin sentido. Los exámenes son sencillos si hiciste las tareas y nunca te niega una asesoría. No preguntes cosas tontas porque luego no te la acabas, contesta muy sarcástico pero te ries un buen. Siempre, siempre hay tarea y necesitarás mucha dedicación porque es una materia de autoestudio. Definitivamente uno de los mejores maestros que he tenidoO.','NA','189.194.72.168','2007-12-11 16:18:47',0),(3003,355,851,'8','No se porqué lo calificaron tan mal. Yo aprendí un buen en su clase. Si no le echas ganas ps obvio que te va mal pero es cuestión de que le pongas atención y de que hagas las tareas. Explica muy bien y te ries de sus chistes pero porque son muy malos. Los exámenes son sencillos y si estudiaste te va bien. Las clases son medio aburridas pero si aprendes. ','NA','189.194.72.168','2007-12-11 16:18:47',0),(3004,225,722,'10','la mamada este profesor. siempre en asesorias para las pocas dudas que te puedan surgir, ya que explica muy bien. te tira paros si ve que le hechas ganas.','NA','189.160.44.63','2007-07-29 08:07:45',0),(3005,655,934,'9','pues.... a nosotros siempre nos dio las presentaciones. esta cabron con ella, pero si le echas ganas si pasas, si quieres maestr@ para aprender, metela con ella, si quieres pasar solamente, no es para ti.','NA','189.160.44.63','2007-07-29 08:09:07',0),(3006,174,313,'9','buena maestra. en si la clase esta facil, nadamas no te apendejes y ya. yo saque 93 y pues, lo unico que hice fue aprenderme las formulas y ya.','NA','189.160.44.63','2007-07-29 08:10:20',0),(3007,211,361,'1','no no no y no. el peor profesor que me ha dado clases en la vida. a mi grupo no le explicaba nada, todo era autoestudio del libro. ibas a la hora de asesorias a su oficina y no te atendia nunca. no cuenta procedimiento en los examenes. se hacia bolas con sus propios problemas. si eres quimico o industrial  te pasa (porque los quimicos no la usan para nada y pues bueno, los industriales...), pero mecanico o civil, pelatela cabronsisimo.  definitivamente no vale gastar 8 mil pesos por una clase que es puro autoestudio ya que el maestro falta constantemente y no haces mas que un problema en clase, o los resuelve a medias, solo la parte facil, y encarga lo dificil de tarea. ','NA','189.160.44.63','2007-07-29 08:16:09',0),(3008,211,279,'7','pues..... en dibujo definitivamente aprendes mucho mas que los alumnos de mancera, demasiado. los de mancera te van a pedir ayuda. pero si te la vas a pelar bien cabron. si vale la pena meter dibujo con este wei, si le piensas entrar de lleno y pelartela. si no mete con mancera y ya, no hay pedo.','NA','189.160.44.63','2007-07-29 08:18:50',0),(3009,686,179,'10','uyyyy un pan de dios esta maestra. casi le pido matrimonio al final del curso. si ve que le hechas ganas y pones atencion en la clase te ayuda bien cabron, siempre en asesorias y pues.... no se,  es la mamada.','NA','189.160.44.63','2007-07-29 08:20:18',0),(3010,308,473,'1','pues a mi me dio historia de la ciencia, pero no sale aqui asi que puse otra. este... es una weba llevar la clase con el, tienes que llevar resumenes cada clase y te los califica bien ogtemente. se supone que era mi materia para subir el promedio ese semestre y pues acabe sacando 89, lo cual estuvo ogt para lo que esperaba. puras pps la clase, asi que siempre es una weba y siempre toma lista. no la metas con el, mejor mete otro topico.','NA','189.160.44.63','2007-07-29 08:22:20',0),(3011,13,723,'10','ahhh yo ame a esta maestra. saque 76 final, pero en serio aprendi conmadre. la maestra siempre explicaba conmadre en clase y en asesorias siempre estaba y te resivia conmadre, pero en el examen te cogia bien cabron jajaj. no faltes nunca a su clase, porque da puntos al final y los vas a necesitar.','NA','189.160.44.63','2007-07-29 08:24:02',0),(3012,53,39,'10','Este profe es el ideal para empezar a estudiar alemán, por el simple y sencillo hecho, de que te muestra que no es una cagada de risa como lo es el idioma Inglés. El profesor es sangron, prepotente y perrisimo, pero, enseña tan bien la materia que aprendes demasiado, es accesible fuera del salon de clase, solo tienes que encontrarle la forma. Los examenes son dificiles, pero por toda la tarea que encarga, si la haces, te preparas bastante. Creo que es la mejor opcion, he entrado de oyente con otros profes y la vdd siento que les falta ese estilo tal vez \"aleman\" de enseñar.\r\nSolo para valientes.','NA','189.157.107.187','2007-12-11 16:18:47',0),(3013,566,402,'5','NO, pesima opcion, explica bien raro y la clase es bien... basica, la vdd es que muchos llevamos esta materia porque el examen de admision esta imposible y es puro negocio, pero esta maestra no es la ideal para llevar esta materia, ni para los que realmente la necesitan, porque no aprenderan nada. Y mucho menos para los que no la necesitas, porque se van a aburrir peor.','NA','189.157.107.187','2007-07-29 09:41:26',0),(3014,211,279,'10','El mejor profesor para dibujo computarizado. Aprendes mucho mas que los que la llevan con Mancera, y sobre todo los IMEs que llegan a conocer al profe en Estatica (que en plan de estudios va primero) culean de meter dibujo, pero la cagan. Si es dificil, pero entiendes cosas que el libro no deja bien claras, y ademas lo mismo que te califica hasta el nombre en los examenes, hace que te esfuerces de verdad. Algunos ven la clase como una forma de sacar una buena calif. Con este profe, si se puede sacarla, solo que vas a trabajar, pero no tanto como muchos dicen, la clase en si es sencilla, Hidalgo solo hace que valga la pena.','NA','189.157.107.187','2007-07-29 09:47:46',0),(3015,211,361,'10','Han escuchado sobre los \"REVOLUCIONARIOS\"? Pues este wey es el mas pesado de todos, solo para valientes y para estudiantes de verdad.','NA','189.157.107.187','2007-07-29 09:55:31',0),(3016,35,723,'1','Agh, no se si esta persona siga en el tec, pero es el peor profesor que haya tenido jamas, aprendi poco o nada, y sufri su presencia todo el semestre...','NA','189.157.107.187','2007-07-29 10:00:06',0),(3017,655,934,'9','La mamada, la maestra esta cagadisima, cae gorda con sus regaños de abuelita y eso es lo mas reba. Explica con madre, ahora da las presentaciones de PPT, antes no las daba. Aprendes un chingo y sus examenes estan fáciles. Solo es cosa de aplicarte regular, si eres desmadroso y flojo... pues buscale, esta no es.','NA','189.157.107.187','2007-12-11 16:18:47',0),(3018,14,751,'10','La mejor... muy recomendable!! Si eres merca, de ley con ella!! Para las demÃ s carreras solo hay 1 grupo, pero si pueden, en verdad metanla con ella... Sabe mucho, le interesan sus alumnos, te ayuda, es lo mejor!! Cualquiera que sea LEM la recomienda!!','NA','201.172.250.217','2007-07-29 23:16:03',0),(3019,567,189,'10','Una de las mejores maestras que hay en el tec.. sabe dar muy bien su clase, es un amor de maestra.. Lo unico que no le gusta es que falten a su clase.. se lleva muy bien con sus alumnos.. Muy recomendable meter clase con ella.','NA','189.167.102.129','2007-07-30 00:39:56',0),(3020,216,534,'10','Otra de las mejores maestras del tec.. sabe mucho y aprendes bien.. todo esta en el libro, los examenes estan bien, no le gusta que faltes a su clase, y te da chance de entregarle las tareas despues de clase.. Como persona es super linda..','NA','189.167.102.129','2007-07-30 00:58:13',0),(3021,61,898,'8','Buen profe ... la materia es algo pesada pero no tiene nivel de dificultad ya que te basas en conocimientos que ya debes de tener. El profe es alivianada y se limita a dar siguimiento a tu proyecto a lo largo del semestre. Recomendado.','NA','189.167.113.196','2007-07-30 03:58:13',0),(3022,465,179,'10','Lo mejor esta maestra es super buena onda, explica bien, te ayuda mucho y si aprendes.','NA','189.167.113.196','2007-07-30 03:59:10',0),(3023,298,866,'10','Super buena maestra, explica padre y tiene paciencia cuando no entiendes.','NA','189.167.113.196','2007-07-30 03:59:48',0),(3024,519,543,'9','Excelente maestra! Sabe perfectamente de lo que habla, una clase super interesante; yo aprendí mucho. Lo que si es que encarga demasiadas actividades, no has entregado la que te pidió ayer y ya te está pidiendo otra y los examenes están difíciles asi que si le tienes que echar todas las ganas del mundo. Pero yo aprendi muchísimo','NA','189.167.113.196','2007-12-11 16:18:47',0),(3025,415,180,'10','De los mejores profesores del tec. Explica super bien aparte de que es buenísima onda, hace bromas y todo. No es nada barco pero tampoco es tan exigente al calificar, si tienes una idea de lo que se vio en clase y haces todas las prácticas te va a ir super bien.','NA','189.167.113.196','2007-12-11 16:18:47',0),(3026,532,207,'10','Excelente maestra, super recomendable porque no es perra y tampoco es muy barca, pero explica super bien y los examenes están facilícimos! Aparte es buena onda, derepente si se desespera y se pone a gritar, pero nada grave.','NA','189.167.113.196','2007-12-11 16:18:47',0),(3027,112,951,'10','La clase está aburrida, pero porque así es la materia. Las películas que te pone están padres. Ah pero eso si, prácticmente todas de Dustin Hoffman o Meryl Streep... pero muy buena onda la miss y aparte te pone quizzes para subir puntos y para practicar.','NA','189.167.113.196','2007-12-11 16:18:47',0),(3028,291,32,'1','Malisisimooooooooo para explicar! no la metan con el ... sacas en el primer parcial 30 metanla con matar es bien chida esa profe','NA','189.167.113.196','2007-07-30 04:03:26',0),(3029,542,723,'5','Este vato es huevonsísimo y la neta te lo transmite. Nadie quiere preguntar nada porque responde de mala gana. Los que dicen que es chido es porque son industriales o algo por el estilo y les vale la materia y solo quieren pasar. yo la neta si queria aprender y tener un maestro que le eche ganas a su jale, aunque sea pokito. pero bueno, si eres de esos q busca un 70 y palomear mate, no es mala opcion. si quieres aprender y tratas que te guste mate pues piensalo dos veces porque este vato te transmitira una hueva increible.','NA','189.167.113.196','2007-12-11 16:18:47',0),(3030,167,850,'10','El mejor profesor que he llevado en la carrera, sabe muchisimo sobre el tema y explica excelente pero si es complicado y son problemas para pensarle. Sus examenes son lo que se ve en clase. El final esta mas o menos sencillon','NA','189.167.113.196','2007-07-30 04:04:38',0),(3031,246,176,'10','mi maestra favorita hasta la fecha... su clase es genial.. metanla con ella!','NA','189.167.113.196','2007-07-30 04:05:10',0),(3032,246,176,'9','todas mis amigas tenían clase con ella y yo tenía libre, cuando no tenía nada que hacer las visitaba en su clase y la maestra es lo mejor, seguido tienen convivios en clase y tienen muy buen ambiente en su salón, los deja salir y regresar todas las veces que quieran, no toma lista y califica super bien sus trabajos...','NA','189.167.113.196','2007-12-11 16:18:47',0),(3033,702,701,'7','Barcooooo... como el titanic, pero mas! pasas con buena calificacion, aprendes si quieres, pero no sufres, ni nada... a veces es una flojera ir a clases, pero el es accesible, hace su esfuerzo..','NA','201.132.7.117','2007-07-30 04:31:08',0),(3034,707,851,'8','Este profe como es cubano cuesta a veces entenderle por su acento y es que le saca bastante roio a la hora de explicar. Eso si..... TODOS PERO TODOS  los examenes son libro abierto hasta el final. Si le apelas los puntos, te los sube. Es de catedra, solo te da asesoria los martes y jueves. Si la vuelvo a meter con el.','NA','216.184.96.155','2007-07-30 04:58:08',0),(3035,8,1130,'8','Es buen maestro... si explica y todo, es de los mas accesibles, qiza el mas accesible, explica pues bien y si me fue bien con el, auqnue igual tienes q echarle mas o menos de ganas por que sino, no pasas','NA','189.132.186.126','2007-07-30 06:26:45',0),(3036,536,726,'10','Matematicas remediales con Blanca Ruiz... calificacion final 35\r\nMatematicas remediales con Patricia Salinas... calificacion final  87\r\n\r\nExplica muy bien, no hace examenes parciales, solo mini quizzes semanales, si no le entiendes vas a asesorias con ella y te explica co