sado..','NA','131.178.243.246','2007-08-07 02:08:59',0),(3058,539,398,'10','Excelente maestro la verdad. No hay palabras para describirlo jejeje. Simplemente explica muy bien y entiendes todo de manera perfecta. No da puntos pero sus examenes rápidos son fáciles y son como los problemas k encarga de tarea. Los parciales son como los ejemplos k da en clase y tmb como los de tareas y la verdad no se saca cosas de la manga o asi. Yo lleve clase con el el prepa y ahora de nuevo y la verdad lo super recomiendo para cualquier persona que quiera salir bien y aprender.','Dante Paredes','189.157.113.74','2007-12-11 16:18:47',0),(3059,35,716,'1','mis respetos para EL PEOR PROFESOR QUE HE CONOCIDO Y QUE ME HA DADO CLASES EN MI VIDA !,, cero recomendable gente..','NA','189.156.170.3','2007-08-07 06:46:30',0),(3060,646,327,'6','Huele a chopa!!!','NA','157.254.98.203','2007-08-08 03:05:32',0),(3061,410,396,'1','lo peor que me ha pasado... neta le heche todas las ganas del mundoo!.aclarando que la fisica no es lo mio... pal final estudie demasiadooooo!.   saque buenisma calificacion . fui de los mas altos del salon. pero al final me dio 68..y ahi quede.  muy mala experiencia .. te frustra y  no te explica.  te dice que ahi esta libro  y hasta ahi  llega su ayuda. ','NA','189.157.119.225','2007-08-09 13:49:44',0),(3062,180,280,'10','Gracias a Elsa se dibujarr. exelente maestraaa/  te  mete las tecnicas porq te las mete... en dibujo arquitectonico que miedo la di de baja. \r\npero cuando lleve dibujo 1 fue lo mejor..','NA','189.157.119.225','2007-08-09 14:00:48',0),(3063,646,328,'8','Pues el malacon method funciona, ya que me ayudo para cosas de mi trabajo..','NA','201.158.132.66','2007-08-09 20:51:01',0),(3064,72,1031,'9','Simplemente buen maestro , fue mi ultima clase conel antes de graduarme, mucho leer pero nada del otro mundo. sabe de todo; algo duro con las chavas cuties, cuidado, alos LCC les pone duro. pero en general es bueno, la clase la hace interesante.','NA','201.158.13