co accesible...\r\nExplica para ella y te hace difícil la materia... en los exámenes se la baña y no te ayuda a menos de que le caigas bien.','NA','207.248.40.19','2007-12-11 16:18:47',0),(3071,291,32,'10','Excelente profesor... da asesorías antes de cada examen y lo que ves ahí es lo que viene. Super accesible, buena onda y te da puntos extra al final si no faltas y entregas todas las tareas.\r\nSi tienes que leer los capítulos para entender las clases, pero es porque así lo requiere la materia...no te complica la vida y en clase platica problemas de la vida real o situaciones por las que ha pasado y  se te va rápido.\r\n','NA','207.248.40.19','2007-12-11 16:18:47',0),(3072,396,5,'10','Excelente maestra, sus clases tal vez no sean las mas divertidas, pero si te gusta por lo menos un poco la administracion encontraras la materia bastante interesante. Ademas que la mayoria de las veces sus slides son los examenes, asi que practicamente tienes una excelente guia de estudio.','NA','189.160.119.104','2007-08-13 05:28:34',0),(3073,412,503,'9','este profe si es muy bueno, no hagan caso a los malos comentarios, si le sabe bien a la materia y te puede contestar lo que quieras...normalmente la clase se va rápido, pone muchos ejercicios y de repente sale con actividades que son para entregar en la misma clase....siempre llega temprano, casi siempre pasa lista, las tareas son escasas pero es recomendable hacerlas.....si le echas ganas te irá bien, te da proyectos por cada parcial, de 10 ptos aprox, y un proyecto final medio dificil, pero si lo sacas, te da como 10 ptos finales, y si andas mal, te pasa....no es fácil con el pero si lo recomiedo, y si aprendes','NA','131.178.74.86','2007-12-11 16:18:47',0),(3074,713,352,'10','Buena onda, en el proyecto final si vió que te esforzaste todo el semestre se aliviana.\r\n\r\nA veces lleva a su hija a clases, jajaja\r\n\r\nEn cuanto a ergonomía, ella escribió el libro, literalmente.\r\n\r\nSe enfoca mucho en organizar la información qu