rcazo, nadamas cuidado con el final porque si es departamental.','NA','189.156.180.95','2007-11-14 18:45:01',0),(3196,748,784,'10','Es muy buena onda, enseña muy bien los materiales y es paciente con los  trabajos. Si trabajas con el no hay problema, ademas de que cuenta muy buenas anecdotas y tiene buen sentido del humor :D','NA','189.157.132.178','2007-12-11 16:18:47',0),(3197,751,432,'10','Un profesor con un conocimiento impresionante. Objetivo e Inteligente. Si realmente quieres aprender de Ciencia Política se tiene que llevar su clase. Sus exámenes son fáciles, sus tareas son simplemente resúmenes, y sus trabajos son análisis. Para pasar la materia con simple atención en clase y un poco de lectura. El debate está a la orden del día con él haciendo la clase interactiva, dinámica y en ocasiones hasta divertida. Te presenta el plano real del México en el que vivimos. Es una gran persona, siendo comprensible (En ocasiones incluso algunos alumnos abusan de eso) Respetuoso de todas las opiniones y siempre argumentando las suyas. De verdad, el mejor profesor de Ciencia Política, y si eres de 1er semestre, sin duda no hay mejor alternativa. El único requisito: Aprovechar su clase, de lo contrario, no metan con él.','U. V. H.','131.178.74.30','2007-12-11 16:18:47',0),(3198,404,274,'10','EXCELENTE MAESTRA!\r\nEs buenisima onda la miss, da excelentes explicaciones, las clases son MUY agusto y bastante productivas!\r\nPuede ser que sea medio pesado el examen parcial, pero la Miss explica todo super bien. CLARO que vale la pena meter con esta maestra.','NA','131.178.29.44','2007-11-15 06:59:38',0),(3199,72,480,'10','Sus exámenes sí que son un rompecabezas... Tienes que tener la mente muy abierta y aprender a distinguir entre las trampas que te pondrá para que te confunda. Sin embargo, al mismo tiempo, es una combinación extraña entre crueldad y bonanza: Si a todos les va mal, hace curvas extraordinarias. Pone trabajos de puntos extra. Califica las presentaciones de manera muy light y la participación no es un problema. Lo único es: NO PONERSE NERVIOSO EN SUS EXÃMENES, mantener la calma, estar rodeado de gente de confianza y tener el libro a la mano (Porque hasta eso, son con libro abierto, pero eso no los hace más sencillo) Como profesor, sabe muchísimo, tiene una gran carrera por detrás, así como un cultura que sorprende. Bromista (quizá para algunos ofensivo, pero en realidad no es vengativo, sus bromas y críticas no repercuten en la calificación), dinámico y eso sí...Nunca... PERO NUNCA... se calla. Definitivamente un SHOWMAN (después de todo es Comunicólogo) y con un harto conocimiento (Tiene columnas, programas de radio e inclusive forma parte del equipo del periódico virtual INDIGO) Si quieres un resumen de su clase: Vívetela feliz y lee, así de simple\r\nP.D. Llevate una café a su clase, pues su clase es vilmente la narración de una novela con todo y chismes, bluppers y demás.','U. V. H.','131.178.74.30','2007-12-11 16:18:47',0),(3534,557,1008,'1','Nada recomendable, se dedicaba a traducir las presentacions de la pagina del libro y no explicaba los problemas y cuando trataba de hacerlo te dejaba peor que como estabas, lo acababa medio explicando uno de la clase o cuando iba su esposa ahi medio que entendiamos algo, pero noo, no la metan con él es un pesimo maestro, no se porque el tec conserva a maestros que la verdad no explican y no te dejan nada bueno, no les aprendes nada, hacen que te mates estudiando y para nada porque los examenes estan perrisimos nadamas él ele sentiende','NA','148.244.194.113','2007-12-11 22:10:06',0),(3200,458,207,'9','a mi se me hizo super bn la clase no esta pesada si piensas pero tnes ke ir a asesorias las hace en su casa y te ayudan muchissimo','NA','131.178.241.122','2007-11-15 12:30:39',0),(3201,430,207,'9','muy buena la amaestra se preocupa por ke aprendas no es nada dificil. los examenes casi siemrpe valen el 100 de la calificacion las asesorias son en su casa. pero vayan les ayuda demasiado 