n el método clásico de las diapositivas y otras cosas que aturden la clase), si quieres poner en práctica tus conocimientos de carrera (haciendo analisis, spots, publicidad, etc), o simplemente aprender, metela con él.\r\n\r\n','NA','189.153.172.173','2007-12-11 16:18:47',0),(3238,318,397,'1','NOOOOOO de lo peor este maestrooo\r\nempieza a tomar lista desde 10 min antes k empieze la clase y pone examenes de lo peor que segun el estan super panales claro k son problemas k nunk as visto en tu vida y kien sabe como los relaciona con temas k segun el ya vieron en clase, siempre da puntos extra pero no te ayudan mucho','NA','189.152.136.31','2007-11-20 09:56:48',0),(3239,405,1050,'7','Esta medio raro calificar a esta maestra, de k es chida es chida, pero es superrr BIPOLARRRR asi mal pex, es de k en un minuto te puede estar explicando un trabajo y al siguiente ya se enojo por nada y se sale del salon para no volver y no explicar ya nada nunca, eso si da puntos extra por casi todo lo k te puedas imaginar','NA','189.152.136.31','2007-11-20 10:04:08',0),(3240,129,361,'6','si te gusta ser autodidacta este es tu profesor soñado jaja, vas a ver muchos temas y vas a tener muchos temas y los vas a tener k aprender solo, eso si , califica medio suavecito y si le demuestras k tu universo entero es su materia te va a hacer favores y te va a dar puntos... asi que si quieres que tu semestre se llame estatica ya sabes','NA','201.172.203.178','2007-12-11 16:18:47',0),(3241,557,1008,'2','la lleve en español, pero las slides son en ingles. la clase la tenia una vez a la semana, y cada semana te pedia tarea para la clase que todavia no veíamos. los terminos que vemos en el examen son totalmente diferentes a los del libro por lo mismo que esta en ingles el libro y en español la clase. esta medio sordo entonces hay que gritarle para que te entienda, y como quiera te responde otra cosa a lo que el preguntaste. el cree que te acuerdas de todo lo de contabilidad financiera aunque la hayas llev