s clases son muy interesantes sabe demasiado aunque si llegan a ser cansadas a veces por que son muy monotonas ose que habla y habla y habla, aunque suele haber mucha discusion a veces en el salon dependiendo del tema que estemos viendo. Sus examenes ya no son de 2 preguntas ahora te pone 3 preguntas y escoges 2, lo que hace mas facil la materia y es una persona bastante accesible. vale bastante la pena. la volveria a meter con ella sin pensarla dos veces.','NA','207.248.45.8','2007-11-22 10:07:58',0),(3258,752,191,'10','excelente profesor. Sabe de lo que habla, si te interesa tu promedio no la metas con el porque probablemente no saques arriba de 85, es muy perro a la hora de checar trabajos y pone quizes todas las clases sobre noticias de la semana (el solo da una clase de tres horas) bueno el caso es que estos quizes te pegan hasta el final. valen 15 puntos finales y la gran mayoria del salon no se saca mas de 20 de 100 en los quizes, no es que esten dificiles, pero realmente te tienes que poner a leer el periodico todos los dias ademas de leer para las demas materias lo que no es nada facil, pero aprendes demasiado con el ves la teoria aplicada no solo te sientas a ver teoria. Tambien hace reuniones de integracion muy buenas, desde una simple salida a un restaurante en plan tranquilo hasta salidas a agarrar el pedo que pueden durar hasta el dia siguiente, pero eso ya depende del ambiente que toque en el salón.','NA','207.248.45.8','2007-12-11 16:18:47',0),(3259,745,727,'3','muy mala\r\nexplica pero no lo suficientemente bien\r\nse cree la chistosita y créanme que no lo es\r\nno pone atencion a tus dudas mientras explica\r\ny se la pasa coqueteando\r\na los chavos :S\r\n\r\nla verdad es muy aburrida su clase\r\nno emtan con ella en verdad\r\nno saben lo que hacen!!!!','NA','189.160.136.27','2007-12-11 16:18:47',0),(3260,752,191,'10','Looooo mejor de lo mejor! Un maestro que si se para al tec para dar clase y no insultarte al estar leyendo powerpoint como si tu no