s.','NA','200.53.80.63','2007-12-11 16:18:47',0),(3265,550,397,'10','Excelente profe!!!! explica super claro, con peras y manzanas, se detiene si no le entiendes.\r\n\r\nsus examenes estan pesaaaadooos pero la verdad vale la pena meter materia con el.\r\n\r\n\r\nes muuuuy bueno!!!!!!!','NA','189.152.124.126','2007-11-23 02:02:50',0),(3266,620,402,'10','El mejor profesor de fisica que vas a tener en tu vida.     No por barco sino por la forma en que imparte la materia','NA','200.53.80.63','2007-11-23 02:23:54',0),(3267,763,55,'10','muy buena maestra muy amena, te deja entregar trabajos tarde si vas a la clase y todo y no te vale madres, la neta muy buena maestra claro que meteria otra materia con esta maestra si pudiera,.','NA','189.156.181.96','2007-11-23 03:34:07',0),(3268,548,934,'2','muy mal maestro la verdad es que explica muy mal, lo que te ense;a es de presentaciones de power point de otros profesores, y tiene metodos diferentes a los demas para hcer los problemas. Eso si qita puntos en los parciales, pero todas las preguntas valen lo mismo, asi que si sabes a hacer lo mas cabron pero se te olvida una pregunta de multiple choice, valen absolutamente lo mismo, tambien muy aburrida su clase no manches la hora y media mas eterna que eh tenido en mi vida','NA','189.156.181.96','2007-11-23 03:36:53',0),(3269,759,108,'9','Muy buen maestro, explica bien chido y es buena onda. Los parciales estan laboriosos pero no imposibles, ademas de que la mafia ya los tiene, y al final hace buenas curvas. Lo recomiendo','NA','189.154.41.124','2007-11-23 07:27:22',0),(3270,325,724,'7','Si quieres aprender a la mala Sierra es el indicado. Vas a sufrirla mal pedo pero al final la haces de todas todas, tanto que el final departamental te va a parecer regalado. Los parciales estan cabrones, duran 2 horas y son generalmente los sabados. Encargan un chingo de tarea, por lo mismo aprendes. Son pocos los que pasan con buenas notas, no le crean a los otros jajaja, mejor metanla con ANDY WARRIOR que por cierto le caga a Sierra jajaja','NA','189.154.41.124','2007-11-23 07:46:19',0),(3271,434,32,'10','Muy buena maestra, examenes faciles, tareas faciles, da puntos extras y hace la clase entretenida porque le encantan los rayados. A todo mundo le va bien... bueno a los licenciados no, pero pues comprensible no? jajajaja','NA','189.154.41.124','2007-11-23 07:55:35',0),(3272,13,723,'5','Es la vieja mas caguetas del mundo!!!...no es mamona ni nada de eso, pero encarga un chingo de tarea que valen minimo 15 puntos de cada parcial, si te da puntos extra que te alivianan, pero hace uns examenes parciales bien perros....y en general en la clase siempre anda con una actitud caguetas...la vdd no la recomiendo, aun que no es la perra de mate hay otros maestros que no te la llevas mucho mas tranquilo y sin tener que lidiar con una perra','NA','189.157.126.180','2007-11-23 08:20:31',0),(3273,349,313,'10','EXCELENTE MAESTRO, .. tiene una forma de explicar las cosas que es fácil de entender además hace que su clase no sea aburrida. Definitivamente uno de los mejores maestros que he tenido..no creo que los exámenes estén fáciles, si hay que echarle ganas pero se aprende demasiado.','NA','131.178.98.182','2007-12-11 16:18:47',0),(3274,185,954,'9','Muy buena maestra, el primer dia te dara miedo :S pero depsues te daras cuenta q es muy buena gente, simpre busca la manera de ayudarte para q aprendas, contabiliza todo y no da puntos extra pero ve la forma en q te vaya mejor, aveces se da sus aires de egolatra.. pero solo soportala y dejala hablar al final tiene un gran corazon.\r\n\r\nPD. La maestra se puede decir q es medio Homofobica asi q si eres gay, simplemente sordeate .. jaja','NA','201.163.15.208','2007-11-23 10:20:58',0),(3275,760,108,'8','es buena maestra, pero el problema es que explica con ejercicios que ella ya hizo previamente entonces aveces como que se acelera por que piensa que pueden los alumnos deducir en muy poco tiempo un problema complejo, los examenes 