olucion y cambiarlas en el examen por las que el te da ','NA','189.157.128.156','2007-11-26 01:23:51',0),(3306,685,1008,'7','ahi les va la verdad.. no le hagan caso a los otros comentarios..\r\nesta maestra explica muy bien.. entiendes todo si pones atencion y no platicas.. sus exámenes esta cabrones, son dos tipos y hay un tipo que anda circulando.. si te toca ese tipo ya chingaste, solo le cambia unos numerillos y ya..\r\na mi me toco la mala suerte de que me dieran el otro tipo en los 3 parciales...\r\nsi no hay ningun 100 (que es lo mas probable) hace curva.. siempre nos dio curva... eso si.. encarga bastante tarea las conte y son como 25 tareas...\r\nen el final tambien.. estan circulando los 2 tipos asi que ponganse a ahcerlos y esta mas facil que los parciales pero no se confien..\r\nal final o repruebas gacho o pasas.. no ves a nadie tronado con 65.. te pasa si te quedas cerca del 70.. ese fue mi caso.. pero eso si.. NUNCA da revision.. si quieres asesoria tienes que mandarle correo.. no le gusta que haya gente en su oficina.. asi que hechale ganas en clases... tengo promedio de 79 y pase..\r\nasi que ahi decidan...\r\nasi que es equis no es perra.. no es buena... si tienes arriba de 90 despues de los 3 parciales te excenta','NA','189.157.132.144','2007-12-11 16:18:47',0),(3307,658,388,'8','la loca mundial jajaja\r\nes equis.. aveces se porta barca.. aveces no.. si se juntanna a estudiar les va bien.. si no.. ya se los cargo el payaso','NA','189.157.132.144','2007-11-26 02:53:05',0),(3308,48,584,'1','Ese wey que calificó anteriormente no lo bajen de servil, barbero y tarado. Así hay un chorro de estudiantes en la carrera , que no les sorprenda. Creen que adulando y diciendo Â¨buenos díasÂ¨a todo mundo van a llegar lejos.\r\n\r\nAl grano,  no la metan con ella. Tiene un genio de la chingada, si esta enojada se desquita contigo (actitud de niña de 15 años para una ruka de 50). Le preguntas algo que ella considera estupido, te hace sentir mal explicandotelo, ti