calificar pero si uno estudia bien, lo pasa.','NA','189.156.185.152','2007-12-11 16:18:47',0),(3416,319,247,'9','Excelente profesor. Sabe mucho del tema y por el hecho de ser Magistrado tiene muchos casos para explicar la clase, lo que puede hacerla más fácil y entretenida. Si no estudias derecho, si se te puede llegar a hacer muy dificil por los temas vistos en clase, pero si le preguntas acerca de algo, te responde sin problema y de manera clara. Los examenes son puros casos por lo que implica utilizar mucho la lógica. Lo bueno de esto es que no se tiene que estudiar mucho para los examenes, pero aún así son díficiles.','NA','189.156.185.152','2007-12-11 16:18:47',0),(3417,633,111,'7','La maestra es muy buena gente pero la clase a veces no tiene una buena estructura lo que dificulta hasta cierto punto entenderle y sobre todo estudiar. Aún así, leyendo del libro se hace buen papel en los examenes. Te responde las preguntas que necesites. Llevate muy bien con ella y se te puede facilitar el obtener una buena calificacion.','NA','189.156.185.152','2007-12-11 16:18:47',0),(3418,318,330,'4','Es un maestro super perro, durante las clases se la pasa hablando de cualquier cosa menos de los temas de las materías, sin duda sabe un buen del tema pero no lo sabe explicar bien, y los examenes suelen ser super perros y por lo general pregunta cosas que no has visto y de los problemas más difíciles del libro, si por accidente la metes con el la única manera de pasarla es hiendo a asesorias ya que ahí realmente ves problemas que pueden venir en los exámenes y si haces todos los ejercicios que deja hay una ligera posibilidad de que la pases además de estudiar mucho del libro, saludos.','NA','189.152.41.162','2007-12-11 16:18:47',0),(3419,262,144,'5','es conmadre el profe, pero no explica ni madres. la clase era de hora y media y solo explicaba 20 minutos y lo demas nos contaba su vida, se quejaba del tec, y mamadas fuera del tema. y la mitad del examen la explicaba una clase antes