s k leer lecturas largas a cada rato y hacer mapas conceptuales y una que otra vez hay comprobaciones, pero casi todo el semestre esos mapas conceptuales son como las comprobaciones y valen 5 puntos cada uno, asi k de verdad te tienes que esforzar en esos mapas para que te de los 5 puntos.\r\nNO HAY EXAMENES PARCIALES, son ensayos y presentaciones de las lecturas o de peliculas; hay examen final por que es departamental, pero esta bn facil.\r\n\r\nPortate bien con el y demuestra interes y ya la hiciste, yo termine kn 96 y no estuvo tan perro como lo pense al principio.','NA','201.172.33.110','2007-12-08 15:58:19',0),(3492,558,364,'4','La clase es muyyyy aburrida y tediosa porque habla y habla y habla y es muy tecnico todo, ademas escribe demasiado y llena el pizarron varias veces.\r\nEl profe si le hecha ganas para ensenar, pero nadamas no.\r\nLos examenes estan masomenos y los laboratorios k hay no te sirven de nada para la clase x k el profe da la misma clase que para los de ingenieria.\r\nEl examen final es departamental: 10 de teoria y 5 problemas, pero super perro.\r\n','NA','201.172.33.110','2007-12-08 16:01:16',0),(3493,529,203,'7','La maestra es super linda y buena onda, deja muchas tareas pero vale la pena hacerlas para poder entender bien el tema y saberle en el examen.\r\nLos examenes no estan tan dificiles, pero si muy largos.\r\nDa puntos extras x no faltar y tmb x tener el 100% de tareas, asi k entregalas x k cuentan como entregadas, no importa k no las respondas bien.\r\n\r\nEn clase explica casi siempre la tarea y deja un proyecto final medio largo pero vale 15 puntos y hay actividades colaborativas al final de cada tema.\r\n\r\nTodo bien, nadamas cuidate de k no la agarre contra ti, porque si no si puede ser bien bitch.','NA','201.172.33.110','2007-12-08 16:05:46',0),(3494,810,751,'9','Muy buen profesor, explica con ejemplos claros, tienes que prestar mucha atencion, APUNTA TODO lo que veas en clase, y pasaras, examenes faciles, solo NO copies , int