iles, pero si estudias las presentaciones pasas.','NA','189.157.115.168','2007-12-11 22:33:20',0),(3537,758,396,'7','Se ve que sabe, pero se confunde. Como que batalla para explicar porque no se entiende muy bien con los alumnos, pero le intenta. Los examenes no estan tan faciles, pero si vas a todas las asesorias es de a huevo que pasas el examen porque son los mismos problemas con diferentes datos. Para pasar/entenderle solo necesitas poner atencion en clases (que si esta medio canion porque si esta aburrida). Tambien encarga las tareas puestas en el \"calendario\" pero no las califica el, sino su becario, y vales madre si el becario es un alumno amargado. Si te faltan puntitos para pasar yo creo que si te los da si ve que te esforzaste. Pero si esta medio dificil pasar la materia con el, pero si aprendes.\r\n\r\nPD. lo que odie de los examenes fueron sus preguntas raras, de esas que te pregunta algo y te da muchos datos, y tu llevas una hoja de procedimiento y al final no tiene nada que ver con la pregunta y te quedas wtf?! y te confundes y te quedas todo inseguro  ','NA','189.157.115.168','2007-12-11 22:44:10',0),(3538,312,958,'10','Muy buena maestra, la clase muy amena y la verdad explica muy bien... antes de cada examen hace un repaso el cual la verdad si te saca de muchas dudas.  Aparte la maestra es buena onda y sabe tratar a los alumnos.\r\nrecomendada','NA','189.156.158.143','2007-12-11 23:45:37',0),(3539,584,561,'9','de los mejores profesores que he tenido!!\r\nla clase suuper divertida, actividades... si requiere echarle ganas y muchos trabajos en equipos, pero son trabajos que te divierteen, que si una cancion o una poesia haha, sus examenes no son dificiles!! son cosas obvias! y pone lo mismo que se ve en clase...\r\nlo recomiendo bastante!!','NA','189.156.32.182','2007-12-12 01:37:12',0),(3540,264,220,'9','Es buen muy buen profe, la materia en el primer parcial son cosas que ya has visto antes lo demas es nuevo pero no es dificil. A veces hay un poco 