7-12-13 23:27:18',0),(3606,61,898,'9','Es buena onda el profe, aunque su rol en el curso no es muy pesado dado que es mucho autoestudio y buscar cosas por ti mismo. Te trata de ayudar si se lo pides. Es el único que da la clase, así que no hay mucho que escoger :)','NA','','2007-12-13 23:40:52',0),(3607,340,1075,'10','A veces tiene horarios horribles, pero es el mejor maestro que he tenido desde siempre. NO es barco, NO está fácil el curso, pero bien que aprenderás y de buena manera. No esperes una gran califa si no le echas ganas, ya que de verdad será la q te mereces........','NA','','2007-12-13 23:42:36',0),(3608,395,702,'1','porfavor quitense la pena de llevarla kon esta maestra... la verdad no sirve para nada y es super grosera\r\nsi pasas pero tienes k caerle bien y si te hagarra de su pendejo ya valiste porq si es q pasas vas a pasar kon 70\r\n\"da\" puntos extraque despues te quita y si ontestas el examen con lapiz no te lo califica, aprate de que se la pasa humillandote frente al salon \r\nEVITENSE LA PENA','NA','','2007-12-13 23:43:05',0),(3609,98,716,'8','Opción perfecta para los industriales y el resto de los \"ingenieros\" mediocres. Te irá extremadamente bien........... pero no esperes aprender NADA. Suerte en tu próxima clase de matemáticas si llevaste una con este profe, ya que no tendrás conocimientos para resolver problemas avanzados (Ecuaciones Diferenciales, Mate III, Mate IV si llevas......)','NA','','2007-12-13 23:44:57',0),(3610,377,203,'10','Es de esos maestros que siempre te vas a acordar!! me la pase fregon en su clase es super justo... los primeros dos parciales te asusta reprobando a muchos y por eso dicen que no la metas con el pero al final es el maestro mas justo que he conocido si le sabes y te aseguro que aprendes te pasa y bien no 70..','NA','','2007-12-14 00:07:41',0),(3611,434,32,'6','La verdad es muy buena persona, es super chidda como personna, pero la verdad es que como maestra es espcial, va muy rapido en sus clases, si no llevaste calculadora financiera ... ya valiste, muchos reprueban el primer parcial... no hay duda que hay 100. Pero si quieres sufrir para pasar ... esta materia adelante, preparate por que antes de inicar clase pone examen de comprobación.  Esta dificil con ella... piensalo con otro profesor','look','','2007-12-14 01:36:37',0),(3612,389,527,'10','Una de mis maestras favoritas, si eres de los que te cuesta Ingles ya la hiciste... esta maestra es super accesible en tareas, en explicación, sus tareas son faciles, y si eres de los que no te cuesta Ingles ... seguro..90 de calificación. Esta maestra toma en cuenta todo, tareas, laboratorio, no son aburridas sus clases .. bueno depende que tal sea tu grupo en mi grupo todos platicabamos, la teacher hacia comentarios.. ella se presta conforme sea el grupo. Si tu grupo es un apatico, no esperes que la teacher haga maroma y teatro pues solo se enfocara a la clase. Metela con ella.','look','','2007-12-14 01:41:31',0),(3613,618,714,'9','Super buen maestro... Hay que poner atencion desde el principio si no no le vas a entender  más adelante, el explica todos los problemas, super accesible con las asesorias, examenes de que tieens que pensar, te enseña a usar la cacluladora financiera , cosa que no todos los maestros hacen. Lo recomiendo, aunque no me iba super bien en todos los parciales, ,pero fue porque no puse atencion al principio, al final si pase, si le echas ganas si pasas','NA','','2007-12-14 01:42:48',0),(3614,490,181,'9','NOmbre este profesor, es muy extremista... es super buen pedo, sacas el 90 por que lo sacas... pero luego se pone en un plan de que no explica bien, toma nota por muy bobo que sea el procedimiento por que luego no recuerdas como hacerlo en la computadora, y aunque tengas los apuntes de nada sirve. Pregunta por las preguntas rescate que te suben hasta 105 de calificación y te los pone para el sig parcial. Sales temprano de sus clases y toma en cuenta quien es tu equipo de trabajo pues de ahi depende tu 100.. me fue mal en el 3er parcial.. pero si scas el 90 FACIL y el institucional ni t preocupes que solo vale el 15% .... ','NA','','2007-12-14 01:47:15',0),(3615,377,868,'9','Es un maestro muy bueno... Medio duro a veces, pero explica bien.  Es de esos maestros que siempre te van a querer enseñar poca teoria y más práctica.  En realidad es la mejor opción para meter promoción de ventas para un merca...','NA','','2007-12-14 02:41:52',0),(3616,401,272,'10','primer parcial es bien aburrido, porque es pura teoría (PPTs), pero ya que empiezas a trabajar con el proyecto, el sql, te olvidas de diagramas... se vuelve muy interesante. Sabe un chorro, pero hay que preguntarle para sacárselo. Si vas a asesoría es muy buena onda, pero en el salón no tanto. Los exámenes están tranquilos si pusiste atención y te fijas, ya que algunos tienen trampitas... el final está regalado, puro multiple choice..... de califa te irá 2/3, ya que no hay puntos extras pero pues un 90 si la has d librar si le echas algo de ganas','NA','','2007-12-14 03:03:32',0),(3617,460,320,'10','Está tranquilo, pero también depende de que pongas atención en clase y participes. Si lo haces, tienes asegurados MUCHOS puntos extras. Si no, échale ganas para sacar lo más cercano a 100 porque no te dará ni un quinto aparte de lo que hayas sacado. Las acts. están medio sobres, pero no valen tanto. Puedes acabar con 100 aunque no saques 100 en los exámenes, muy bueno.','NA','','2007-12-14 03:16:21',0),(3618,422,934,'1','CON ELLA NO!!\r\nCON EL QUE SEAA CON ELLA NOO \r\nCERO LINDA EHHHH \r\n\r\n\r\n','NA','','2007-12-14 03:28:32',0),(3619,70,849,'7','La verdad es que como yo la meti a las 7am en semestre enero-mayo cuando hace frio en enero, febrero la clase se me hizo pesada, el profe tiene una voz de sacerdote...no dudes que te duermes, siento que es demasiada teoria para lo que realmente es la clase... pasas.. pero considero que hay mejores profes.','NA','','2007-12-14 03:40:52',0),(3620,621,203,'10','Buen profesor.. la verdad es que muchos se mantan buscando profesor de contabilidad administrativa.. pero este profesor es chiddo. La clase apesar que es marts de 6a 9... no es cierto.. te saca antes, se porta curva a la hora de los examenes, si le preguntas en el examen te da pistas, y el en 3er parcial... todos reprueban, pero el sube con puntos..  y en el Examen final es acumulativvo.. pero los ejercicios son tal cual de la clase.. y te da chasne de sacar formulario los 4 examenes. Metanla con él.  Minimo 80 sacas.','NA','','2007-12-14 03:46:13',0),(3621,438,11,'9','Este profe es super aivianado, la verdad es que es buena onda.. se pasa de buena onda, aunque en los examenes es algo confuso. Ya que sus examenes son en linea a la hora de clase ... asi que olvidate de examenes en equipo. Y son de cufusion multiple, con respecto a las tareas es super alivianado.. te pasa las tareas hasta una semana despues. Y te puedes quedar dormido en su clase y con leer las presentaciones de PWPoint ... ya la hiciste .. facil.. un 80 lo sacas por que lo sacaas... FACIL.. NO es un titanic... pero si... flotas....','NA','','2007-12-14 03:52:22',0),(3622,223,503,'10','Es un excelente profesor, sus examenes son fáciles si vas a clase y pones atención, es muy exigente a la hora de calificar ya que casi quiere que expongas todo el procedimiento casi como si tu le tuvieras que explicar la clase y eso te baja algunos puntos pero se aprende bastante.!','NA','','2007-12-14 03:58:02',0),(3623,355,851,'9','muy buen profesor, explica muy bien. En los examnes siempre pones preguntas para puntos extras que no estan tan dificiles. Le gusta que vayas a asesoria, es muy accesible, muy buen maestro.','NA','','2007-12-14 04:31:01',0),(3624,623,724,'5','Explica pesimo el profesor, ni el mismo se entiendo, lo unico bueno es que pone un examen tipo antes de cada parcial y pues viene casi igual. Es medio raro, se pone a platicar de astrologia y premios nobel. La verdad no la metan con el.','NA','','2007-12-14 04:39:44',0),(3625,716,320,'10','muy buena maestra, explica muy bien. Al momento de calificar lo hace muy bien tambien. No encarga muchas tareas mas las que tienes que hacer en linea, pero estas te ayudan mucho para el examen. Una gran maestra','NA','','2007-12-14 04:42:44',0),(3626,623,724,'3','Pesimo profesor no explica nada y no sigue el mismo temario que los demas profesores, aunq da algunos puntos extras cada parcial no vale la pena no aprendes nada.','NA','189.152.153.174','2007-12-14 05:05:05',0),(3627,605,724,'7','Los parciales son fáciles pero si te equivocas en algo te lo pone mal... el final es largoo pero puedes sacar el manual, el cuaderno, la calcu que quieras, menos lap... Las tareas las califica pero al final te pone el porcentaje completo de las tareas. ','NA','','2007-12-14 05:08:59',0),(3628,482,1114,'10','Aprendes muy bien y la clase esta super light los examenes estan nada dificiles metanla con el de las dos opciones es la mejor.','NA','189.152.153.174','2007-12-14 06:25:32',0),(3629,822,137,'8','es buen maestroo... derrepente encarga cosas que ni al caso, como aprenderte un parrafo gigante y cosas asi.. mientras le hagas caso, le demuestres interes por el chino y le heches ganas te va a ir bien.. se te vale la clase ya valistee...','NA','','2007-12-14 06:39:28',0),(3630,402,205,'10','Es excelente maestra!! explica muy muy bien y cuantas veces quieras, tienes que poner mucha atención y de preferencia conseguir las tareas porque eso ayuda mucho y siempre son las mismas, como deja tarea diario eso si es pesado pero si las copias y le vas entendiendo ya la hiciste, en el examen le puedes preguntar y te responde todo, no da puntos extras, si eres alguien que le interesa aprender y responsable metela con ella...tiene una voz muy chillona peor te acostumbras, aunque a algunas personas les cuesta trabajo concentrarse..muy buena maestra lindisima!','NA','','2007-12-14 06:53:48',0),(3631,825,957,'2','puff pesimo nunca hiba  clases te ponia a estudiar cosas que no eran del tema mas aparte de que es un hijo de la fregada','NA','189.166.76.156','2007-12-14 07:42:20',0),(3632,643,957,'1','LOS ISES NO SABEN UN CARAJO!  y eso ke no soy mekatroniko... este profesor es una poqueria explica pesimo es un machete total por tu cuenta del libro es prepotente y mamon! no sabe el concepto de respeto no te regala ni un punto, el problema es que muchas veces no tienes otra opcion mas que meterla con el, pero si puedes evitalo ya que en verdad no conviene si llegas 1 minuto tarde a la clase te pone falta y vaya que si reprueba por retardos','NA','189.166.76.156','2007-12-14 07:50:52',0),(3633,731,716,'7','ami esta maestra me dio mate 1 y mate 2 la verdad es que me caia bien y no era tan cabrona en mate I pero ya en mate II empezo a cambiar de actitud y se puso medio mamonsilla pero es buena maestra si eres a un wey que le gusta estudiar y no tienes ningun pedo con las mates no te preocupes pero si eres un wey que tira weba falta a clases y asi mejor pregunta por otra maestra porque hasta le caes mal si no vas a clases recomendacion mejor no la metas si te va a dar mate II, mate I si metela no ai pedo  ','NA','','2007-12-14 08:08:13',0),(3634,150,255,'4','pinche profe es una mierda de persona ami me cae bien pero es un ijo de la chingada como profesor se cree la verga y su clase es super aburrida s ela pasa hablando y nadie lo calla y siempre quiere que estes leyendo no lo recomiendo ','NA','','2007-12-14 08:15:14',0),(3635,296,88,'6','buen maestro, pero examenes MUUY dificiles.. muchos reprueban','NA','189.156.183.144','2007-12-14 08:50:58',0),(3636,512,207,'10','Mejor profesora de todas, explica super bien y a todo le entiendes con ella, es super buena onda y te ayuda en lo que quieras, nunca se pasa de la raya contigo y sus examenes son exactamente lo que ella te dice, si tienes la oportunidad metela con ella.','NA','12.20.13.55','2007-12-14 09:24:11',0),(3637,512,496,'10','es una excelente maestra, te pone varios ejemplos, te pone muchos ejercicios para que practikes, la verdad explica muy bien, y sus examenes son solo lo que ves en la clase, te dice q estudiar y de eso viene. La verdad la recomiendo.','NA','','2007-12-14 09:39:53',0),(3638,490,181,'10','Todo lo que explica anotalo, sus examenes son los ejercicios que hacemos en el salon y los que no terminas y te checa las tareas, y los ejercicios tienes para subir la tarea hasta el viernes a 11:59pm una tarea x semana, te pone preguntas de rescate en los examenes! es genial','NA','','2007-12-14 09:43:03',0),(3639,633,243,'8','La verdad es buena, pero habla mucho mucho mucho, con su libro pss si viene todo, pero si la llevas temprano da mucha flojera, y claro siempre tienen a sus consentidos y te das cuenta rapido. Tienes que participar en clase para que te ayude y sus examenes si son para que estudies si estudias lo contestas bien rapido sino mas o menos','NA','','2007-12-14 09:46:04',0),(3640,476,5,'9','La verdad te explica con muchos ejemplos, siempre esta hablando de ejemplos, todo lo de los slides es lo que viene en el examen, la verdad si tienes que estudiar para su examen, pero que vea que vas a asesorias y participa y te ayuda, alegale en sus examenes pero cuando estes con la respuesta a medias. Es muy bueno sii le entiendes ','NA','','2007-12-14 09:53:24',0),(3641,182,726,'8','La verdad es buena pero si le caes mal te contesta feo, les dice feo, si le caes bien aii es todo un amor contigo, ve a asesorias, y procura caerle bien, por lo visto todos los que le hicieron barba les fue bien, si haces tareas ya la hiciste!','NA','','2007-12-14 09:55:40',0),(3642,476,5,'7','Te explica la clase con muchos ejemplos lo malo es que para su examen tienes que estudiar mucho y estan dificiles, si se m hizo medio dificil la materia pero quien sabe como termine con 90 final! si estudias mucho si t va bien..','NA','','2007-12-14 10:03:01',0),(3643,570,726,'3','No la metan con el...en la clase se la pasa haciendo chistes pero la verdad derepente super groseroo...yo ya no aguantaba la clase, segun el super barco pero ni al casoo...mal mal mal...','NA','','2007-12-14 10:08:45',0),(3644,633,243,'6','La verdad no me gusto nada la clase esta super aburrida, la miss si sabe mucho de derecho pero no sabe como dar bien la clsae, cero amena, los examenes algo dificil y si devolada se sabe quienes son sus favoritos.','NA','','2007-12-14 10:14:09',0),(3645,72,1031,'10','','NA','200.66.19.252','2007-12-14 10:29:54',0),(3646,178,130,'10','Muy buena maestra, aunque tienes que hecharrlee un chorro de ganass!!','NA','','2007-12-14 10:43:21',0),(3647,415,713,'10','El profesor no es solo a todo dar y siempre de buen humor, sino que aparte explica muy rápido y muy bien. Las clases eran martes y jueves y duraban 1 hora (a veces más, la mayoría de las veces 50 minutos), pero porque explicaba claro: todos los temas me quedaron bien claros. Llegaba, explicaba y si alguien tenía dudas las respondía una y otra vez hasta que todos entendieran. Da asesorías y las da con todo el gusto.','NA','','2007-12-14 10:51:55',0),(3648,760,108,'9','La recomiendo en un 90%...mis razones son...explica bien, siempre vemos problemas en clase y la teoría porlo general la omite, siempre contesta ella los problemas y a veces los pone en parejas...siempre sube a Bb las soluciones de los ejercicios y las tareas y la vdd te ayudan un chingo...sus tareas no son tan fáciles y si te llevan tiempo...yo falté con varias...sus parciales están muy fáciles...pero awas con el final!!...así ke es mejor ke le echen ganas a los parciales para no tener presión en el final...pero por lo general pasan muchos...de mi gpo dejó solo a 3','NA','','2007-12-14 11:10:39',0),(3649,822,137,'7','Que dire de Yu Miao....es muy raro! Se enoja mucho en clase pk somso mexicanos chiflados con dinero, segun él, enseña bien el problema es que Chino cuesta MUCHO ESFUERZO.  No tienen de otra mas que meterla con el....pero antes de meterse tengan en cuenta que es algo de todos los dias practicar por tu cuenta si no no pasas....','NA','207.248.45.1','2007-12-14 11:18:20',0),(3650,587,726,'10','bueniisimooo profeee \r\nlo amooo\r\nsuperr divertidoo, buena ondaa me meteree con el en mate para inge 1 y si se puedee tmb en el 2 :D\r\n','NA','','2007-12-14 11:31:28',0),(3651,809,122,'2','Si te gusta la biología, NO metas clase con ella. Es una decepción de maestra, no conoce bien los términos que explica y por lo tanto confunde a todo el salón al momento de explicar. No abarca todos los temas del programa. La mitad de las clases te las darán tus compañeros porque ella no lleva nada preparado, entonces pasa a los grupos a \"exponer\". Y para empeorar la situación en sus exámenes pregunta cosas demasiado específicas que no tienen relevancia, es decir espera que te machetees todo. ','NA','','2007-12-14 12:21:36',0),(3652,728,422,'10','He tenido a muchas maestras de francés pero ninguna como Marie. En verdad se preocupa porque entiendas lo que ves en clase. No tienes que estudiar mucho para sus exámenes porque estan bien hechos y abarcan únicamente lo que viste a profundiad en el salón. Es una excelente persona y su método de enseñanza es muy bueno. No habla casi nada de español durante clases para acostumbrar a tu oído a escuchar puro frances, pero no se preocupen se le entiende todo. Probablemente es la mejor maestra de francés del Tec, tienen que meter lo que puedan con ella. ','NA','','2007-12-14 12:27:05',0),(3653,353,751,'8','La verdad el profe es buena onda y la mayoria de las veces es flexible, solo has las cosas como te las pide y te va bien. En los trabajos colaborativos se fija muchisimo en ortografia y la bibliografia.','NA','189.156.215.44','2007-12-14 12:32:19',0),(3654,618,205,'7','es muy serio pero explica super bien, sus examenes son muuy dificiles siempre tienen trampas o cosas asi, pero si pones atencion en clase y haces las tareas no te va taaan mal.','NA','189.156.215.44','2007-12-14 12:37:37',0),(3655,270,244,'4','Nooo la metan con el...sus examenes 