o aprendieron en Sociología? Justamente esa clase es para abrise la mente... Claro que hay muchos LCC cabezahueca... Pero no todos somos así. Cuidado con comentarios ofensivos... Que si a esas vamos, si les contara cada patético LRI y LMI y hasta Politólogo que me he encontrado... Les daría MIEDO. Pero también he encontrado a personas muy maduras e inteligentes en esas carreras. =) Así que... No GENERALICEN (Si llevaron Filosofía alguna vez en su vida sabrán que eso es una FALACIA) Cuídense, y la MEJOR MAESTRA DE SOCIOLOGÍA. Una Snoopy... =)','NA','189.160.95.12','2007-12-14 14:05:43',0),(3663,580,722,'2','no es cierto q es buena onda con las mujeres! es un pervertido y asi. A mi me gusta mate y el en verdad me hizo odiarla, me chocaba ir a su clase porque ademas te confunde todo. Pesima opcion.','NA','201.172.11.116','2007-12-14 21:45:09',0),(3664,570,726,'3','lo odioooooo es lo peor muy chistoso en la clase y no toma lista pero te la mete bien rico en ls parciales y no ayuda en nada pesimo no aprendi nada y ahora la tengo que cursar otra vez','NA','','2007-12-14 22:30:54',0),(3665,814,1040,'10','Buen maestro\r\nSi no sabes dibujar, te da todas las bases para que aprendas. Si sabes dibujar sales de su clase dibujando y haceiendo sketches mucho mejores. Califica tu esfuerzo y es buen rollo. ','NA','','2007-12-14 22:37:09',0),(3666,587,726,'10','lo amo vas a asesoria y e dice que viene en el examen su per flexible te puedes copiar y sacar formilario con lo que kieras ','NA','','2007-12-14 22:50:10',0),(3667,739,385,'10','Exelente maestra, y sobetodo excelente persona. Pasas por que pasas, no haces nada. Mil puntos extras. METANLA CON ELLA.','NA','','2007-12-14 22:51:51',0),(3668,191,361,'4','awas!!!!...io cometí el error de meterla en no disponibl y para mi buena suerte me toco el kerido y bastante conocido koyak...si eres ime o ima aprendes bastante...pero un iq como yo no debería tener la molestia si quiera de estar en una clase de éste profe...sabe chingos! es una eminencia y mis respetos para el profe...pero es perrísimo!!...no puedes bostezar...no estirarte...no platicas...no risas...no celulares y la clase dura lo ke debe de durar porque segun él el tiempo se va...habla muy rebuscado y ni pensar en corregirlo...sus exámenes no son perros...son imposibles y el examen final está que ni se diga...si ya cometieron el error pues solo preocupense por ir a asesoría como 2 veces por semana...llevarle las tareas...que vea interés y hacer un buen proyecto final y pasas...pero la clase es muy tediosa y si la llevas en la mañana mucho peor!!','NA','','2007-12-14 22:52:18',0),(3669,78,175,'10','super bena maestra la clase muy entretenida explica con presentaciones de power point y las sube a blackboard para que estudies SIEMPRE toma asistencia pero puedes negociar con ella para que te quite faltas los examanes son faciles','NA','','2007-12-14 23:06:34',0),(3670,342,723,'10','Uno de los mejores profesores de matemáticas, muy traqnuilo , buena onda, examenes normales, tareas las cuenta como entregadas, no toma lista pero si se da cuenta si vas o no.Explica muy bien, si te ve que le hechas ganas si te pasa. No dudes en meterla con el!!!, excelente profesor!','NA','','2007-12-14 23:12:56',0),(3671,206,244,'6','El maestro es muy chistoso, sin embrago es muy intransigente en las calificaciones, se le pierden los examenes y los ejercios en clase, los parciales estan complicados, si no llevas acordeon de ley no los contestas. Si copias bien te va bien en los parciales, pero la verdad dudaria en meterla con el, si se batalla por que ya esta muy viejito.','NA','','2007-12-14 23:16:28',0),(3672,6,1050,'10','Excelente maestra y presona, 100% recomendable!','NA','','2007-12-14 23:20:11',0),(3673,528,446,'10','es buenisima maestra!! la vdd se saca de onda kañonsisimo sus comentarios de que es mala....!!.. me saque 91 final en su materia!!... kalifica super bien... te explica y te resuleve toodas las dudas que tengas!!.. te da chance de entrgarle las laminas el mismo dia pero komo 5 horas despues..!!\r\n\r\na mi se me hizo excelente maestra!!','NA','','2007-12-14 23:51:21',0),(3674,802,396,'8','Buen maestro, explica bien y en clase hace problemas mucho mas complicados a los de los examenes entonces los problemas del examen se te hacen mas sencillos. pero en los examenes siempre viene un problema (en total son 4) que seguramente vas a batallar para hacerlo.','NA','','2007-12-14 23:54:33',0),(3675,253,722,'10','Muy buena maestra, sus examenes estan regalados','NA','','2007-12-14 23:56:47',0),(3676,687,1050,'10','A toda madre, parece una perra de lo peor pero para nada solo has bien los ensayos y te va conmadre','NA','','2007-12-15 00:02:29',0),(3677,605,724,'6','la verdad este maestro piensa que lo sabes todo, casi creo k nadamas pone un ejemplo de cada tema, y si le pides que ponga mas ejemplos te dice que no, porque luego los que si saben se aburren.\r\nA pesar de eso, se porta chido al final, trata de ayudar a los mas que puede dandole puntos para que puedan pasar, las tareas te dice que mientras te vaya bien podria olvidarse de ellas al final y ponerte los puntos aunque no hayas entregado todas. entonces, lo mas seguro es que pues si puedas pasar, pero no es de mis maestros preferidos, noa prendi mucho','NA','','2007-12-15 00:04:02',0),(3678,259,496,'1','horrible lo odio los q le pusieron 10 son ñoños q se la pasan matandose estudiando','NA','','2007-12-15 00:06:13',0),(3679,253,715,'10','Super fácil la clase, has todas tus tareas, porque si no eres bueno con mates, no pasas si no las haces, da puntos extras, y la clase es bien relajada, la verdad si se vuelve a abrir una clase con ella la meto de nuevo.','NA','189.133.109.101','2007-12-15 00:13:38',0),(3680,287,934,'8','Buena persona, no califica las tareas, solo cuentan como entregada. Los examenes no estan difíciles, si el grupo anda bajo ayuda. Lo malo es que no es muy buena explicando, por lo tanto el saber química dependerá también de tí porque sino te