asas, si encarga bastante tarea pero te ayuda para entender mejor, y si es un poco apresurada pero nada fuera de lo esperado.','NA','189.156.161.74','2007-12-15 05:20:43',0),(3697,11,313,'9','muy buen profesor, explica muy bien, los examenes no están difíciles pero sí tienes que haberlo dado aunque sea una leída al libro, siempre pone una parte de falso o verdadero con justificación, y una parte práctica que es lo más fácil, siempre hace curvas, lo máximo que me tocó fue que hiciera curva de 15 puntos, da buenas asesorías y deja pocas tareas pero fáciles.','NA','189.174.108.40','2007-12-15 05:20:56',0),(3698,706,667,'9','Excelente profesor. Explica muy bien y es muy competente. No le pongo el diez solo porque me trajo en friega todo el semestre con trabajos semanales y los examenes estan muy dificiles. Pero la clase esta muy interesante. Recomendado!','nofs','','2007-12-15 06:10:20',0),(3699,387,264,'8','Este profe es muy flexible y agradable. La clase no es dificl y el proyecto final esta leve pues lo haces a lo largo de todo el semestre. Muy recomendado!','NS','','2007-12-15 06:12:25',0),(3702,560,957,'9','Excelente Profesor. Muy recomendado!','NA','','2007-12-15 06:34:52',547275603),(3703,178,949,'10','La doctora es la ama de la química orgánica la verdad creo que es la mejor opción en orgánica II aqprendes mucho, la clase es amena y aprendes mucho de compuestos relacionados con la química orgánica, pero sufres bastante la verdad y tienes que hacer muy bien sus tareas y trabajos y estudiar mucho y al final vas a ver como pasas con mas o menos buena calificación (tampoco esperes un 100)','NA','207.248.42.2','2007-12-15 08:07:30',0),(3704,676,404,'10','La mejor opción para fenomenos, sus examenes son muy perros, pero explica muy bien, la clase es en ingles pero aunque fuera en chino le entenderias y siempre esta disponible en asesoria, eso si no pasa a nadie y el proyecto esta pesado pero es sin duda alguna el mejor profesor del departamento','NA','207.248.42.2','2007-12-15 08:12:52',0),(3705,548,1106,'10','Este señor es la neta en esta materia aprendes mucho, los examenes son algo dificiles y casi siempre te falta tiempo, pero creanme que vale la pena, te enseña bastante y aprendes el porque estas en ingenieria, te da muchos consejos que te son útiles despues, la mejor opcion.','NA','207.248.42.2','2007-12-15 08:15:23',0),(3706,269,372,'4','La verdad un maestro muy malo, sus clases se hacen eternas porque estan muy aburridas, se la pasa hable y hable en lenguaje matemático y no vez nada práctico y todo es filminas.\r\n\r\nTe va a ir bien pero vas a terminar bien harto y aburrido, es puro autoestudio.','NA','207.248.42.2','2007-12-15 08:18:14',0),(3707,420,396,'3','Baaaarquisimo. Tanto que te hace un mal. Recomendado solo si no te interesa Fisica en lo mas mínimo.','NA','','2007-12-16 05:16:26',823657681),(3708,566,402,'8','Está bien agusto llevarla con ella, llega tarde, explica lo que viene en el examen (porque es departamental), y si haces todas las tareas bein y los quizzes ya pasaste! además en el final te ayuda bastante para levantar la calificación!','=)','','2007-12-16 05:19:45',0),(3709,35,726,'7','Es una pereza llevarla con este tipo, deja demasiada tarea, te explica como niño de kinder, y las clases son bien lentas y pasivas, lo único bueno es que no ve tantas cosas como otros maestros y se limita a lo básico.','=)','','2007-12-16 05:23:33',0),(3710,35,716,'5','No es buen profesor, ni siquiera parece disfrutar dar clases. Como persona no es malo, pero como profesor de verdad no la hace. Mate II es de las mas importantes y con el no se aprende muy bien que digamos, hay otros profes que son mejores: Treviño, Salinas, Sierra, Segura...\r\nNo lo recomiendo.','NA','189.157.121.227','2007-12-16 06:44:10',0),(3711,657,724,'10','Es una de las mejores profesoras que me han dado clase en el tec. Explica bien, se entiende, va a un ritmo regular (osea que si eres flojo igual te va a ir mal). Las tareas estan al nivel y los examenes, en lo personal se me hicieron bastante sencillos, no viene nada que no te esperes, con que estudies todos los temas y los entiendas ya la hiciste. Es accesible en asesorias y aunque la raza se la pasaba hablando durante la clase, nunca se enojo ni nada, a veces hasta podias comer en su clase. Realmente es una de las mejores opciones para cualquier mate y para ecuaciones. Super recomendada.','NA','189.157.121.227','2007-12-16 06:50:38',0),(3712,522,361,'9','Tratare de ser objetivo:\r\nEs muy buena persona, su tan mencionado \"mal caracter\" casi siempre es puro reba. Realmente es dificil caerle mal, si eres prepotente y malintencionado le caerias mal a cualquier profe, ella es igual.\r\nComo profesora es chistosa, porque es como si tuvieras a una amiga explicandote Estatica, lo cual para los que estudian por su cuenta y hacen ejercicios, las tareas (sin usar PDF) y leen el libro, pues es con ganas, no se vuelve tedioso nunca ni te hartas de la materia y hasta la disfrutas.\r\nPara los que no estudian se vuelve un martirio porque en los examenes la sufren.\r\nOjo, su metodo para Vigas (fuerzas internas) no siempre funciona, haganlo como en el libro, o vayan con alguno que la lleve con un revolucionario, ese metodo jala mejor.\r\n\r\nP.S. Si esta guapisima la maestra.','NA','189.157.121.227','2007-12-16 06:59:53',0),(3713,833,1050,'10','Muy buena maestra, facil sacas arriba de 90 en los 3 parciales y tambien en el final, se lleva muy tranquila la clase y da muchos puntos extra, la recomiendo bastante.','NA','','2007-12-16 07:05:27',876870710),(3714,605,320,'9','Es bueno, sabe muchisimo, pero creo que o sabe tanto que no puede explicarlo, o sabe tanto y quiere simplificar para que todos entiendan que al final, por una o por otra la clase esta medio confusa. Al principio no entendia nada y su voz me aburria, pero ya para mitad del primer parcial le agarre la onda y todo bien. Examenes sencillos, algo largos pero faciles, no te exige las tareas, y al final da puntos que te puedes ganar y que te ayudan bastante. El final no fue departamental, asi que eso lo fue un aliviane. Un profe solo para quienes mate se les da, si no, metan con otro que explique mas detallado.','NA','189.157.121.227','2007-12-16 07:09:36',0),(3715,162,268,'10','BAR-CA-ZO','NA','189.157.121.227','2007-12-16 07:15:59',0),(3716,162,268,'10','Es como pasarte una hora libre de oyente en alguna clase que no te importa.\r\nDe hecho en una parte del semestre, eso de hora libre es literal, no tienes que ir mas que cuando te cita.\r\nEl curso esta facil de por si, y el profe lo hace tan facil que es como no ir, un 90 seguro ya si le trabajas tantillo 100','NA','189.157.121.227','2007-12-16 07:17:44',0),(3717,530,678,'10','Si estas llevando la clase como optativa o topico algo te ha de gustar la literatura, si la tienes que llevar, es tu mejor forma de gastarte el curso. Su clase es muy interesante, los libros los lees rapido, los examenes de lectura regalados, los parciales... bueno, escribes un chorro eso si, pero si tus ideas son coherentes ya la hiciste, si escribes puras estupideces te va mal. En gral. esta facil el curso y ademas interesante. Buena onda como persona y pues sabe tanto que necesitas llevarla con ella por todo: buena onda, buena clase, buena nota final.','NA','189.157.121.227','2007-12-16 07:21:23',0),(3718,484,5,'8','es muy buena personaaa, pero meterla con ella es arriesgarte, si lo que quieres es aprender enserio metela con ella nadamas que la buena calificacion no sera garantia, te entretienes en su clase, nunca toma lista','NA','','2007-12-16 13:10:59',0),(3719,401,272,'10','Excelente maestra y muy buena persona. Sabe muchísimo y explica muy bien, definitivamente aprendí demasiado. ','NA','','2007-12-16 13:14:30',0),(3720,560,957,'3','si eres naco o geek pasas, y no por conocimiento sino porque se identifica contigo...\r\nsi no entras en esa categoria ni la metas kn el, pk nadamas por eso ia le caes mal...\r\n\r\nno lo recomiendo, es el mas injusto y las guias de nada sirven','NA','','2007-12-16 13:18:46',100902779),(3721,173,313,'5','da muchos puntos extra...\r\npero su voz es tan aburrida que es dificil poder poner atencion o no dormirte','NA','','2007-12-16 13:20:35',100902779),(3722,298,435,'10','lo mejor, yo aprendi a programar con jakeline','NA','','2007-12-16 13:21:16',100902779),(3723,298,435,'10','Excelente maestra, muy linda y explica de manera que le entiendas, a veces si con peras y manzanas.. pero si no fuera por ella no sabría programar.','NA','','2007-12-16 13:21:31',0),(3724,415,866,'10','Muy buen profesor, buenisima onda pero nada barco, lo que si es que e explica hasta que entiendes, pero si pone un nivel muy alto.','NA','','2007-12-16 13:23:30',0),(3725,13,716,'1','LO PEOR!!, la odie, lo odio, y la seguire odiando, punto!! el final esta perrisisisisisisismo. Hace enemigos, super facil, tienes que ganartela no se como, pero lo tienes que hacer, si pudiera regresar el timepo, EN MI VIDA hubiera metido clase con ella','NA','','2007-12-16 15:02:02',0),(3726,13,727,'5','no no no!!!!es suuuuuper mamona.. la odioooo...\r\nsi explica, pero solo a sus consentidos, y no sabe dar asesorias\r\nsiempre esta coketeando...','NA','','2007-12-17 00:27:27',0),(3727,531,1050,'10','100% recomendable, nunca haces nada, siempre te la pasas platicando de cualquier cosa, eso si, los ensayos si son importantes pero es tan barco q si no pudiste terminarlo a tiempo siempre te da chance para entregarlo un dia despues. 0 stress en esa clase','NA','','2007-12-17 02:11:12',0),(3728,827,385,'10','Yo meti clase con ella pero solo fue como unas tres veces a la clase en todo el semestre, por que otra maestra daba las clases por lo regular que tambien es mui buena onda Ma. Auxiliar. Los examenes son faciles, solo qeu tienes que hacer als tareas para tener un buenprmedio pero son super faciles de hacer. ','NA','','2007-12-17 02:17:53',0),(3729,533,496,'9','Esta x su clase, pero si vas a las asesorias mejor, siempre explica mucho mejor en las asesorias, hay 4to parcial por si vas mal y te quita el parcial mas bajo, siempre deja un trabajito para el examen q vale 10 pts y muchas veces puedes sacar apuntes','NA','','2007-12-17 02:18:33',0),(3730,536,726,'9','Buena maestra, es algo aburrida su clase pero porque repite el tema cuantas veces quieran para q lo entiendan bien, siempre da puntos extras y al final muchos tienen 110 de calificacion final. Pero tienes que hacer las tareas xq valen bastante y siempre te da las respuestas de las tareas asi q pss esta facil','NA','','2007-12-17 02:21:53',0),(3731,377,207,'6','No es un mal maestro pero tampoco es de lo mejor. La clase en si es dificil y durante el semestre no te ayuda mucho para subir tu calificacion, solamente al final si es que se siente con animos. Su manera de dar la clase no me agrado del todo ya que en mi caso eramos aprox. 100 alumnos de los cales para 4 parcial ya solo quedaban 50 alumnos. Su personalidad es algo sinica o asi, se la pasa hechando a todas las demas carreras que no sean contadores, aunqeu segun el lo hace jugando pero se lo pasa haciendo durante todo el semestre. Si no le entiendes y tienes dudas y vas y le preguntas algo cree que la pregunta es estupida o ilogica y en vez de simplemente contestartela y quitarte la duda te deja con aun mas confusion. ','NA','','2007-12-17 02:24:34',0),(3732,396,5,'8','Lo unico q tienes q hacer para pasar es aprenderte las slides, la clase es aburrida pero si esta facil, y si hay mucho trabajo en equipo','NA','','2007-12-17 02:25:01',0),(3733,618,714,'5','Si explica bien y todo en clase, da muchos ejemplos. Pero los examenes son de los peor, cero qeu ver con lo que viste en clase, por lo que te va mal en los parciales. ','NA','','2007-12-17 02:26:27',0),(3734,704,244,'9','Su clase es tirandole a spanglish, no hay tareas ni final, termina siendo 4to parcial q en realidad solo cubre lo q ves en 2 clases. Con q t aprendas las slides ya la hiciste, es lo unico q necesitas para pasar. Nunca toma lista, durante el semestre falta unas 6 veces minimo asi q es 100% recomendable','NA','','2007-12-17 02:29:06',0),(3735,245,849,'6','Muy aburrida la clase. Solo habla y habla y habla. Yo que la lleve a las 7 de la mañana, es pero super aburrido, ademas que por cualkier ruidito que se haga en el salon, ya esta callando a todos. Los examenes son de opcion multiple pero tienen su chistesito. Siempre toma lista, todos los dias y el nunca llega tarde ni falta a clase. No lo recomiendo mucho.','NA','','2007-12-17 02:32:15',0),(3736,476,86,'8','El truco es aprenderse las slides, aunque diga q no es de memoria, q es mas de analizar no le creas, si te dice q es de los papers, siempre el examen termina siendo de las slides. En las revisiones siempre le logras sacar unos 3 pts, ','NA','','2007-12-17 02:33:28',0),(3737,27,205,'8','A pesar d q es el director d carrera no esta tan dificil, siempre resuelve los ejercicos en su lap y despues te los manda, deja tarea 2 veces x semana pero solo cuenta como entregado. Siempre puedes ir a asesorias y te explica muy bien, el trabajo final lo deja con poco tiempo pero como es en parejas no hay tanto problema','NA','','2007-12-17 02:40:43',0),(3738,618,205,'7','Sabe mucho, pero es aburrido y no sabe explicar. Sus examenes tienen trampas por todos lados, si te pones a estudiar y realmente le echas ganas no te va TAN mal, pero de preferencia no la metan con él.','NA','','2007-12-17 04:15:03',0),(3739,48,1080,'8','es muy buena explicando pero tiene un caracter q uff! te amarga el día si anda de mal humor, además te explica como si tuvieras retraso mental, está bien porque sí aprendes pero te sientes denigrado en verdad...','NA','','2007-12-17 05:58:08',0),(3740,643,957,'1','PESIMO. Va rapidisimo y ve de mas. Casi vimos redes 2 completamente. Incluso vimos cosas que ni al caso como blutooth y telefonia celular. Ademas de que estan dificiles los examenes es muy perro para calificar. No le ganas siempre cree tener la razon. Se dice que su cuota de reprobados anda en el 40%. A mi me dejo con 69 final. Aya ustedes.','NA','','2007-12-17 06:33:31',547275603),(3741,474,205,'10','Super buena maestra, explica muy bien. Los examenes no estan tan faciles y por lo general te hace pensar y te pone trucos pero nada imposible. Hay muchas tareas que se deben de hacer. Aunque no es necesario hacerlas bien sirven para entender bien los temas. 100% recomendable y la volvería a meter con ella sin duda.','NA','','2007-12-17 07:09:02',651335472),(3742,401,272,'8','Buena maestra, se ve que sabe mucho del tema. El unico problema es que es muy seria, muy seca y a veces no te hace caso. Es un poco inflexible con la entrega de tareas y los examenes son muy largos excepto el final. Es necesario estudiar y hacer las tareas para salir bien.','NA','','2007-12-17 07:14:40',651335472),(3743,397,392,'7','Es una maestra muy agradable y se ve que sabe mucho de redacción y ortografía. Sin embargo, es un poco inflexible y exigente en lo que se refiere a los trabajos escritos y orales. Baja muchos puntos por errorcitos como comas y palabras repetidas (No puedes repetir la misma palabra en casi todo el texto).','NA','','2007-12-17 07:21:26',651335472),(3744,30,813,'9','Su clase es muy aburrida debido al tono de voz que utiliza, lo que hace que no le pongas mucha atención. Se supone que la clase es en ingles pero el da la mitad en ingles y la mitad en español. Los examenes si estan en ingles y no estan nada dificilies si estudias y le entiendes bien, además son muy cortos.','NA','','2007-12-17 07:26:05',651335472),(3745,625,726,'8','Pues yo saque 100, pero pues por que soy mujer...! el profe me adoraba y pues creo que por eso saque esa calificacion! pero...preguntame..aprendi algo? NADA! al menos para esta materia el profe si es bueno pero NUNCA da la clase! super barco ! si no quieres aprender nada, eres mujer y quieres salir super bien! metela con el y procura llevarte con madre con el ! 100 seguro casi !! ','NA','','2007-12-17 07:57:12',860050284),(3746,167,313,'8','Me reprobo con 68 !!!!!!!!!!!!! ok, se que este profe es buena onda y pues si es buena onda y buenisimo en lo que hace! perooo NOO PARA INGENIEROS!! osea noo! no la metan con eeel ! esta materia no es para ingenieros, es para nerdos que les interesa la economia aunque sean ingenieros, la neta le dedique demasiado tiempo, mas que a fisica, mate, etc....materias que si son para mi carrera, y pues no vale la pena perder tanto tiempo, estresarte tanto y estar estudiando dia y noche para esta materia! y aun asi reprobar! el profe para empezar te pone 5 examenes en el semestre! y dices, bueno pues igual y esta mas facil asi, pero NOO! son los examenes mas pesados y confusos que he presentado en mi vida! ','NA','','2007-12-17 07:59:54',860050284),(3747,499,179,'5','Esta maestra sabe lo que cualquier persona sabe de computadoras, no sabe explicar! no creo que sepa mucho del tema! y su clase es super aburrida! lo unico bueno es que puedes llevar la lap y te la pasas haciendo otra cosa menos poniendole atencion! no estan nada dificil sus examenes, pero tampoco super faciles y no t puedes copiar mucho por que te lleva a un salon de computadoras super separadas para los examenes y nomas no !','NA','','2007-12-17 08:02:50',860050284),(3748,252,53,'6','Ok, A.M.A.R.G.A.D.A Eso es lo que es esta miss! osea para empezar super amargada y super presumidaaaa! se la pasa todas las clases platicandote de sus viajes a nueva york! y de sus proyectos de vida y de sus hijos y no se que! la verdad no esta facil, tampoco dificil pero si es medio exigente! no puedes refutarle nada porq ya te fregaste! si le caes mal olvidate de que te pone buena calificacion! y si le caes bien!! ufffff !! 100 seguroo!!','NA','','2007-12-17 08:05:54',860050284),(3749,569,722,'10','Super miss! nombreee !!! que barbara! super linda y super maestra! super abierta siempre a asesorias y explica super bien! ni muy lento ni muy rapido! simplemente perfecto! sales muy bien y aprendes muchisimo! te encarga tareas pero estan faciles y te sirven un chorro para los examenes! super recomendable!','NA','','2007-12-17 08:09:41',860050284),(3750,5,396,'1','Es lo peoorrr! clasees super aburridas y no aprendes nada!!! super barco y consigues sus examenes! pero aun asi ! no no no lo recomiendo!','NA','','2007-12-17 08:10:52',860050284),(3751,686,179,'9','ok con respecto a las calificaciones que le dieron, por ejemplo el que le dio 1, ok lo acepto, por que todo lo que dice ahi es cierto, encarga tareas y trabajos finales super super dificiles y pues si esta super dificil pero es mas que nada la materia, no tanto que la miss sea perra, creo que es buena en su metodo de enseñanza aunque yo reprobe pero por que la verdad la materia no se me dio, y pues para los que le ponen 10 tmb estoy de acuerdo por que pues se me hace buena maestra y que se esfuerza mucho por que sus alumnos aprendan, aunque eso de las asesorias si es cierto no atiende muy bien por que siempre hay gente.','NA','','2007-12-17 08:15:27',860050284),(3752,621,397,'2','El profeee es malisimo! no sabe explicar! no sabe nada! le da rodeos a lo mismo y se equivoca cuanod esta explicando!!! no la metan con el! puedes salir mas o menos bien por que es facil copiar! pero no aprendes nada!','NA','','2007-12-17 08:20:04',860050284),(3753,13,723,'10','la verdad a mi me gusto muchisimo por que no esta nada dificil con ella y aprendes un chorro, sabe explicar muy bien y es super buena onda y super linda!','NA','','2007-12-17 08:21:01',860050284),(3754,224,398,'1','NO NO NO NO Y NO ! Me acaba de reprobar con 68! El profe es de lo peor, sinceramente, osea si sabe muchisimo pero no esta hecho para ser profe osea explica demasiado rapido como si supieras todo lo que el sabe y suponiendo que sabes todo, la verdad no lo recomiendo para nada, falta facil 3 veces al mes y siempre que llega llega de ley 20 minutos antes te da un capitulo del libro de fisica en 1 clase imaginate, la verdad no lo recomiendo p