uchos reprobados.... \r\nsi pones atencion en todas las clases y tratas de hacer la mayoria de las tareas ya la hiciste...es muy accesible y te ayuda si puede y ve que le hechas ganas...ademas en los examenes puedes copiar super facil :)  y si le preguntas te ayuda mucho','NA','','2007-12-17 11:59:27',687260433),(3766,473,496,'1','super mala maestra, no sabe explicar para nada y aparte quiere abarcar muchos temas en cada examen. Si vas a asesorias ni te explica ni te quita las dudas, para nada la recomiendo','NA','','2007-12-17 13:18:15',0),(3767,838,736,'8','buen pedo pero truena gente le vale madre si demuestras que sabes en la revision final te da unos cuantos puntos los parciales se parecen a los de semestres pasados ','erick plata ','','2007-12-17 13:22:03',0),(3768,259,496,'8','Es un buen maestro pero tienes que poner mucha atención, conforme va pasando el semestre se va poniendo más perro y es cierto eso de que si tienes un errorcito te lo pone todo mal, pero si aprendes mucho con él.','NA','','2007-12-18 01:56:30',654032241),(3769,289,932,'8','Pues sabe mucho Inglés, pero es medio amargosita, no hables en español ni traigas chicle en su clase, y si puedes participa. Si le caes bien, te la llevas super leve.','NA','','2007-12-18 02:01:22',654032241),(3770,108,521,'9','Es buena maestra gringa, deja casi todos los días tareas fáciles que te las puedes copiar antes que empieze la clase y los fines no deja. Es agradable pero a veces te da sueño y si te duermes no hay problema. ','NA','','2007-12-18 03:55:39',0),(3771,230,398,'1','ES EL PEOR PROFE DE FISICA!!!!!!','NA','','2007-12-18 11:36:20',0),(3772,788,385,'9','super buen  maestro, si aprendes con el y es super alivianado, sus examenes son de analizar situaciones y no encarga muchos trabajos y claro q califica super barco, pero he escuchado q hay maestros de eticaa q son muucho mas barcos q el','NA','','2007-12-18 11:38:18',0),(3773,771,432,'10','la mejor maestra que he tenido! sin duda! le importa que entiendan el material mas que cubrir todo el plan de estudios... usa mucho powerpoint recomiendo no tomar nota durante la clase y poner atencion a lo que dice acabo pone los powerpoints en black board.. muy buena onda y se lleva muy bien con todos!','NA','','2007-12-18 14:58:00',0),(3774,51,724,'10','La verdad super buen maestro, explica todo super bien y t quedan todos los conceptos muy claros, reprueban pocos pero como le entiendes super bien puedes sacar muy buena calificacion no tanto porque los examenes sean faciles sino pq si sabes 100% recomendable','NA','','2007-12-18 20:22:32',0),(3775,318,397,'2','Pesimo maestro, todo el mes habla sobre algo y en el examen t prgunta otra cosa, aparte d q saca un tema nuevo en cada examen, si la metes con el es complicart la materia, la verdad no lo recomiendo','NA','','2007-12-18 20:25:56',0),(3776,604,396,'8','Es un profe que la verdad no aprendes mucho .. sus examenes te copias facilicimo son examenes casi casi en grupo y por lo regular siempre encarga tarea yo entre con 70 al examen final no nececite nada en su examen final que estuvo muy dificil el departamental te puede salvar.','NA','','2007-12-19 01:34:20',0),(3777,580,726,'6','Pues no explica muy bien  la verdad , explica muy a su manera . Lo único bueno de este profesor es que sus examenes son facilisimos y siempre son de lo que vimos en la clase. Tarda semanas en explicar las cosas y explica lo mismo de toda manera posible que hace que te confundas al final . Si eres bueno en mate ya la hiciste y no tendras problema , pero si no vas a batallar. La verdad se me hizo medio barco  y si aprendi , pero si quieres aprender y se te dificultan vas a batallar.Otro punto es que a pesar de que sus examenes son regaladisimos , tiene una forma de calificar muy peculiar en la que siempre encuentra un error a pesar de tengas 100 .  ','NA','','2007-12-19 03:33:37',0),(3778,492,951,'9','Pues la clase esta muy bien , toma lista tarde y no pone mucha presión . Los examenes no son muy dificiles son mas o menos como un toefl . Eso si encarga casi todos los días tarea y revisa y califica muy cuidadosamente. y estricta La verdad si volveria a meter otra ves con ella porque enseña cosas muy bien y la clase esta muy tranquila . Ah y te recomiendo hacer las actividades extra  porque si te ayudan mucho aunque sean pocas decimas. No es barco , pero no es nada del otro mundo , la recomiendo totalmente.','NA','','2007-12-19 03:36:48',0),(3779,507,5,'10','Excelente profesor, aprnedi bastante con el . Super accesible siempre se encuentra en su oficina para cualquier duda. La clase es muy amena y explica todos los temas deu na manera que los hace ver entretenidos. Los examenes estan normales, nadie reprueba por mas wey que este.  Claro que la volveria a meter con el , aparte dice cosas que te dan risa y se lleva muy bien contigo . Mi mejor profesor del tec hasta ahora.','NA','','2007-12-19 03:38:48',0),(3780,473,496,'7','Pues la verdad la materia esta difícil y si no sabes de contabilidad te la vas a pelar todo el semestre. Los examenes no son muy complicados  , pero si not ienes buenas bases de conta vas a batallar demasiado. Encarga trabajos de puntos extra y te los pone sobre el final lo cual te ayuda bastante, creo que eso y los examenes es lo unico bueno que tiene. La maestra sabe mucho pero no sabe dar clase .Si tienen oportunidad metanla con otra.','NA','','2007-12-19 03:45:17',0),(3781,209,786,'7','La vdd el profe si sabe un buen ha recorrido todo el mundo pero sus examenes son otro pedo, en los 3 parciales el examen mas alto fue 80 y eso q se hacian en equipo, el final es individual y esta algo perro te pone muchas preguntas q ves en clase y no vienen en el libro, hagan aportaciones o no les da puntos extra','NA','','2007-12-19 04:41:06',514853098),(3782,560,957,'10','La vdd esta poca madre este profe no te vas aburrir a su clase y la neta si aprendes un chorro con el sus examenes con darle una repasada pasas y el final esta trankilo nada fuera de lo normal ni mucho menos imposible de pasar','NA','','2007-12-19 04:43:20',514853098),(3783,515,388,'7','El profe si sabe un chingo te da problemas de la vida real y los examenes son mas o menos dificiles, hay q hacer todas las tareas y si corres 40 km te da un 10 % de calif extra','NA','','2007-12-19 04:45:32',514853098),(3784,509,29,'9','la clase esta trankila aunq te encargan muchas tareas es de 3 horas y no hay mas grupos eso si nunk vas a salir temprano y entre catalina y fingers se echan toda la clase aunq todo mundo lleva lap y aveces nadie los pela','NA','','2007-12-19 04:49:00',514853098),(3785,196,668,'10','esta clase esta poca madre jamas te vas aburrir con el, la clase esde  3 horas y se te pasa rapidisimo da lecciones sobre oportunidades laborales, sociales y de la vida en general olvidate del libro y de las cosas teoricas y metela con el te va servir y te vas a divertir','NA','','2007-12-19 04:51:15',514853098),(3786,598,243,'3','esta ogt cn este maestro, esta dificil y puede q no hagas nada en todo el parcial, pero para el final y los examenes si esta ca;on y califica como quiere en verdad..','NA','','2007-12-19 07:54:01',0),(3787,479,578,'5','Me dio esta clase. Me habían comentado que era buena, pero resultó ser una maestra aburridísima. La clase se hace tediosa por lo mismo.','NA','','2007-12-19 13:50:14',0),(3788,815,40,'10','Es una buenísima maestra. Es buena onda, aprendes mucho en su clase, de la gramática y de la cultura. Explica bien y la clase se pasa rápido. Me encantó. Siempre muy atenta de todo. Eso sí, cuida mucho de la puntualidad.','NA','','2007-12-19 13:54:15',0),(3789,460,724,'10','Excelente maestra. Explica muy bien, se regresa si alguien no entendio, es muy accesible (con respecto a dudas y asesorias), su clase es bastante dinamica y rara vez te aburres. Si encarga algo de tarea pero hacerla (no copiarla, aunque si es facil conseguir las tareas) te ayuda bastante para los examenes, que tampoco estan tan complicados. No es de esas maestras que regala puntos pero si te va lo suficientemente bien si puedes esperar que te ponga 100 en alguna calificacion parcial o que encargue actividades para puntos extra. Aunque hay casos, es dificil reprobar con ella, se preocupa por sus alumnos y si lo merecen, termina ayudandolos y pasan. Super recomendable.','NA','207.248.45.9','2007-12-19 13:54:32',0),(3790,641,851,'10','Muy buen maestro. Su clase es sencilla, requiere algo de razonamiento pero el te da todas las bases, ya es cuestion de que te apliques y hagas las tareas y te puede ir super bien. Siempre esta de buen humor y dispuesto a ayudarte. Ni una sola clase me toco que anduviera de mal humor o grosero ni nada por el estilo. Sube todas sus tareas y presentaciones a BB y si le falta alguna, le pides que la suba y lo hace. Aparte de excelente maestro es excelente persona. Muy recomendable.','NA','207.248.45.9','2007-12-19 13:59:00',0),(3791,318,398,'4','Examenes super fumados, sacas puros 20s, 30s y 40s... aunque si pasas con los puntos extras...','NA','','2007-12-19 13:59:20',515867111),(3792,794,122,'10','Muy muy buen profesor. Su clase es super dinámica y el sabe bastante, y lo mas importante, sabe como transmitirlo. Encarga tareas sencillas y muy pocas. El examen es practicamente lo que viene en las powerpoints que usa en la clase y lo que el explica. Si es algo de machete pero tambien la manera en que explica te hace entender y relacionar los temas de la clase. Lo recomiendo ampliamente. Si van a tomar Biología, este maestro es definitivamente la mejor opción. ','NA','207.248.45.9','2007-12-19 14:03:15',0),(3793,5,396,'9','La verdad he tenido mejores profesores de fisica, pero este maestro no esta tan mal. Sus examenes son bastante sencillos (es cierto que los puedes conseguir pero al igual si sabes algo de fisica no te cuesta trabajo contestarlos honestamente). Dicen que es barco, y la verdad es que no califica muy estrictamente (osea te checa procedimiento y si demuestra que sabes lo que haces pero te fallo algun calculo, te da los puntos y asi) pero cada parcial me tocaba ver que tronaban bastantes y no hacia curva (o tronaban aun con la curva). Explica de una manera bastante simple, origen de la formula, ejemplos basicos, osea no se sale de lo que hay que cubrir para el examen y punto. No es el mejor maestro pero si es recomendable. Hay muchos peores.','NA','207.248.45.9','2007-12-19 14:08:52',0),(3794,584,385,'5','No muy recomendable. Trabajas muchisimo en su clase, siempre hay actividades y el tipico Calendar en Blackboard donde pone tareas para TODOS los dias. Para los examenes hay que machetearse lecturas y capitulos del libro. Los debates suelen ser un desastre. Sus ejemplos y explicaciones son bastante confusos. Te puede llegar a ir bien porque no requiere que entiendas totalmente la etica o que sepas explicarla, sino que trabajes y hagas las actividades dia con dia. Tambien hay un trabajo cada parcial (en el mismo equipo para todo el semestre), si la metes con el consiguete un muy buen equipo porque es bastante trabajo y si te toca gente floja en el equipo ya valiste, vas a trabajar mucho por una calificacion promedio. Hay mejores profes de etica, busquen a esos. ','NA','207.248.45.9','2007-12-19 14:14:06',0),(3795,548,934,'10','Excelente maestro. Una muy buena persona y muy paciente. Explica muy muy bien, y cuando haces las tareas (que a gente de otros grupos se les hacen complicadas o se tardan), te las avientas super rapido y casi sin usar las notas. Los examenes no son sencillos, si requieren que hayas estudiado y que le pienses pero es posible sacar 100. Si no te gusta la quimica y quieres a un barco, este maestro definitivamente no es la opcion. Si quieres aprender, este maestro es el mas recomendable. ','NA','207.248.45.9','2007-12-19 14:20:51',0),(3796,507,5,'10','Me dio dos clases sustituyendo al que era mi profe... la verdad estuvo súper divertida, todos muertos de risa. Sus ejemplos están geniales. Si tuviera la oportunidad metería alguna cla