ro pero con las mujeres!! a mi me dejaba dormirme todas las clases, solo te llama la atencion si te ve hablando mucho, no es perro en la manera de calificar, es un barcazo, si vas a revision del examen con el te sube un buen de puntos, eso si te tienes q aprender el procedimiento tal y como el lo hace si no es asi estas mal, yo si recomiendo meterla con el, solo q apunte todo asi sea algo muy sencillo, se los recomiendo.','NA','','2007-12-26 04:50:07',0),(3816,631,243,'10','es un amor de maestra!!! anota todo lo q diga en clase, pero todo, porq de eso hace preugntas en el examen, gracias a ella adoro el derecho, lo malo es q hay veces q falta mucho, sus examenes son solo 10 preguntas abiertas y si estudiaste de todos tus apuntes lo pasas, es muy buena onda yo sali con 95 final, la recomiendo al 100%.','NA','','2007-12-26 04:57:57',0),(3817,325,320,'10','Exelente maestro, de los mejores que he tenido. Para la raza mediocre no se los recomiendo, puesto que es un maestro que te exige que aprendas. Encarga mucha tarea y los parciales son dificiles, pero satisfacen a los que estudian y quieren aprender.Es un reto llevar una materia con este profesor y definitivamente te hara sentir una persona productiva si es que le hechas ganas.','NA','','2007-12-27 02:12:16',624055575),(3818,260,398,'9','La lleve en verano con el y no me fue bien en los parciales, pero al final dijo que llego santa y subio los promedios como por 20 puntos, hay que tener paciencia con este profesor. Si lo recomiendo, es muy visual para explicar las cosas y se le entinde si pones atencion.','NA','','2007-12-27 05:18:55',502922672),(3819,230,396,'1','OGT!!!!! Horrible este profe es el peor de fisica 1','NA','189.152.103.134','2007-12-27 07:17:07',0),(3820,230,396,'1','OGT!!!!! Horrible este profe es el peor de fisica 1','NA','189.152.103.134','2007-12-27 07:17:30',0),(3821,128,420,'10','Con madre, tira carro y enojona pero te da tanta risa que no te enojas. Cuando te pida que construyas oraciones utiliza