MO ESTE MAESTRO YA ESTA VIEJITO, LOS ALUMNOS SE APROVECHAN DE SU EDAD PARA PLATICAR, LO QUE NO FAVORECE LAS ACTIVIDADES QUE SE LLEVAN ACABO EN CLASE, Y DEBIDO A QUE EL TE ASIGNA UN LUGAR PARA TODO EL SEMESTRE, MUCHAS VECES TE TOCA ESTAR RODEADO POR GENTE QUE NO TE DEJA PRESTAR ATENCION.\r\nPARA LOS QUE SI SABEN FISICA Y POR UNA TONTADA SE FUERON A ESTE REMEDIAL, METANLA CON EL, YA QUE EN SU CLASE PUEDEN HACER TAREAS DE OTRAS MATERIAS, CONOCER GENTE, PLATICAR, HACER AMIGOS, JUGAR EN EL CELULAR, REIR, .....DECIR \"ALL\" PARA QUE SE ENOJE CADA VEZ QUE SE LLEVA A CABO EL METODO PEER.\r\n','NA','','2008-01-01 04:15:41',0),(3843,148,527,'10','ES LA MAESTRA MAS LINDA QUE HE CONOCIDO!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!\r\n\r\nLA VERDAD SOLO NECESITAS HACER LAS TAREAS BIEN Y YA. \r\nEXPLICA TANTAS VECES COMO SE LO PIDAN , Y TODAS LAS VECES LO HACE DE MUY BUENA MANERA, ES UNA MAESTRA QUE NO TE OBLIGA PONERLE ATENCION, ASI QUE SI ESRES DE LAS PERSONAS QUE TIENDEN A PLATIKAR TODA LA CLASE MEJOR NO LA METAS CON ELLA , PORQUE NO VAS A APRENDER NADA Y CREEME NO VAS A APROBAR EL CURSO. ','NA','','2008-01-01 04:23:55',0),(3844,259,496,'1','Lo peor!!!! en mi salon pasaron 14 de como 32..!! es muy perro!\r\nen mi examen final me bajo 5 pts porq hice de más, lo peor fue que a todo el salon le bajo esos 5 pts, es super estricto para calificar! traten de no meterla con él! Aparte su caracter no le ayuda mucho, no tiene nada de paciencia y aparte cuando le hablas o le preguntas algo fuera de clase, parece que le hablas al viento, solo se va y te deja hablando!','NA','','2008-01-02 01:58:57',0),(3845,126,385,'10','Super buen maestro!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!\r\nla verdad es super barca; La única cosa es que se fija mucho en los pequeños detalles... de tareas solo deja hacer foros del discussion... nunca los checa en lo que si se fija es que esten a tiempo, en la fecha acordada, si no si baja puntos. Los portafolios estan algo pesados pk son las actividades del mes, y pide que se 