2,932,'10','Esta maestra a primera vista es estricta y mala, pero mientras la conoces, te conoce y aprendes, llega a ser una clase muy muy divertida y facil. No te tienes que esforzar tanto (si te tienes que esforzar un poco, como siempre y como en todo) y te da gusto tener la clase, casi siempre...','NA','','2008-01-03 22:42:50',0),(3851,758,396,'10','ME PASO... TOTALMENTE! no se que paso... pero me paso... :) suerte','NA','','2008-01-04 02:40:16',0),(3852,725,563,'10','lo mejooooor.... me a esta profeee... es bien linda y explica super bien todo... ademas de repente es super chitosa... jaja\r\n\r\nvale la pena meterla con ella... tiene modos de calificar muy flexibles...','NA','','2008-01-04 04:04:43',0),(3853,150,385,'1','askooo! por experiencia propia NO LA METAN CON EL... y si es el unico ke keda DENLA DE BAJA.. en vdd,... cero recomendable...','NA','','2008-01-04 10:21:53',0),(3854,627,1050,'1','peeeesimo profesor\r\nbno no es el de la foto pero roger dario es lo peor\r\ntoda mi clase termino odiandolo\r\nNO ES BARCO, y SI REPRUEBA\r\npor faltas y los ensayos se la baña te hace ir hasta 5 veces en la noche a su oficina y te sigue mandando a la fregada\r\nNO TE LO RECOMIENDO busca otro profesor','NA','','2008-01-05 23:09:02',0),(3855,731,717,'9','Es muy buena persona explica bien y te lo vuelve a explicar cuantas veces quieras, al igual es flexible con las asesorias, pero si tienes que poner un poco te interes en la clase para que después quiera ayudarte. ','NA','','2008-01-06 12:44:12',783035857),(3856,731,717,'7','explica muy bien, sin embargo en sus exámenes no me fue tan bien, ya que sí los hacia complicados.. y de carácter si es bastante desesperante..','NA','','2008-01-07 04:05:43',516548459),(3857,202,5,'2','Super maal maestroooo!! \r\nNo calificaa nada maaas que sii te macheteaste el libro entero antes del exameen!!\r\nTiene ideas bien raras y en la clase en lugar de explicar se pone a criticar a gente/estilos de vida...\r\nEn mi opinion es muy perro...si no haces las cosas tal como el quiere o como las espera ya te fregastee!!\r\nNo hubo calificaciones arriba de 90...no recomendablee!!\r\nAdemas muuuuuy poco accesible...cuando se equivocaba en las calificaciones no te lo cambiaba!!\r\nDEFINITIVAMENTE NO VALE LA PENAA!!','NA','','2008-01-07 14:05:01',0),(3858,580,722,'9','Muy buena personaaa...\r\nMuchos no entienden su manera de explicar ya que algunas veces dedica la clase entera a explicar el fondo de las cosaaas.. pero en sí es bueno.\r\nSabe muchísimo de la materia.\r\nLo recomiendo si no eres tan malo en mate...\r\nEs justo para calificar siempre y cuando hagas las cosas como lo pide y pongas TODO el procedimiento en cada uno de los problemas.','NA','','2008-01-07 14:10:06',0),(3859,687,1050,'9','muy buena maestra!!\r\nun poco exigente pero te hace aprender mucho...\r\ncalifica justamente siempre y cuando sigas los lineamientos!\r\nnunca deja tarea aparte de los ensayos y trabajos que todo mundo tiene que hacer y basicamente en clase no haces nada....super agustooo!!','NA','','2008-01-07 14:13:21',0),(3860,292,178,'8','Eeeekis la clasee...ni entretenida ni pesadaa...\r\nNo es perro pero tampoco es barcoo...ahi la llevaa...\r\nBuena ondaa..','NA','','2008-01-07 14:15:13',0),(3861,633,243,'3','Mmmm no me gusto nada esta maestra la verdad...ella escribió el libro que se usa en clase y por lo tanto basicamente todo lo del exameeen sale del libroo...pero si no estudiaaaass bastantito el dia entes del examen ya valistee porque lo mas probable es que te quedees dormido en todas su claseees y el dia antes no tengas la menor idea de que se vio en todo el parcial...\r\n\r\nEl mayor problema es que habla, habla y hablaaaa y por lo tanto la clase se vuelve muuuuuuy pero muy monotonaa...\r\n\r\nNO RECOMENDABLE!!','NA','','2008-01-07 14:18:58',0),(3862,357,830,'7','ahh no entendii.. entonces es perro o barco.. califica justo o no? te la pasas bien en clase o no? ','NA','','2008-01-08 03:26:44',0),(3863,687,1050,'2','Es una maestra de lo peor!!! La mas perra en taller. 0 recomendable.','NA','189.152.4.108','2008-01-08 08:12:41',0),(3864,849,268,'6','NO LA METAS  CON ÉL. Mal profesor, mucho trabajo, aunque relativamente barco para calificar, pero insisto en MUCHO trabajo. Un punto a favor es que asistes prácticamente sólo el primer mes a clase (a clases MALÍSIMAS Y ABURRIDÍSIMAS con mucho powerpoint), y el resto del semestre son asesorías de 20 minutos por equipo, una vez a la semana. Se puso muy perro con las faltas.\r\nLa metí con él porque me dijeron que era un barco, pero declaró ante todo el salón que acaba de decidir dejar de ser barco y se convirtió en  un perro. Pero al final las calificaciones fueron buenas (el más bajo fue como 87): pero los que no la dieron de baja trabajamos bastante, demasiado.\r\nNunca metería otra materia con él y no se lo recomiendo a nadie. Es de los jefes del departamento emprendedor así que cree que esa materia es la más importante de tu carrera (no importa en que carrera estes).','NA','','2008-01-09 00:27:24',634450240),(3865,625,722,'3','la vdd no recomiendo este profesor para las personas que en verdad quieren aprender matemáticas bien... c supone q mate 1 es para reafirmar y explicar el porqué de conceptos d calculo diferencial, derivadas y otras cosas así, pero con este profe, como dijeron antes, nomás dice \"estudia los complementarios\" (AUTOESTUDIO, que para eso ni para qué pagamos la materia...). Pretende hacerse el chistosito con su acento y contando cosas, pero en mi opinión, debió usar ese tiempo para reafirmar los conceptos y hacer problemas. No sabe explicar bien y muchas veces califica los exámenes subjetivamente. Es INJUSTO y a menos que le argumentes tu caso específico, te califica como debe ser o te ayuda muy levemente. No se los recomiendo para nada.','NA','','2008-01-09 01:15:24',0),(3866,62,180,'10','Es una de las mejores maestras para esta materia, la verdad es bien tranquila y explica muy bien, entiendes porque entiendes, a comparacion de Martha Sordia y Barron que nomas no saben lo que estan haciendo. Sus tareas son bien faciles y cuando pone un ejercicio muy dificil, da chance de volverlo hacer para levantar el promedio de tareas. Los examenes estan super faciles, son de opcion multiple y si pusiste atencion en clase no se te va una. Vale la pena meterla con ella, porque entiendes todos los conceptos necesarios para compu II y es muy buena maestra.','NA','','2008-01-09 01:27:13',0),(3867,714,664,'10','Tiene caracter fuerte pero sabe un buen!!!','NA','','2008-01-09 07:16:22',564090275),(3868,446,422,'10','es muy buena maestra y super linda aprendi mucho con ella y no solo de gramatica y pronunciación sino tambien de cultura.','NA','','2008-01-09 08:30:48',767810721),(3869,802,396,'10','explica super bien si no entiendes algo lo vuelve a explicar en los examenes pone 1 problema de los vistos en clase entonces si es importante apuntarlos','NA','','2008-01-09 08:35:01',767810721),(3870,34,879,'9','es muy perfeccionista pero ves un poco de todo y aprendes bastante, es un maestro q si sabe lo q hace y la vdd te ayuda un chorro para mejorar la calidad de tus trabajos, yo volvi a meter con el..','NA','189.157.110.4','2008-01-09 12:35:32',0),(3871,374,677,'2','Esta maestra es el enviado del diablo. Ya está senil y se le va la onda cañon cada vez que se le olvida tomarse sus pastillas. Se le pierden tus calificaciones, no sabe que tareas encarga, así que las que haces no las califica y te inventa unas que no vienen ni en el calendario ni las dice en clase. Te tacha de inutil, estupido y tonto. Lo unico es que si sabe del tema, pero a ver cuando se digna a hablar de la materia, por que se la vive hablando de Lopez Obrador y de la gente mocha. Vieja Loca. ','NA','','2008-01-09 23:40:43',0),(3872,472,932,'10','Es una maestra que le gusta la actuacion asi qe actua como loca,  ingenua, e incluso como alguien odioso, pero relamente es nada mas para despertar a los alumnos porque le encanta que le pongan atencion... si pones atencion aprenderas mucho y sacaras 85 facil... pero si quieres hablar y dormir olvidate esta maetsra sera tu pesadilla.','NA','','2008-01-10 05:52:46',0),(3873,298,435,'9','La mstra sabe explciar y se presta mucho para asesorias pero no es alguien estricto asi que si eres flojo es facil que repruebes si no te pones las pilas... si eres alguien ñoño o que se le da la programacion o mas o menos pone atencion/hace actividades, entonces te ira muy bien.(ojo haces actividades no copias... porque te srive como practica y aveces las actividades son los examenes pero les cambia tantito)','NA','','2008-01-10 05:58:15',0),(3874,28,713,'8','Explica bien pero si no pones atencion o faltas sera dificl que te repongas a als clases porque ya tiene todo organizado... lo malo es que si no conciden en pensamientos es muy terca asi que mejor ni te esfuerzes en hacerla cmabiar de opinion pero hasta cierto punto es de mente abierta si hbalas con ella....mente abierta, no estupida...Da puntos extra aunqe si pónes atencion sacaras un 80 facil','NA','','2008-01-10 06:03:44',0),(3875,473,496,'9','Nunca he sido un alumno destacado pero no puedo evitar ser honesto con los comentarios, me da gusto que es una maestra comprometida y aveces no salían las cosas porque también por parte nuestra no cooperabamos, creo que en el tec hay grave problema de compromiso por parte de mucha gente y entre eso estamos un alto porcentaje de los alumnos.  si eres wevon o wevona (porque también hay mucha mujeres bien flojas) y quieres hacer una carrera para hacer contactos y/o conseguir esposo o esposa con dinero y carro pues no las metas con esta maestra.  Busquen los barcos y poco comprometidos alfin pasamos con esos, aunque sea con un 70 y así hacemos una carrera, ojalá y esto no pase en medicina porque sino esos que ahora son alumnos son los que  nos van a operar cuando tengamos 50 años y estemos malos del corazón y ese rollo.\r\n\r\nBueno amigos se cuidan y ya ponganse a trabajar','el webs','','2008-01-10 06:35:43',0),(3876,585,287,'10','Este maestro debería ser premiado y mostrado como ejemplo para todo el Tec, es muy buen maestro y extraordinaria persona.   Me encanta su calidad como persona, como profesionista y su nivel de compromiso para cada alumno.\r\n\r\n','NA','','2008-01-10 06:41:36',0),(3877,117,243,'4','no es muy buena maestra.... llega super tarde a las clases y\r\nel primer parcial esta super feo entonces cuidense =S','NA','','2008-01-10 08:04:12',784195412),(3878,446,420,'10','Me encantó su clase!!! super amena y nada aburrida. Aprendes muy rapido todo y encarga pocas tareas.','NA','','2008-01-10 09:08:35',0),(3879,149,179,'8','muy linda la maestra, pero si llevas la clase temprano pues si te puede dar un poco de sueño. ','NA','','2008-01-10 09:54:47',784195412),(3880,584,469,'8','Es buen profesor, no es perfecto. Lo unico que tienes que hacer es tratar de no convertirte en su conejillo de indias, por que si no te hara la vida imposible durante todas las clases siempre pasandote al frente a que platiques de algo relacionado con el tema de la clase. Todo lo que dice en la clase se debe de anotar por que muy posiblemente vendra en el examen. Los examenes tienen la misma forma, los de los parciales y el final, constan de contestar preguntas de opcion multiple, preguntas abiertas, falso y verdadero, y en todos viene un cuadro comparativo de algo que haya dicho. Siempre sigue el calendario que hace desde el primer dia de clases y siempre hay tareas, pero la mayoria es excesibamente facil, cosas como \"hacer un cuadro sinoptico de la lectura leida\" y las lecturas no pasan de las 10 hojas. Te pide comprar varios libros, pero son baratos y bien los puedes pedir prestados y usarlos durante el parcial que te lo pidio, aparte que los libros son faciles de leer y con entenderlo es mas que suficiente, por que comunmente no pregunta cosas sumamente especificas. \r\nLa clase es realmente amena, el profe se la pasa haciendo payasadas y relacionando los temas que da en clase con algo de la vida, a veces da puntos extras y tambien da chance de entregar tareas tarde','NA','','2008-01-10 13:37:24',0),(3881,77,934,'6','No mams, el we cree que tmb tienes dos maestrias como el y que dominas perfecto el tema... Si a todos les va mal, que es muy probable, hace sus curvas de 20 o 30 puntos, pero es de lo peor, muy aburrida su clase.','NA','','2008-01-10 21:01:20',0),(3882,253,715,'9','Super barco, jajajaj si la pueden meter con ella y con seguridad pasan... No explica muy bien pero es de lo más fácil','NA','','2008-01-10 21:02:45',0),(3883,655,934,'2','Se la pasa literalmente la mitad de la clase quejandose de sus alumnos que porque no quieren hacer las cosas y asi. Explica bien la teoria de la quimica el problema es que a la hora del examen te pregunta lo que solamente viste en las tareas. Si pasa a alumnos pero depende de si ella penso que le hechaste ganas y aparte tienes q tener 69 para q te pase MINIMO. Ah y tuve tarea casi todos los dias porque siempre tenia tarea de quimica. En total no creo q puedas meter con peor maestra que esta asi que escoje otra.','NA','','2008-01-11 01:52:25',515010379),(3884,167,772,'3','Pésimo maestro. No le preguntes nada porque se burla de ti. Sólo se la pasa leyendo los slides.','NA','','2008-01-11 09:56:20',0),(3885,723,279,'10','Explica muy bien, te da asesorias cuando necesites siempre y cuando vea tu interes en la clase. Si le tienen que echar ganas. Los trabajos que se hacen en clase nunca los revisa. revisa pocas tareas tambien. lo que toma encuenta para la calificacion final es laboratorio (al cual le tienes que hechar un chingo de ganas) los examenes parciales y el trabajo final. El trabajo final es una mentada de madre. Le tienes que dedicar minimo unas 20 horas. Escogan bien su equipo para el trabajo final por que si no les lleva la chingada. Este profesor es atoda madre la verdad y te forza a que le heches huevos.','Fr|0z3n','','2008-01-12 00:26:49',509296903),(3886,522,361,'8','Explica mas o menos, ella cree que su metodo de explicar es de lo mas facil pero la verdad le tienes que hechar tantillo coco y pirartela tambien. Sus examenes parciales de este semestre (ago-dic 2007) estaban mas cabrones que los semestres pasados. el caso es que cada semestre se pone mas perra. si esta bien buena y todo pero aveces se van a desconcentrar porq se van a quedar picados con su culote. Esta no es una materia facil, le tienen que hechar un chingo de ganas para pasar.','NA','','2008-01-12 00:30:57',509296903),(3887,429,954,'5','Esta maestra es una perra del mal. Se fija mucho en la pinche ortografia y el dia del examen se pone toda paranoica de que si le preguntas algo como que horas son o que dia es hoy te grita o te hace cara de callate perro. En los trabajos mensuales siempre se nos paso de verga con la calificacion. Ella hace equipos al principio del semestre de acuerdo a tu carrera. Pone a ingenieros con ingenieros, lics con lics. el pedo de esto es que a los ingenieros no se nos da la puta ortografia entonces a la hora de los trabajos en equipo siempre nos cargaba la verga. ahuevo pasan la materia con ella pero si les va a caer mal. es media feminista y mama a los NERDS ÑOÑOS Y FREAKS. habla mucho de su hijo en la clase siempre dice que esta bien guapo y siempre se avienta comentarios bien pendejos. Para mi que su hijo a de ser un completo idiota y un pendejazo.  ni de pedo meto otra materia con ella.','NA','','2008-01-12 00:38:04',509296903),(3888,582,700,'10','Excelente maestro... te vas a divertir muchisisisisisisimo en su clase, ademas de que es chido el profe. Claro que hay momentos en los que desearias no estar en esa clase, pero son solo malos momentos, jajaja!!! \r\nPara las mujeres, les recomiendo llevarsela leve, siempre se esta madreando a las mujeres, pero no lo hace en mal plan da risa. \r\nCreo que le hacen falta unas clases de español ! ... derrepente se la van las \"N\" y \"S\" como ultima letra de la mayoria de las palabras!, pero despues del primer parcial aprendes a controlar tu ansiedad por callaro! \r\nFuera de eso, les puedo decir que sus examenes se dividen en tres categorias--- el \"facil\" el \"intermedio\" y el \"WOW-WOW\" jajajaj , y si tienes que estudiar como nunca antes lo has hecho para sus examenes, pero si pones atencion en clases, y ojo (TIP:) si anotas todas las preguntas todas las preguntas que diga \" PREGUNTA PARA EXAAAMEN\" o \"PREGUNTA AL GRUPO\" y las señalas bien, y a la hora del examen estudias esas preguntas, te va a ir muy bien !!! .. \r\nSi pierde el \"america\" probablemente el siguiente dia no llegue de muy buen humor, pero pues nadamas te lo madreas y se aliviana !!! \r\nLa neta es de los mejores profesores que hay !!! ','NA','','2008-01-12 00:40:29',0),(3889,424,934,'7','Esta es una materia muy pinche dificil. Esta maestra explica bien pero si no le hechas huevos la verdad vas a batallar mucho. Las dudas las responde y se la pela para que le entiendas. Si haces desmadre en la clase se molesta mucho. Pone quizes cada semana y neta cuentan un chingo. SI LE TIENES QUE ECHAR HUEVOS! no te confies. para el final estudie alrededor de unas 20 horas. al final del semestre te da chance que hagas los quizes en equipo (para que puedas subir calificacion) y los temas del final son mas faciles por que osn mas matematicos que teoricos. no te da un solo punto. si tienes 69 te hcingaste y te quedas con tu 69. entonces si la van a meter con ella deveras hechenle huevos y que no se les olvide.','NA','','2008-01-12 00:42:52',509296903),(3890,703,55,'8','Esta materia es una pinche hueva. TIenes que leer historias super aburridas. Los ensayos parciales son una mentada de madre pro que ahuevo le tienes que dedicar unas 6 horas. Era un sufrimiento ir a esta clase. La maestra al principio califica muy perra pero como q le vas agarrando el pedo y empiesas a mejorar. si aprendes la verdad pero no de buena gana. Si pueden metan esta materia con otra maestra mas calmada. De por si es una materia de relleno y todavia te la pelas. ','Fr|0z3n','','2008-01-12 00:46:46',509296903),(3891,529,207,'10','es con madre la maestra.... a lo mejor sus examenes son algo dificiles pero explica bien y su clase no es aburrida.... si pueden metanla con ella','NA','','2008-01-12 06:40:24',0),(3892,323,124,'10','Si la metiste con el ya chingaste y si no pues metela con el.','NA','','2008-01-12 11:10:14',0),(3893,758,396,'9','esta chavo, explica bien si no entiendes es muy accesible a contestar preguntas que tengas y tutorias da muchisimas, si se le sale un gallo de vez en cuando (dos o tres veces por clase). Si presta puntos el primer parcial hasta 30, que luego debes de regresar el 2ndo y tercer parcial, igualando la calificacion de primer parcial. De otra manera te los quita (Segun el), pero a nadie le quita nada. Se sale unos 5 minutos siempre, en todos los examenes, parciales y finales, dandote chance de pararte y copiarte con toda tranquilidad. En mi caso hizo \"ajuste\" el cual me subio 3 puntos finales.\r\n\r\nEs bueno si tienes algo de ganas de estudiar. Si quieres un TITANIC no es este, pero es buena opcion.','NA','','2008-01-12 13:51:01',0),(3894,783,1034,'9','Buena maestra al principio parece que la clase va a ser muy dificil, pero conforme a la marcha te adaptas muy bien, siempre encarga tareas pero siempre son iguales asi que no ahi pierde. Encarga trabajo final y en el tercer mes no ahi examen. No es muy estricta en la puntualidad.\r\nMe fue bien a mi, si la recomiendo','NA','','2008-01-14 03:25:36',0),(3895,51,717,'9','buen maestro, explica bien   y es buena onda','NA','','2008-01-14 03:34:55',784195412),(3896,541,207,'7','esta maestra lleva la clase muy rapido, y encarga muchas tareas...\r\n','NA','','2008-01-14 03:39:57',784195412),(3897,3,397,'6','Este wei es muy simple. Si eres clavado en la fisica y te sientes confidente de tus capacidades....adelante. Si sabes qe se te dificulta la materia, mejor olvidalo. \r\nSus clases se dedican a explicar de donde vienen las formulas para resolver los problemas, o sea, en esta clase, NO se resuelve ningun problema. El espera qe con los conocimientos vistos, tu te las arregles para resolver los largos y extensos problemas de tarea qe encargara. \r\nLos examenes son largos y dificiles, siempre tienen algun tipo de truco o sorpresa escondida. \r\n\r\nLa unica esperanza con este maestro, es qe hace curvas....a veces!\r\n\r\nA modo de conclusion: si eres bueno en fisica, adelante. Si eres malo o promedio....no lo recomiendo para nada. ','Alberto','','2008-01-14 19:59:05',810890306),(3898,814,281,'10','Este profe, aunqe es medio amanerado, es a toda madre. \r\nHonestamente, es el mejor maestro de dibujo del departamento, o al menos el que sabe enseñar mejor sus tecnicas. \r\nYo te lo garantizo....con el dibujas o dibujas, no hay mas. \r\nLo unico qe el espera de ti es qe pongas esfuerzo y dedicacion en tus trabajos...de lo contrario lo notara y puede qe no te califique muy bien. ','Beto','','2008-01-14 20:03:08',810890306),(3899,749,1057,'7','Aguas con ella! Seguramente te la toparas en Taller III o en Taller V. Introduccion a la carrera es una materia sin chiste, asi qe obvio no es suficiente para calificarla con eso. \r\nEn las otras materias sin embargo es distinto. \r\nSuper dificil. Raramente le daras gusto y siempre siempre buscara alguna observacion qe hacerte, incluso si tu diseño esta bien depurado. \r\nSe comporta como maestra de secundaria, comienza a gritar a la clase cuando ve qe hay ruido....se estresa muuuy facilmente, basta con qe pases una libreta mientras ella habla. \r\nEs muuy estricta con las faltas, no tolerara ni siquiera retardos. \r\nEn realidad tiene una metodologia de trabajo muy rigida, cosa que no va con el tipo de materia impartida. \r\n\r\nSin embargo tiene sus puntos buenos. Fuera de clase es muy buena onda, etc... pero eso ya es extraclase. \r\n\r\nEn Taller III, recomiendo mil veces mas a Naoko. Esa maestra de verdad qe enseña increible.','yop','','2008-01-14 20:10:38',810890306),(3900,432,878,'9','Buena maestra y buena onda. Con ella es simple: echale ganas, no te tires a la hamaca. \r\nToma mucho en cuenta tu esfuerzo y dedicacion, pero con eso no sera suficiente, necesitas presentarle trabajos de calidad. \r\nSin embargo hare notar qe en proto III es bastante mas light qe el resto de las materias.','beto','','2008-01-14 20:17:04',810890306),(3901,260,396,'4','Mal maestro, sumamente aburrido, yo pasé su clase, pero es puro autoestudio porque no explica nada','NA','','2008-01-15 04:16:57',514836576),(3902,86,364,'2','Muy mala maestra la verdad. Sabe mucho pero no sabe como explicarlo y si no le entiendes se estresa y se enoja por que esta super amargada.. Eso de que al final te pasa o que regala un chorro de puntos no es cierto, todo depende del humor que tenga en ese momento.. A veces lo ha hecho pero cuando yo la lleve no hizo curva y reprobo mas de la mitad del salon, si no sientes que le caes bien desde un principio dala de baja por que si no ella se encarga de que no pases aunque tengas 69. ','NA','131.178.241.50','2008-01-15 05:00:02',0),(3903,671,207,'1','Es de lo peor','NA','','2008-01-15 05:24:50',511418753),(3904,199,207,'10','Es el mejor, te enseña de la manera mas facil aparte que te da mil puntos extras.\r\nNo duden en meterla con el.','NA','','2008-01-15 05:26:57',511418753),(3905,260,396,'1','el peor maestro ke e tenido','NA','189.156.178.217','2008-01-15 07:26:52',0),(3906,89,473,'7','para empezar eso de los puntos extras ya lo quitaron, y no hay nadie mas ke de esa materia, les doy un super tip. ESTUDIEN LAS DIAPOSITIVAS DE SU CLASE IMPRIMANLAS, APRENDASELAS DE MEMORIA Y YA ESTA EN SERIO HAGANME CASO. los unicos puntos ke da son los de ke si no faltas en todo el semestre te da 10 puntos.','NA','','2008-01-15 07:55:49',0),(3907,415,72,'1','No creo que sea un buen profesor, porque más de la mitad de mi salón reprobaron, y aunque yo pasé, no aprendí casi nada. Todas sus clases se basan en filminas que son puro copy paste del libro y de internet, y cuando trata de explicar casi nadie le entiende. Encarga 3 proyectos al semestre, y dice que si te copias de los que ya la cursaron o de internet pues te pone DA, sin embargo, al final de cuentas los aceptaba todos, siempre y cuando le \"entendieras\", de hecho, la mayoría de los que pasaron se copiaron los 3 proyectos y todos los que no pasaron no se copiaron ninguno, y por lo tanto no los entregaban o tenían errores. Trata a sus alumnos con tono sarcástico en forma de ofensa, y si le contestas de igual forma la agarra contra ti y los de tu equipo, así que si quieren llevársela tranquila la clase, sean lo más barberos posible.','W','','2008-01-15 12:44:04',0),(3908,736,496,'1','Es una maestra muy mala, sabe mucho del tema pero si le dices algo que no le parece ya te trae en jaque todo el semestre, al grado de hacerte imposible el pasar la materia, en sus examenes pone cosas que no vieron en clase o que se vio en una sesión, es imposible sacarle un punto extra, no es nada barco y si no has llevado conta ni se te ocurra meterla con ella te trata como si ya te fueras a graduar, además te tienes que reir de sus chistes malos...','NA','','2008-01-15 12:48:39',0),(3909,325,320,'10','Uno de los mejores profes que he tenido, pero también una de las clases más difíciles que he tenido. Todo lo explica muy bien y siempre está disponible para asesorias, pero los parciales estaban muy difíciles, de entre 2 y 3 horas cada uno, en los sábados, además de que encarga muchas tareas. Aunque pasé con 70, aprendí mucho.','NA','','2008-01-15 12:53:40',0),(3910,388,955,'10','Muy buena maestraaa!!! metanla con ellaa... es muy excentrica, pero divertidaa, sus aretes la mueven!! ...  su clase es muy amena, y dice cosas muy graciosas, da puntos extras por muchas cosas, solo si hay que invertir tiempo en los ensayos...','NA','','2008-01-15 13:03:53',0),(3911,61,898,'7','En su clase no aprendí nada, en sus asesoría tampoco, nadamás nos presentó los threads y de ahí en adelante internet fue nuestro profe. Me caía mal por lo mismo, porque iba a clases nadamás a hacerme wey. Pero al final de cuentas califica los proyectos, que es lo que más vale, de forma justa, y no es tan mal persona. Al escoger el proyecto final escogan algo sencillo para que no se mentan en problemas, ya que no califica mucho la complejidad, sino que funcione.','NA','','2008-01-15 13:09:43',0),(3912,775,91,'6','Le gusta hacer sufrir a sus alumnos, y más si son itics, se los trae de bajada todo el semestre. Lo que enseña lo enseña bien, pero sus examenes son difíciles, y aveces pone cosa que supone que debemos de saber que no explicó ni vienen en el libro. Nos dio una asesoría unos días antes del final, pensamos que se había alivianado... Pero en el final no venía nada de la asesoría, y dijo que para que ponía algo similar si ya lo habíamnos visto en la asesoría.','NA','','2008-01-15 13:16:57',0),(3913,355,851,'7','Me fue mal en su clase, sin embargo no era mal profe. Dicen que daba muy buenas asesorías. Yo iba nadamás para las tareas, y ahí medio me la hacía toda. Es una materia muy dificil, pero aún tirando hueva es pasable.','NA','','2008-01-15 13:23:00',0),(3914,62,866,'10','De las mejores maestras que he tenido, es bien alivianada. Explica bien y siempre da asesorías. Sus laboratorios estan tranquilos y pues ella ayuda mucho.','NA','','2008-01-15 13:25:10',0),(3915,388,55,'10','Excelente maestra, divertida y exigente pero no extremo, no es perra, si cumples con los trabajos y si haces el esfuerzo de trabajar en lo que pide se da  cuenta y te tiene en cuenta...','NA','','2008-01-15 13:25:17',0),(3916,219,713,'6','No explicaba muy bien, pero en asesorias, aunque ponía una jeta, te explicaba. Sus exámenes estaban difíciles, pero si hacías los ejercicios de repaso (siempre y cuando los mandara) te iba 2 3. No tomaba lista, de hecho faltaba un chingo, que por compromisos de trabajo, familiares, que le dolía la panza, etc... Hizo las curvas más grandes que he tenido, de entre 30 y 50 puntos en los parciales, de hecho creo que en el grupo que estube nadamás reprobaron unos 2 o 3. Al final de cuentas es mal profe, pero está bien curado.','NA','','2008-01-15 13:32:07',0),(3917,310,813,'9','En general es muy buen profe. Explica muy bien todo, pero sus exámenes están difíciles. Si quieres llegar bien parado a arquitectura computacional llevenla con él.','NA','','2008-01-15 13:35:51',0),(3918,835,282,'9','Empezando con el ingles. Si no traes buen dominio del idioma, mejor no la metas con el, generalmente da clases en ingles y es muy estricto con esa politica. \r\nDebido a qe 100% de la clase es seguir sus instrucciones, enteder lo que dice es mas que escencial. \r\nSi el ingles no te es problema, entonces tampoco debe serlo esta clase. \r\nEn esta clase no puedes distraerte un segundo, porque si se te pasa una de las instrucciones del maestro, te pierdes, y alcanzarlo es muy dificil, lo que provoca que no comprendas los comandos correctamente y que no puedas realizar la tarea.\r\nPara los parciales solo cuenta la calificacion del examen, sin embargo las tareas cuentan para el final....y bastante. \r\n\r\nAl final habra un proyecto bastante complejo, pero esto es independiente del maestro que de la materia. \r\n\r\nEn fin, este profe es bueno, pero yo he escuchado mejores comentarios de Pedro Orta (quien es uno de los que dirige el proyecto Cartec)','NA','','2008-01-15 14:42:10',810890306),(3919,645,177,'8','Probablemente al principio te sacara mucho de onda la forma de ser de este maestro. Es un señor tratando de comportarse como un joven. Conoce tantas cosas de jovenes como es musica y asi. \r\nEs muy artistico y le gusta criticar mucho. Dependiendo del grupo, el ambiente y atmosfera de la clase pueden sentirse extrañas. El chiste aqui es darle siempre por su lado. Platica con el, aunqe sea extraclase, pero intenta buscar algo en comun con el, ya sea musica, algun artista favorito, o alguna idea...etc. El aprecia mucho estas cosas. Le gusta que tus trabajos esten inspirados por algo y no solo porque se te ocurrio qe se veria bien. \r\n\r\nYo al principio empece siendo un alumno equis para el, pq no lo pelaba ni platicaba con el, me limitaba a entregar mis trabajos sin dar explicaciones. Pero a medida que avanzo el semestre la relacion con el mejoro bastante y de repente ya era fanatico de mis trabajos, asi que al final me fue excelente. \r\n\r\nUn punto muy a favor, es que es considerado con los gastos de tus trabajos. ','NA','','2008-01-15 14:58:09',810890306),(3920,76,1081,'8','Este maestro habla y habla y habla y es dificil entenderle. Sin embargo es bien barco. Sus tareas son simples e interesantes a la vez. Consisten en hacer investigaciones, ir a biblioteca, sacar un monton de revistas de diseño y sacar copias de fotos interesantes, despues hacer una presentacion. \r\nEl maestro es bueno, sabe de diseño, pero un punto muy en contra es su gran inclinacion hacia la arquitectura. El 90% de sus explicaciones van aplicadas a la arquitectura. Digo, para el arq. es excelente, pero no lo creo asi para los diseñadores. ','NA','','2008-01-15 15:05:48',810890306),(3921,713,352,'10','Bueno esta maestra es muuuy buena. Es experta en el tema aunqe a veces se desvia y termina hablando de otras cosas que nada qe ver. Procura no llevar esta clase en la mañana a las 8 o algo asi pq su voz es tan quedita que te estaras durmiendo en clase. \r\nEn cuanto a trabajos es muy simple, no son dificiles, te da las instrucciones paso por paso, asi que solo depende de ti echarle ganas y llevar algo bueno. Si ve que siempre has sido dedicado, puede portarse muy flexible con la entrega de trabajos o con la calidad de estos. \r\nY bueno, es muy buena onda, es de esas maestras con las que puedes platicar agusto de algun tema interesante. Entiende a los alumnos a la perfeccion asi que quiza de repente te pueda echar la mano.\r\nEso si, lo recalcare, es una experta en su tema, depende de ti aprovechar los conocimientos qe te brinda. ','NA','','2008-01-15 15:20:45',810890306),(3922,353,751,'1','no la metan\r\n','NA','','2008-01-15 21:53:47',0),(3923,125,526,'10','De lo mejor esta profe y muy pocas veces toma lista','NA','','2008-01-16 06:39:01',688181591),(3924,643,957,'7','Super exigente...va bieeen rápido y la vdd no entiendes ni madres...en mi caso, vimos 25 capítulos, los otros grupos vieron 10, máx 12...ustedes comparen...sus exámenes estan muuy locos...:S....cuenta chistes malisimooos, nunca pasa a nadie, ni con 69...fácil, 50% de los alumnos reprueban... la vdd, genera un bueen de feria...pero la vdd...me siento orgulloso de haber pasado con el...pero le pensaria muchooo para volver a llevar clases con el...','NA','','2008-01-16 06:56:36',0),(3925,507,5,'10','La clase con Mike esta excelente!!  en vdd las clases q puedan meter con el no duden en hacerlo esta super divertida la clase y te da ejemplos muy padres y entiendes muy bien la clase','NA','','2008-01-16 07:15:40',0),(3926,777,254,'10','Es el mejor maestro en el area de garantias individuales y sociales y tal vez de todo el departamento de Derecho. Lo mas probable es que te va a ir mal en los examenes parciales, pero no te desesperes es parte del aprendizaje...al final si le hechaste todas las ganas y fuiste capaz de razonar en la materia la sacas avante.\r\n\r\nSu calidad humana como persona demuestra que a mayor inteligencia, mayor bondad. Nunca vas a recibir groserias ni majaderias de su parte.\r\n\r\nNo pierdas la oportunidad de meterla con este excelente profesor.','NA','','2008-01-16 08:14:11',0),(3927,77,934,'1','es un pésimo profesor nunca la metan con él. puedes terminar con 69 y segurisimo no t pasara.. no cometan EL ERROR DE SUS VIDAS... pongo 1 porque no ay una calificacion menor... Lo unico bueno d la clase e sk nunca pasa lista! o raras veces y puedes faltar las k kieras pero aguas k t tienes k poner al dia con lo k vieron... si ya estas con él mejor pidele apoyo a un amigo d otra clase k t explik','NA','131.178.241.54','2008-01-16 08:53:44',0),(3928,367,426,'5','Si no hay más opción, ni modos, pero si es posible, NO la metan con el.\r\nSe la pasa traduciendo las filminas del libro en inglés, el proyecto es una ojetada (se trata de aprender SQL y te debes sacar PHP de la manga), truenas todos los parciales y aun asi no te dice cuanto sacas, tampoco te dice cuanto sacaste en las tareas...','NA','','2008-01-16 12:26:18',628170502),(3929,533,496,'9','Esta clase nunca te va dar sueño, la profesora es super hiperactiva y nunca  da ni un minuto para respirar.. El primer parcial es el unico que esta perro, pero los demas estan faciles aparte de que se pone super barco en el segundo parcial y en adelante.. Con esta profe garantizo que van a aprender mas que cualquier otra clase de informacion financiera siempre y cuando presten atencion y no falten, pq aunque no marca faltas, te conviene ir.. Me cae medio mal pq siempre habla de su hija que estudia en el Americano y de que vive en San Pedro y que viaja un chorro y que su marido tiene lana pero la clase esta buena... ','NA','','2008-01-16 21:40:03',0),(3930,44,1098,'10','El mejor prefesor!!! Aprendes, nunca quieres faltar, es bien interesante estar en clase con él.','NA','','2008-01-17 01:44:29',513635273),(3931,353,751,'1','Había conocido profesores ESTRICTOS lo cuál me parece razonable, pero este señor es GROSERO, PREPOTENTE y ve a los alumnos como bichos rastreros.\r\n\r\nCuando fui con mi director de carrera a preguntarle qué onda con ese profe, me dio de baja la materia sin preguntarme casi creo, puesto que él mismo casi se agarra a golpes con este profesor \"excelentemente preparado\" pero sin calidad humana.','NA','','2008-01-17 01:49:39',513635273),(3932,89,1152,'8','La verdad si es perra y ella misma lo dice. Yo lleve dos clases con ella Metodologia y Metodología, jajjaa porque literalmente me tronó. La verdad es una de las maestras mas cultas e inteligentes de la carrera. Sabe mucho de historia del derecho, redacción jurídica y derecho fiscal que es su especialidad. La 2da ocasión que llevé la materia en verdad le eché ganas y aprendí muchisimo. considero que tengo buena redaccion y la verdad gran parte de eso es por esa clase. es buena gente y comprensiva. en el examen final que fue una tesina o monografia (de la segunda vez que lalleve) se me borro la parte final del trabajo una hora antes de entregarlo...le hable para explicarle lo que me paso y con todo y mis antecedentes me dijo que eso podia pasarle a cualquiera y que no habia problema que tratara de terminar y me calficaria tomando en cuenta mi situacion. al final de cuentas me puso 80 en el trabajo y pase con 85','NA','','2008-01-17 03:56:26',0),(3933,89,473,'8','jaja el comentario anterior la regue y puse materia ciencias de la vida','NA','','2008-01-17 03:58:15',0),(3934,143,716,'10','Es la mejor maestra y persona que puede tener todo el departamento de matematicas y el tec, por algo es la directora del depto. Se preocupa por sus alumnos y es muy accesible para que te ayude, da hasta 15 punts extra x parcial, es IMPOSIBLE reprobar con ella. si podria meter todas las clases con ella lo haría.. t dan hasta ganas de llevar  mate 3 si se pudiera con ella, de lo buena que es en su trabajo.','NA','','2008-01-17 03:59:35',0),(3935,868,728,'9','Para materiales de construcción es mui bueno, sabe de lo que habla, te hace interesante la clase, si falta por alguna razon te avisa antes jajaja asi ke revisa tus mails, aunke los examenes stan medio confusos no te va mal si pones atencion, al final te da como 10 puntos extra si le enseñas tus notas de todo el semestre completas aunke nadamas las hojea igual te da los puntos.','nt','189.154.86.215','2008-01-17 04:05:25',0),(3936,27,205,'10','Al principio me metieron miedo de este maestro, pero cuando vas a clases t das cuenta que es super buena gente y explica demasiado bien y el mismo te dice lo que tienes q hacer para pasar.. NO LA DES DE BAJA si sacas 20, 30 o 50 en los parciales pero que el si vea q le hechaste ganas, fuiste a clase y hiciste buen trabajo final pq t pasa cn 70. Sus examenes son muy parecidos a los parciales de otros semestres y t cuenta mas procedimiento q respuesta. Muy bueno','NA','','2008-01-17 04:11:45',0),(3937,353,751,'1','NUNCA LA METAN CON EL!!!.. es un profeso super grosero!!... y mamon sobre todo!!!.. no acepta cuando se ekivoka!... si no haces las kosas como el kiere, kasi kreo ke te hace la vida imposible!!!... se los diga por experiencia!... y sobre todo kree ke te hace un favor al subirte la calificacion!.. cuando la verdad era lo justo!!.. aburridisssssssssssssssima su clase!!... gracias a el.. ODIO la mercadotecnia!!!!...\r\n\r\ny le pongo 1 porke no le puedo poner -10000000000000000000000000!!!!!!!!!!!!','NA','','2008-01-17 11:48:56',0),(3938,280,850,'1','FLOJERA TOTAL!!... siempre hay tareas y aunque en la clase te juntes con tu ekipo... no explica nada!.. osea se supone ke si tienes dudas cuando estas con tu ekipo entre ustedes se ayudan o ya definitvamente van y le preguntan a el y te sale con una cosa ke nada ke ver!!... los examenes no estan faciles, al contrario estan confusos!','NA','','2008-01-17 12:25:39',0),(3939,38,851,'8','Este wey en la clase es un reba....... parece un wevo kinder...... si solo te interesa pasar metela con el....los examenes tipo que pone en blackboard son iguales .... y puedes copiarte al 100%.. aparte deja usar laptop y apuntes en los examenes.... encarga unas cuantas tareas k no tienen k ver con la materia en el semestre  y son puntos extras para cada parcial.....el final no es departamental... ...el unico problema es que no vas a entender nada, no explica bien... tienes que estudiarle tu solo para entender... pero consiguete a alguien que te lo pase y aunque se de cuenta que te copiaste no te dice nada......','NA','','2008-01-17 23:54:02',629642712),(3940,188,954,'9','te da miedoo, en la primer clase se aprende tu nombre, de do