',0),(3949,533,496,'10','La mejor maestra que he conocido, la verdad, es la clase de profesores que hacen que te cambies a su carrera de tanto que te gusta, aparte es de esas profesoras que aman lo que hacen, por lo tanto en ningun momento vas a verla enojada o abrumada, da super bien la clase, si te duermes es porque enverda tienes problemas porque hace de conta una materia aburrida super bien. Su lema es:\"No es magia es Contabilidad\" jajajja pero no la verdad lucha por meterla con ella, se que se va a acabar pronto el cupo de sus clases, luego te ayuda un chorro si te interesa su clase, si nota que enverdad no se te da la conta pero le echas ganas, lo toma en cuenta. Total es muy buena, P.D no es Barco si es lo que estas buscando pero es una maestra que te va a meter la conta awebo si no sales sabiendo conta es porque no eres muy inteligente que digamos.','Rodrigo InclÃ¡n CÃ¡rdenas','','2008-01-19 06:13:36',0),(3950,631,243,'10','Muy buena maestra explica super bien, es muy paciente, se nota que sabes, si tienes dudas sobre algun problema puedes acudir a ella es la clase de profesores que le entiendes a la primera sus examenes son algo dificiles pero si apuntas y estudias de ahi no necesitas mas, las clases son interesantes no te aburris y te situa muy bien los problemas exelente maestra.','NA','','2008-01-19 06:17:46',0),(3951,89,473,'8','la amooo, jaja la vdd sus examenes son pesimos pero siempre saca otro tema en clase','NA','','2008-01-19 10:57:36',507281441),(3952,836,496,'10','EXCELENTE!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!','NA','','2008-01-20 04:15:06',0),(3953,296,88,'10','dejense de mamadas, jimmy es la ley, es otro pedo, jimmy de vdd te hace la vida mas feliz','adrian','','2008-01-20 04:23:27',505877401),(3954,119,464,'9','Muy Buena maestra, de las mejorcitas (os) que me ha tocado en lo que llevo de mi carrera. Los exámenes están fáciles, pero tienes que leer, y echándole mucho rollo ya la hiciste. Es algo especial para calificar pero a fuerza te sacas arriba de 90 y los flojos arriba de 80.','NA','','2008-01-20 06:15:24',0),(3955,590,678,'1','La clase no está mal, te entrietienes y todo, él es el problema, es demasiado mamón y se encabrona muy fácilmente. Es muy sarcástico pero su humor es muy pesado, claro que te ríes con sus anécdotas, en las cuales nunca faltan comentarios racistas, discriminativos y misóginos. La verdad es un asco de persona y se ve lo amargado que está, métela con alguien más si puedes.','NA','','2008-01-20 06:20:27',0),(3956,547,187,'8','Su clase es una WEBAAAA, weba total, pero sirve para dormir, estudiar y hacer tareas que te falten de otras materias. Sus exámenes son para llevar pero son PESADISISÍSMOS, son ensayos de como 5 hojas cada uno de las lecturas que tienes que leer a fuerza. Como quiera fácil terminas con un 95 de promedio,en ese aspecto es recomendable, así que si te gusta partirtela unos dias antes de cada parcial métela con el. ','NA','','2008-01-20 06:26:53',0),(3957,395,850,'9','BARCA de las barcas, si quieres sacar buena calificación (80s)  o por lo menos pasar en una materia demandante y algo complicada MÉTELA CON ELLA. No haces casi nada, pero si le entiendes, llega tardísimo a veces como 30min. después, sus exámenes si están complicadillos pero si estudiasta fácil pasas, y lo mejor es que da como 10 o 15 puntos extra cada parcial.\r\nEso sí sacar arriba de 90 si está difícil, pero para ser Micro, está conmadre.','NA','','2008-01-20 06:33:27',0),(3958,662,980,'9','Es una lindura de maestra.Si es algo porn y demás, ya que nunca faltan sus comentarios picantes, pero es muy buena, y respetuosa. Su clase está equiz, te aburres unas veces pero otras te mantiene despierto e interesado.Encarga pocas tareas y SIEMPRE pone 100 aunque valen poco en el parcial. Los exámenes están bien, aunque si medio confusos, eso sí de final es fácil sacar arriba de 90 o por lo menos de 85, por haber hecho casi nada. ','NA','','2008-01-20 06:38:49',0),(3959,479,578,'8','Es como una maestra de prepa. 