o son pesadas...da puntos extras por todoo y si no faltas tambien te da como 5 o 6 puntos sobre el final...estoy casi 100% que nadie truena con el..si pasas todos los parciales con 70 y el final te ayuda un buennnnnn igual con los trabajos finales...pero si debes de estudiar...los examenes tan faciles y te ayudan a estudiar para el final.ya que son las mismas perguntas ...','NA','','2008-02-10 00:17:34',618480503),(4024,507,5,'10','Excelente maestro, como dicen otro comments es super divertido, mega fresa y su clase es amena, fácil y las tareas son tienen mucha complicación. Los examenes son siempre de lo visto en clase pero no puedes basarte solo en las presentaciones. ','Daniel ','','2008-02-10 12:10:43',0),(4025,625,723,'8','Es bueno para explicar, en verano las 2 horas de clase se te pasan rápido porque trata de hacer la clase amena con sus chistes y comentarios sobre Cuba. Claro que si ya llevaste una clase antes con él te aburres un poco porque siempre son los mismos chistes. Se los recomiendo, sus examenes son de término medio y hasta en parejas.','DG','','2008-02-10 12:13:35',0),(4026,625,726,'8','Es buen profe, dice muchos chistes aunque a veces muy tontos. En general su clase es buena, y sus examenes no son complicados. ','DG','','2008-02-10 12:14:44',0),(4027,580,722,'5','Fatal, pierde el tiempo explicándote la historia y vida de cada derivada y no te explica como resolverlas. Los examens son difíciles por la misma falta de enseñanza. No lo recomiendo para nada.','DG','','2008-02-10 12:16:19',0),(4028,31,1050,'8','Es super elitista, ama a la gente de san pedro apesar de que él no vive ahí, na veces hace comentarios muy pesados, pero en general es bueno para calificar que es lo importante.','DG','','2008-02-10 12:19:18',0),(4029,28,713,'9','ExcelenteEe, super buena para explicar, sus examenes son de término medio, siempre deja tareas y tienes que leer antes de ir a la clase, hace exámenes rápidos pero son sencillos. ','DG','','2008-02-10 12:21:25',0),(4030,224,396,'8','Es un maestro barco, es algo malo para exlicar pero en los exámenes hace curva, al final no te ayuda a pasar aunque te hayas quedado con 69.','DG','','2008-02-10 12:23:06',0),(4031,832,851,'8','Esta maestra es algo barco, los exámenes te los da para hacer en casa, te deja una tarea por cada capítulo y la verdad están algo difíciles, pero si no las haces no te afecta mucho en la calificación (eso me pasó a mí); te da un resumen de cada capítulo y en la clase sólo se la pasa leyendo el resumen. Sinceramente es bastante aburrida su clase, pero con ella es fácil pasar esta materia que es realmente difícil.','DG','','2008-02-10 12:34:56',0),(4032,298,435,'10','Excelente profesora, un amor... completamente!!... \r\nexplica super bien, tiene mucha paciencia, te ayuda, en fin si no metes clases con ella mejor ni vayas al tec...\r\n','NA','','2008-02-10 12:35:31',613640429),(4033,486,813,'8','Sus examenes están algo complicados, sin embargo él es una persona bastante divertida en la clase, se te pasa rápido la hora y si te ayuda un pco con las calificaciones. ','DG','','2008-02-10 12:42:02',0),(4034,519,265,'10','super linda maestra!! explica muy bien, se apasiona con su clase...\r\ny además es la maestra que mejor se viste en el tec... siempre a la moda... \r\ny ahora es la mamá lad!...','NA','','2008-02-10 12:43:33',613640429),(4035,384,207,'8','Es bastante buena para explicar, deja una tarea de cada capítulo visto y si la entregas ya tienes los puntos aunque está equivocada. Sus examenes son de opción múltiple y son relativamente sencillos. Al final te pone un proyecto que en mi caso fue desarrollar un sistema contable, algo tedioso pero no tan complicado. ','DG','','2008-02-10 12:44:15',0),(4036,519,543,'8','Es una persona bastante amable, explica bien sin embargo se la pasa hablando de su proyecto en carnegie-mellon. en ocasiones sus laboratorios son algo complicados pero nada que no puedas realizar con un poco de esfuerzo. Sus exámenes son de opción múltiple, aunque no precisamente fáciles. El libro está en inglés así que muchas veces te da flojera leerlo. El trabajo final es de weba, tienes que desarrollar una página web y tienes que hacer demasiadas cosas para lograrlo.','DG','','2008-02-10 12:47:48',0),(4037,522,730,'10','... exacto está buenisisima ... como para sólo ir a verla sin escuchar nada! ','NA','','2008-02-10 12:47:48',613640429),(4038,62,866,'8','Ella es una persona divertida, bromea con los alumnos, siempre usa sus filminas para explicar, pero lo hace muy bien. Sus exámenes son de opción múltiple y muchas veces tiene trampa. Al final de cada examen tienes que desarrollar una porción de código, que muchas veces es lo más complicado. En semestre regular sus exámenes no son sobre 120 ó 110, vaya lo más que obtienes es un 100. Si es cierto que da puntos extra por hacer programas de la ACM. En general te diviertes en la clase aunque es tediosa para los que somos LATI y que no nos gusta la programación. ','DG','','2008-02-10 12:52:25',0),(4039,720,951,'9','Es un profe agradable, nativo de los EEUU. Te deja sólo una tarea por semana, pero generalmente está larga. En sus parciales tienes que escribir un ensayo, y resolver un examen de opción múltiple a los que les agrega 3 preguntas para puntos extra. Cada parcial también tienes que tener un pen pal y llevarle las cartas que has recivido. Se trabaja en parejas dentro de la clase lo que hace más divertida la misma. Cada viernes es día de película, durante todo el mes te pone cada viernes una fracción de película (muy vieja) y te pregunta cosas d ella en el examen. ','DG','','2008-02-10 12:56:45',0),(4040,755,122,'9','Muy buena maestra! Para los que son industriales o mecanicos o asi, que metieron biologia en el programa nuevol ,a verdad recomendaria que la llevaran el linea pero si no, metanla con ella....es muy buena maestra, muy atenta, no esta papita, digo si teiens que poner atencion y en los parciales estudiarle mas o menos, pero al final vez que te va mejor porque da puntos extras....','NA','','2008-02-11 06:35:46',0),(4041,354,722,'7','barquisimo pero de flojera....te deja sacar notas, compu, TI y hasta te puedes copiar en los parciales....pero esta aburridisima su clase...namas habla todo el tiempo como robot y con sus formas raras de enseñar, al final no aprendes nada porque ni lo pelas en todo el semestre....si quieres preguntar o hacer un comentario, te hace ver como un tonto....barco, sin tareas, pero no aprendes y esta aburridismo...','NA','','2008-02-11 06:38:58',0),(4042,442,934,'8','Muy buena maestra. No es perra, no es barca. Simple y sencilllamente tienes que ir a todas las clases, poner atencion la hora completa, tomar notas, y hacer las tareas (1 cada dos semanas maximo)...los examenes estan faciles si haces todo esto...','NA','','2008-02-11 06:41:00',0),(4043,630,726,'1','la vdd no la recomiendo para nda es super favoritista yy ni explca bn supone k iaa eress super xprto en mate y todo.. la vd iioo reprove cn ella . es sierto k regala millones d puntos pro sus examens stan b perro iaa saven no la metan cn ella','NA','','2008-02-11 10:56:07',0),(4044,701,279,'10','buen maestro, sus clases aunque un poco aburridas, son lo unico que necesitas para tener una buena calificacion en los examenes. Da puntos muy a seguido. El programa que te asignan en el laboratorio es el ProE, un poco complicado al principio pero ya que le agarras es facil','NA','','2008-02-11 11:44:32',0),(4045,341,397,'8','Buen maestro, sabe explicar y puedes llevarte muy bien con el. Muchos dicen que fisica 2 es la mas facil, pero con este profe no lo es. El final es una groseria, te asustas con solo verlo, asi que te debe ir bien en todo lo demas para que no te lleves una gran sopresa o decepcion cuando mande las calificaciones por BB','NA','','2008-02-11 11:48:42',0),(4046,36,396,'8','Este profe da todas las fisicas. Muy buen profesor ensena bien y te explica con ejemplos para que aprendas mas facil, los examenes no son tan dificiles y