stante bien.','NA','','2008-02-14 03:04:20',0),(4062,209,786,'9','Es un profesor que sabe un chorro, de esos profesores que te marcan la vida, con  nuestro salon se porto super chido, no reprobo nadie y eso que eramos bien poquito, trata de hacer un buen trabajo final y con eso mas que suficiente para que antes de presentar el final ya este pasando con el acumulado. Un punto super importante es que es el autor de libro y para que te lo ganes, compralo y pidele que te lo firme. Los examens es cierto que estan dificiles pero la verdad valen super poquito asi es que no afectan tanto, lo que valen son las presentaciones y el trabajo final, que no son nada faciles pero si te da asesorias para hacerlos y toda la cosa. Aunque los casos que te toque exponer casi nadie da la respeusta a la problematica, y el se enoje por lo mismo, en realidad pone buenas calificaciones.','NA','','2008-02-14 03:12:40',0),(4063,569,726,'10','De lo mejor esta profe','NA','','2008-02-14 05:25:53',688181591),(4064,420,396,'10','Este señor es un Dios','NA','','2008-02-14 08:33:52',772690060),(4065,686,435,'10','Excelente maestra, muy atenta en su trato, si no se entiende bien el tema se regresa. Explica muy bien, muy buena persona. Si de plano te va mal es porque eres un pendejo.','NA','','2008-02-14 08:35:43',772690060),(4066,28,713,'9','Excelente maestra, explica muy bien aunque va un poco rápido a veces y sus examenes no soy difíciles, lo visto en clase nadamas. Algunos días pone actividades y al terminar te puedes ir.','NA','','2008-02-14 08:38:28',772690060),(4067,259,496,'9','Pues la neta este maestro si explica bien, hay que ir a todas las clases porque si faltas te lleva la madre, lo que se ve en el examen es lo que se ve en clase. Es demasiado parco, muy serio y ni de pedo te regala 1 punto.','NA','','2008-02-14 08:40:47',772690060),(4068,160,1032,'9','la neta si te la sabes llevar bien con este profee esta super ligera la clase y mas si cosnsiges los parciales ya que los presentas en lin