.en lo personal no vuelvo a meter nada con el es perdida de tiempo.','NA','','2008-04-05 03:14:02',0),(4161,464,1050,'2','Esta maestra se le olvida todo, exige demasiado para lo que enseña, sus clases son muy molestas y la tarea es demasiada. A veces dice una que alguna otra estupidez que da risa, pero eso es uno en un millon. A veces te esfuerzas y te pone que esta mal, a veces lo hace a las carreras y dice que esta excelente.','NA','','2008-04-05 18:35:27',551035738),(4162,497,447,'10','Excelente maestra, muy buena persona, casi siempre pone 100 pero no por barco, sino porque enseña muy bien y aprendes bastante.. metan todo lo que puedan con ella..','NA','','2008-04-09 01:23:12',0),(4163,437,324,'5','No deja muchas tareas, y en clase explica bien, el unico problema es q sus tareas son de autoestudio, y en asesorias nunka te ayuda! .... al igual que en los proyectos ..... pierdes mucho tiempo investigando q es lo q quiere y como hacerlo.\r\nA la hr de calificar es medio mamon pero si vas y le reclamas te sube puntos ...... Sus laboratorios apestan! siempre se traban y en si no te preparan para nada para poder realizar los proyectos. Generalmente no lo recomiendo!','NA','201.172.203.200','2008-04-09 09:50:52',0),(4164,560,958,'10','Jajajaja se pasaron con la foto!!!! .......... bueno este profe es poka madre!!!! no es tan barco ni tan perro, siempre da una guia especifica para los examenes ..... leyendo eso pasas super bien, aparte de q generalmente hace curvas .............. te lo puedes ganar super facil ............. con q te vea q le pones atencion ya te lo ganaste ........................ es una clase muy amena!!!!\r\n\r\nLo recomiendo mucho!','NA','201.172.203.200','2008-04-09 09:57:02',0),(4165,346,693,'10','Excelente maestro, la clase siempre esta relajada y enseña bien.. recomendado 100 %','NA','','2008-04-10 00:35:35',0),(4166,26,707,'1','Clase aburrida, solo pasa slides y muhcas veces no contesta las preguntas hasta que alguien mas da una idea y entonces 