n y coherencia lo que dicen sus lecturas.\r\n- No quieres comprar 2 megamanuales con 1000 lecturas enormes cada una que al final ni lees.\r\n- SI NO HAS LLEVADO  TUS CURSOS DE MACRO O DEL PENSAMIENTO ECONOMICO.\r\n- NO SABES EXCEL.\r\n¿porqué?\r\nel profe habla y habla de sus lecturas.. en el rato te cuenta historias de sus viajes y hasta chistes.... YA EN EL 3er parcial cuando de plano piensas echar la webaa, comienza a resolver unos problemillas en la compu, usando excel  CUIDADOO! COMIENZA A PONER ATENCION.... piensas que no vendran ??? los va a poner.. asi que checa el dato de como los  hace.... ESO SI.... LO MASS ****GRACIOSO ES QUE  SI LE PREGUNTAS..\r\n¿PROFE, COMO SACAMOS LA TASA DE NO SE QUE ?\r\nel profe te dice...\r\nPUES COMO SIEMPRE !!!! ................ Y tu te quedas de ¿¿¿¿\r\ntu te esperas que repita el procedimiento.. pero en su cabeza... piensa que ya todo lo sabemos....\r\nSE LA PASA MENCIONANDO..... \" COMO YA VIERON EN SUS CURSOS DE MACROECONOMÍA O HISTORIA DEL PENSAMIENTO ECONÓMICO..\"   pero PROFE.. ESAS MATERIAS POR LO GENERAL SON DE 3 ER SEMESTRE  Y TU  VAS EN 2DO : :S....\r\n\r\nla verdad es muy chido y sabe mucho pero pues piensalo bien.','NA','','2008-04-16 03:14:08',0),(4178,160,1032,'10','Es buenismos este profe... esos que dicen que la materia es de relleno... el te hace desquitar peso por peso lo que pagaste por la materia. Ense;a super bien! te explica todo muy claro sus lecturas son muy interesantes por que la mayoria NO son del aburrido libro y al final aprendes 1 sin fin de cosas que en realidad debes de saber para poder opinar en cualquier charla politica o social...si lees pero vale la pena... no te auguro el 100 por los examenes en linea que te confunden un poco pero entre 88 y 95 si la haces con participacion.','Lizbeth Daniela Resendiz Castro','','2008-04-16 06:13:18',0),(4179,893,253,'10','Es buenísimo! Es el mejor profesor que he tenido, por lo menos en derecho. Su clase es divertida y se te pasa super rápido. Yo sí lo recomiendo.\r\n\r\nPD: Ni está panzón, ni da clases de Derecho Internacional. ','Camargo','148.241.190.43','2008-04-16 07:36:51',0),(4180,503,771,'1','Pesimo maestro! El pero maestro que he tenido en mi vida! Te pone a hacer resumenes, preguntas y laboratorio de cada uno de los capitulos que vez en clase. Sabe mucho pero no se da a entender. Impone miedo y es un grosero prepotente. Te pone a repetir \"soy un peloton\" y no hace mas que insultar a los alumnos. NUNCA la metan con el!','NA','','2008-04-16 08:41:14',504525807),(4181,630,726,'10','netaaa ke si super wena maestraa yo ame a esa maestra!!! en la revisión final me decía ke me había puesto wenas por compasión jajajaja nombree peroo sii neta la mejor opción en mate remedial!!! yo entré con miedocon ella y fué lo mejor ke me pudo haber pasado!! jaja siempreee llega feliz!!! así ke uff nombree y puess en la clase tmb te la pasas hablando... eso sí para salir bien mb tienes ke poner atención..las kosas no se dan tan fáciles porke si ubo unos chavos ke reprobaron..peroo uff wenísima maestra en serio!!! de las mejores opciones!!','NA','','2008-04-17 09:57:47',502581976),(4182,200,932,'10','Estoy enamorado de eia!! es lo mejor métanla con eia jajaja. Super buena explicando, siempre de buen humor, y aprendes muy bien con ella.','Rafael Salazar','','2008-04-17 20:11:11',0),(4183,566,402,'4','No es buena opción, definitivamente hay mejores, mucho mejores. Por lo general llega tarde y a veces no llega, no explica naaaadaa bien, porque te confunfe mucho,yi lo que te llega a explicar bien a veces ni en el examen viene.. \r\nEs un poco perra en los examenes, pero en general eso equis. Pero si la pueden meter con alguien más, haganlo. De suerte pase con 70, porque hasta eso, de suerte logre pasar, pero aprendí fisica en asesoría con otros maestros. ','NA','','2008-04-18 08:48:30',0),(4184,201,668,'7','q weba de vieja','NA','','2008-04-18 11:22:41',0),(4185,469,521,'4','no no no de lo peor que he tenido en ingles, clases aburridas, te exige un chorro, tus essays tienen que estar PERFECTOS si no son una basura.... la verdad no la recomiendo mucho, batallas un chorro....... recuerdo que en el primer parcial mas de la mitad reprobo, solo pasamos como 10 y lo mas alto fue 88','NA','','2008-04-19 01:55:26',0),(4186,227,751,'10','Es el profe mas lindo que hay, si es medio estricto con las tareas pero nada del otro mundo casi todas son en equipo, la clase es bien chida, se la pasa hablando de don crecencio un señor que tiene una tiendita y mas que estudiar del libro hay que poner atencion en lo que dice en clase, en resumen metanla con el da asesorias en centrales jejeje','NA','207.248.44.241','2008-04-19 04:59:11',0),(4187,643,957,'10','es la neta el profe... yo panze pero porque leia todo un dia antes del examen ... si lees todos los dias te va a ir con madre... bien chido el profe...','gera galindo','','2008-04-20 01:53:03',0),(4188,354,723,'2','Prefesor chistoso que se la pasa hablando de él y de su familia. Metí con él el semestre pasado y la verdad fue una weba machín. Porque se desvíaba del curso original, y enseñaba su propio material, es más, envés de blackboard, tenía su propia página con sus propias tareas y temas en otro lado, y obviamente, si estudias pasas, pero almenos con mi grupo jamás dejó que sacaramos laptops ni TIs, en especial porque él mismo, todo el curso quería probarnos que las TIs no jalaban.\r\n\r\nAparte de que mate para ingeniería 2 es una materia difícil, el complicaba los cosas enseñando mal, o en pocas palabras: Nó logrando que se nos facilitara el aprendizaje, tratando de que nosotros lo hiciéramos tal y como él lo hace.\r\n\r\nSi se te pasaba hacer un paso a como él le gustaban hacer las cosas (y esto lo digo para los que venimos de prepas tec, donde ya aprendimos como hacer las integrales) te bajaba como mil puntos, es más, al ver que no seguías su forma metodica, aseguraba que tu respuesta estaba mal.\r\n\r\nLa pasas bien en su clase por que te hace reir... p