ro buen profesor... si no le pones nombre a una tarea no t toma nisiquiera la mitad d los puntos... los quizes estan super dificiles y siempre por eso nos iba super mal a toodos.. las asesorias para que t explique algo del labo cuando vas a tener exam son \"vaya y cheque sus apuntes\" ah y claro q no da puntos en los examenes por procedimiento... no recomendable','NA','','2008-04-25 07:52:43',612375436),(4202,503,771,'7','A ver... este profe cero barco... aunque si haces presentaciones t da diez puntos... a veces anda d malas y nos dice a todos q somos unos estupidos pelotones y flojos... tienes q hacer todos y cada uno d los labos por cuenta propia.. pk si no.. esta cañon q pases... nunca toma lista pero siempre se acuerda si faltas... es grosero... no siempre... pero si... ah, y si le caes bien incluso t dice q el t ayuda solo q vayas a su oficina... tienes q hacer resumen d cada capitulo y las preguntas... sus examenes pues... estan confusos aunque pone mucho d los ejemplos d la clase.. seamos realistas.. si no t gusta trabajar... no la metas con el pk tienes q leer todos los capitulos.','NA','','2008-04-25 08:03:32',612375436),(4203,277,396,'9','Es un buen maestro ke se la pasa haciendo chistes bien secos. Sabe lo ke enseña y si el grupo se porta chido con el y es cumplido el se pone medio barco, pero si el grupo la caga y empieza a faltar y asi se empieza a poner perro. De repe se ve cabron pero si es alivianado, los examenes estan medio dificiles pero es namas de memorizar las formulas porke el las pondra como si ya las supieras.','NA','','2008-04-25 08:04:53',515621356),(4204,652,1105,'9',' Es muy buena enseñando, sin olvidar que en el Tec la mayoría del aprendizaje corre por tu cuenta. Es verdad que es voluble y cuando llega de malas no te va muy bien. En general es buena, aunque puedes tener complicaciones a la hora del final.','NA','','2008-04-25 09:10:56',0),(4205,220,385,'10','METANLA CON EL, es super alivianado, te da puntos extra si sacas 85 en los parciales no presentas en el final, explica bien y los examenes aunq estan un poco largos los acabas rapido porq estan faciles!','NA','','2008-04-25 09:19:37',548512604),(4206,643,957,'2','No sabe explicar bien, asume que ya sabemos de lo está hablando y piensa que su trabajo solo es recoerdarnos lo que se ve en Redes 1 cuando ni siquiera sabemos que es eso... Se altera luego luego cuando le preguntas algo (yo creo k es por el exceso de café que toma al día) además no se si lo han notado pero tiene un complejp de superioridad, con eso de que tiene poster enormes de Hiron Man...\r\nLa verdad no les recomiendo que inscriban clase con el,','Ygriegas Norte','','2008-04-28 02:16:45',0),(4207,230,396,'1','Un pesimo maestro, siempre te confunde en clase porque te explica con los problemas mas dificiles, ademas de que sea super barco no te salva, el promedio de los examenes anda por los cuarentaitantos','NA','','2008-04-28 07:11:54',0),(4208,220,385,'10','La mamadaa este profe,, buena onda,, alivianadoo.. da las clases bien,, puedes tirar madriadaa ,,obviamente sin pasartee y poniendo atencion en su clasee ... los examenes son tranquiloones y si te quieres copiar se puedee.. te da puntos por todo... y te deja salir tempranoo.. aparte de todo esoo sabee de lo q habla y cualquier duda o pregunta siempre te ayuda.. muy buen profee,, metanla con el ya ! ','NA','','2008-04-28 10:16:57',0),(4209,793,42,'9','Muy Buen Maestro y explica de manera interesante. Ves peliculas, lecturas y un poco de teoria. Sus examenes super bien la vdd no esta muy dificil y aprendes bien con el. si lo recomiendo','NA','','2008-04-28 17:59:09',502595939),(4210,175,402,'8','A pesar de que lo critican mucho, es muy buen maestro, nada mas tienes que agarrarle la onda y hacer los ejercicios tu solo, explica paso a paso, pero su voz si te duerme','NA','','2008-04-28 20:49:08',0),(4211,230,4,'2','aa','NA','63.102.70.70','2008-04-29 00:56:13',0),(4212,685,1008,'4','La verdad es una maestra muy perra. nunca da as