iados aires. No aprendes nada.','NA','','2008-05-04 23:46:51',512978921),(4239,213,5,'5','Muy mal maestro, solo lee las slides y de repente se pone a hablar de otras cosas. Todo el examen es del libro y no se preocupa por explicar bien los temas. Este maestro solo es para que estudies individualmente y talvez te respondera dudas.','NA','','2008-05-04 23:50:09',512978921),(4240,512,496,'10','Excelente maestra! Es algo estricta con las tareas y respecto al comportamiento del grupo, pero realmente aprendes. Si eres aplicado te regala puntos extras y es muy accesible. Es una maestra que te hace entender la materia, pero tienes que ser inteligente y poner atencion.','NA','','2008-05-04 23:52:23',512978921),(4241,143,715,'10','Excelente maestra. Sabe explicar su materia. Es muy accesible, te deja entregar las tareas al otro dia, aunque sobre base 80. Es algo estricta pero muy inteligente. Usas mucho el libro pero te da mucha facilidad con las asesorias. No tienes porque reprobar con ella, a menos que seas pesimo en matematicas.','NA','','2008-05-04 23:54:45',512978921),(4242,234,522,'9','Muy buena maestra, es linda y trata de hacer amena la clase. Sabe mucho de la materia y sus examenes son ni dificiles ni faciles. Lo malo es que encarga mucha tarea aunque no siempre la checa.','NA','','2008-05-04 23:57:05',512978921),(4243,878,5,'10','excelente maestra, es exigente pero normal, siempre deja tareas y hay quizzes seguido, pero la materia es super facil con ella, explica super bien... ','NA','','2008-05-05 00:39:18',0),(4244,767,833,'5','Barco Barco Barco Barco!\r\n1. Pasas la materia tranquilamente (mucha mafia, facil copia y pocas clases)\r\n2. Aprendes NADA','NA','','2008-05-05 01:03:10',506392013),(4245,249,1149,'9','la maestra sabe muchisimo sobre la materia, ella se dedica a eso y es muy buena. por esto mismo te exige mucho en la clase, en las tareas y en su proyecto final. puedes aspirar un 95 si estas todo el semestre atento a la materia y haciendo todo lo ke encarga. facilmente truenas si te vale.\r\nlo malo es que hay varias maestros barcos que dan la clase y te aguita escuchar a otros que la pasan facil.\r\n\r\nmetela si quieres aprender. materia dirigida a la consultoria','NA','','2008-05-05 01:11:31',506392013),(4246,619,668,'10','excelente profe para esta materia. la llevas muy trankilo, tirando puro 100. se mete mucho en la materia y espera minimo que estes atento a la clase, que no le faltes al respeto y no te quejes. llevate bien con el y no tendras problemas.\r\n\r\nmuuy recomendado!','NA','','2008-05-05 01:16:37',506392013),(4247,685,1008,'10','no estoy de acuerdo con los comentarios de aqui por eso pongo el mio\r\n\r\nla maestra es buena y conoce bien el tema. \r\n1. es cierto eso que encarga tareas cada clase pero... esta el pdf\r\n2. es cierto que hay dos tipos de examenes pero.. 1 de ellos esta en la mafia y el otro tipo incluye los temas que no estan en el que todos tienen\r\n\r\nla vdd esta materia la puedes pasar bien si no faltas y estas atento en clase.. explica bien y al final del semestre si aprendes..  me toco excentar el final por tener arriba de 90 en el promedio de los 3 parciales (no mencionen esto durante el semestre) en mi salon excentaron como 10 personas asi que si se puede\r\n\r\nse las recomiendo!','NA','','2008-05-05 01:25:56',506392013),(4248,585,1138,'7','es barquillo este wei aunque creo que si hay raza ke truena. \r\n\r\nno me gusto como explica este wei. derrepente la riega en unas que otras cosas. no es el mejor para dar la clase. tiene excelentes estudios i la madre pero para esta como ke no me gusto tanto. \r\nel profe es de las personas que son tan buenas que hasta se los hacen mensos... siempre te da la razon. \r\n\r\nalgunos puntos:\r\n1. siempre toma lista y al principio\r\n2. examenes facilones y segun el son diferentes tipos pero todos son iguales y te puedes copiar facil por lo mismo que es tan bueno el wei\r\n3. muy poca tarea\r\n4. aprendes mas o menos\r\n\r\nsi quieren aprender mas o menillos y pasarla bien esta es su opcion','NA','','2008-05-05 01:37:25',506392013),(4249,191,361,'1','da una clase de lo mas tediosa que puedes imaginarte.. habla de lo mas rebuscado... utiliza todas las palabras domingueras... eso si ... sabe un buen de la materia, pero el problema es ke es un envidioso hijo de puta que no kiere ke nadie mas sepa, en el cubiculo te trata de la fregada, no entiendo para ke te hace ir si comoquiera es lo mismo... pesimo maestro la verdad','NA','','2008-05-05 09:38:27',678617281),(4250,437,324,'1','muy mal maestro, muy prepotente, no sabe explicar pero nada, se la pasa hablando de teoria durante todo el parcial, llega el examen y adios promedio. cuando le quieres preguntar algo, siempre pone su cara de ma#$% y te dice que no sabe. yo le pondría un cero pero pos la calificación mas baja es 1. ','NA','','2008-05-06 18:24:34',571010415),(4251,127,179,'1','No te regala ni un punto. Los exámenes son complicados y muy largos. Con esto les digo todo... En el tercer parcial todos reprobaron!!!\r\n','NA','','2008-05-07 01:37:10',0),(4252,587,726,'10','Excelente profesor!!!\r\nNi tan barco, ni tan exigente.\r\nTiende a faltar a clases los viernes.\r\nSi quieres pasar la materia metela con é!!','NA','','2008-05-07 01:39:26',0),(4253,803,213,'10','es muy mal maestro no aprendes nada, pero si loq ue quieres es pasar y sacar buena calificacion, es lo que necesitas. ','IA','','2008-05-07 01:52:16',0),(4254,334,52,'10','excelente profesor, te regala 10 puntos en el primer parcial que es el mas dificil y los otros dos parciales son la cosa mas facil del mundo, te pone exactamente lo mismo que ves en clase, ademas te regala 2 o 3 puntos\r\nsi tienes promedio de 90 en los parciales te excenta del final\r\neso si hagan todas las tareas\r\ndefinitivamente es la opcion','NA','','2008-05-07 05:29:58',0),(4255,307,1040,'9','Este profe cae de lo mejor...lo unico malo es que reparte entre 80 y 100 al azar ajaja, pero no importa, trata de destacar de los demas en la clase y te ira bien','NA','','2008-05-07 07:07:08',0),(4256,570,726,'1','EL PEOOR DE TODOOS K AHCE EN EL TEC EL Y SUS CHISTES DE MAL GUSTO Y BURLANDOSE SIEMPRE DE LOS ALUMNOS.... SEGUN EL BUENA ONDA PERO ES UN PERROO NO LA METAN CON EL ES LO PEOOR Y SIEMPRE ENCARGA TAREAAS Y NO LAS REVISAA LO PEOOR','NA','','2008-05-07 08:44:36',0),(4257,491,87,'10','Lo mejor de profee terminas queriendoloo.. aprendes pke aprendees...\r\nsu emtodo para enseñar esta super bien solo que ai k hacer siempre las tareas y estudiar muyy bien profee','NA','','2008-05-07 08:48:20',0),(4258,771,432,'10','Que se puede decir de Celina, es una maestra pkm, no solo es super inteligente y con una vida interesante, sino que es muy buena persona, divertida y medio despistada, todo en beneficio de una clase buena y amena.\r\n\r\nLos examenes los hace super sencillos, de modo que no sacas menos de 85, pero no dejes de hacer sus trabajos, que ayudan bastante. Todas sus presentaciones son de power point y sus ejercicios, aunque son pocos, te hacen usar conocimientos que ella te ha dado y que realmente ni te imaginas que se te hayan grabado. Mi mejor maestra del semestre','Juan Castro','','2008-05-07 10:35:29',0),(4259,757,527,'10','Buena maestra, clase sencilla, generalmente hacemos algunas actividades en clase y nos deja salir entre 10 y 15 minutos antes de la hora, así que te relaja un poco y en su clase de las 12 te permite llegar a centrales a tiempo; sus actividades son sencillas y sus quiz no son nada dificiles.\r\nDe vez en cuando nos pone actividades tipo juegos y en general es una buena profesora','NA','','2008-05-07 10:44:50',0),(4260,72,700,'10','Buen profesor, sabe mucho más de lo que a simple vista aparenta, tiene fama de perro pero sus ultimos cursos se comporta más como maestro barco. No entregas trabajo, se basa solo en los examenes y dos presentaciones en el semestre.\r\nSus examenes son en su hora y tienes libertad de hacerlo donde te plazca, pues los pone en blackboard, así que pueden juntarse entre todos y hacerlo a libro abierto. Tiene muchos comentarios, pero no los hace con intencion de ofender. Si eres orgullosamente chilango evitalo, si no lo eres, adelante. Como dijeron antes, es todo un showman','NA','','2008-05-07 10:51:31',0),(4261,491,87,'10','La verdad es que si es un poco estricto y con sus examenes RAPIDOS tienes que tener un buen de cuidado pero terminas queriendolo jaja y sabiendo de su materia','NA','','2008-05-07 19:23:25',0),(4262,813,923,'9','Sus clases estan muy padres, aprendes con ejemplos y esta muy dinamica, solo sus examenes son algo cortos pero valen mucho. ','NA','','2008-05-07 19:26:27',0),(4263,460,320,'10','LO mejor! Es cierto que el semestre pasado daba más puntos (al menos en Mate 3) pero sigue explicando igual de bien y sigue teniendo muchísimas horas de asesoría. La clase está excelente y si le echas ganas (osea haces las tareas porque el examen viene super super parecido), te va muy bien. El problema es que es facilísimo conseguir las tareas (las resps se suben a webtec) y por eso el tronadero en el parcial. ','NA','','2008-05-07 20:35:06',0),(4264,397,392,'6','Es una buena maestra, acepta trabajos tarde, da puntos extra, y es medio relajada... el problema es que sus clases no son nada amenas.. puedes platicar, puedes hacer lo ke tu quieras.. pero son tan aburridas por que la maestra habla con el aire aunke nadie la este pelando y eso si es desesperante.. no tiene control de sus grupos y pues cuando se equivoca dificilmente acepta sus errores..\r\n\r\npero bueno.. no es tan mala.. pero definitivamente hay mejores','NA','','2008-05-07 21:37:46',0),(4265,584,385,'4','A todo el que piense ke rafael es bueno.. pues no se a cual rafael se refieran.. alomejor se equivocaron.. pero en fin.\r\n\r\ncuando meti etica la meti con clemente gaitan (supuestamente el mejor profe para etica) pero desgraciadamente no lo pude conocer por que el primer dia de clases dijeron que hubo un cambio de profesor y pues me toco con rafael nieves.. ya cuando vi su calificacion pues me tranquilice.. pero hasta las calificaciones mienten..\r\nEs un profe bien chido y hace la clase medio entretenida.. pero te encarga leer un chingooo... y tambien hacer tareas todoos los dias.. y trabajos pesados para el dia de los parciales... TRABAJAS MUCHO CON EL.. y toma lista justo cuando llega.. aunke que haya nadamas 10 personas en el salon..\r\n\r\nTodos los parciales te va mal.. y te pone cosas muy tecnicas.. por que te hace preguntas como: ¿que dijo este wey.. en la lectura tal?... y te hace poner listas de cosas que realmente esta medio raro explicar... para los ke dicen que etica es puro rollo.. pues con este profe no lo es..\r\n\r\nmachetearte las cosas es bien dificil.. por que es demasiado material para un parcial y ademas cada parcial te pregunta cosas del anterior. de manera que se acumula mucho mas..\r\n\r\nmi recomiendacion es que busquen otro.. pero si no hay opcion.. minimo no estaras aburrido en sus clases.','NA','','2008-05-07 21:44:53',0),(4266,401,272,'3','maestra floja... este semestre daba clases de 2 horas y media los martes y jueves y la verdad es que se desaprovechaba casi 1 hora haciendo nada... \r\n\r\ncomo la clase es tan larga, derrepente pone un descanso como de 10min el problema es que es de las maestras que se chiflan y si el grupo se pone a hablar les cancela el descanso como si fueran niños de kinder.. eso si da lastima y hace ke te entre un coraje..\r\n\r\nsiempre encarga tareas... y ademas las encarga un dia o 2 antes.. y con mucho material de entrega.. lo cual es un problema por que sus tareas valen muchos puntos.. y como la materia es de 12 unidades.. pues justifica ke debemos de dedicarle mucho tiempo fuera de clase..\r\n\r\nmi recomendacion es que no la metan con esta maestra en las materias ke les toque... hay mejores','NA','','2008-05-07 21:49:44',0),(4267,77,934,'1','EL PEOR DE TODOS DE QUIMICA. . ASI SE LAS PONGO, REPROBO A MAS DE LA MITAD DEL SALON DE QUIMICA DE 1 SEM. SU METODOLOGÍA ES\r\n\" SER MAMON PARA PURIFICAR A AQUELLOS QUE MERECEN SER DIGNOS DE SABER QUIMICA Y QUIENES NO\" OSEA NO MMS ES 1 SEM Y LA MAYORIA NI USA QUIMICA . DICEN QUE DA MUY CHIDO POLIMEROS PERO QUIMICA GENERAL ES EL PEOOOOOR. TE HUMILLA CADA QUE PUEDE, REALMENTE TE HACE SENTIRTE INUTIL, QUE NI EN EL TEC DEBERIAS DE ESTAR. ESCRIBE BIEN FEO, Y NO TE REPITE LO QUE ESCRIBE. SE HECHA UNAS REVAS DERREPE CHIDAS PERO SON A COSTA DE ALGUIEN MAS. sólo un parcial dio curva y ese parcial encargo un trabajo de 15 hojas para ver si conservaba curva o no. pesimo acento y no se le entiende. ','-','','2008-05-07 22:40:53',0),(4268,451,946,'10','coyito es lo mejor, jaja esta increiblemente pesada la materia, no es barca, pero explica muy bien, te ayuda a alivianarte la materia y a entender todo, es necesario leer tooodo el libro, tooodos los capitulos, pero todos los maestros son asi, es la mejor opcion neta. ','-','','2008-05-07 22:44:12',0),(4269,208,945,'5','mmmm la neta me va de la chingada con felicita el promedio del grupo es de 65 entonces el problema no soy yo, jajaja le neta si pueden denle la vuelta a la maestra, es buena pero pues es medio perra, pero hasta eso creo ke si nos a ayudada un poco porke si no ni uno solo pasaria ','NA','','2008-05-08 00:01:12',758430293),(4270,208,945,'1','es un calse aburrida , no es nada dinamica y desde que empieza hasta que se acaba no sueltas la pluma y no dejas de estar escribiendo estructuras , reacciones y mecanismos , todo lo escribe en turbo mode, es tan rapida  que no te da chance de pensar lo que hizo ni por que solo escribes escribes y sigues escribiendo y luego pregunta y se enoja si no le contestas , normalmente nadie contesta por que nadie sabe y si alguien sabe mas o menos, le da miedo contestar por que si estas mal no te la acabas, es una clase que nadie habla solo la maestra , no hay tareas , solo unas actividades al final de cada parcial  que como son al final no sirven de mucho . esta clase facil y la pudieran grabar  y ponerle play a cada sesion y seguiria siendo lo mismo . le pongo una calificacion pesima , por que no sabe hacerte llegar el conocimiento , aqui todo depende del auto estudio masivo.','NA','','2008-05-08 00:08:07',758430293),(4271,567,471,'10','es muy buena maestra, si sabe y si aprendes con ella, los examenes son tal y como el contenido del curso. una de las mejores maestras...\r\ncae bien','NA','','2008-05-08 01:53:22',0),(4272,731,715,'10','Wuau!! creo que es la mejor maestra de Mate que he tenido. Ponganse listos con las estrellitas (o caritas felices en su defecto).\r\n\r\nAdemás comemos chocolates seguidamente.\r\n','NA','','2008-05-08 04:14:32',0),(4273,813,923,'10','Qué puedes decir de tu Director de carrera. Muy bien por José Luis.\r\n\r\n','NA','','2008-05-08 04:22:32',0),(4274,907,1158,'3','Funesta! Es la peor maestra que he tenido hasta el momento.\r\nElla no sigue el programa de la clase, pone a los alumnos a \r\nexponer, investigar y a hacer mesas redondas sobre los temas\r\nque le dan la gana, claro siempre que tengan que ver con radio,\r\nprensa, televisión, cine  e internet. Pero basicamente no están\r\nrelacionados con los temas del curso. Todo lo que el alumno hace\r\nes hablar mientras ella está sentada comentando \"DATOS CURIOSOS\"\r\nacerca de lo que el alumno dice. Te pone a hacer reportes de lo\r\nque se habló en clase, siempre son en pareja pero tiene que ser\r\ncon una persona distinta en cada reporte, también te pide ensayos\r\ncon mil requisitos y super extensos que ni lee. Al final de cada \r\nparcial te pide que le digas la calificación que te mereces y por qué\r\npero termina poniendote lo que le da su gana, nunca te da las \r\ncalificaciones que va a poner, solo las sube al sistema.\r\nEs grosera, alburera y se cree graciosa.','DG','','2008-05-08 05:23:12',0),(4275,79,582,'8','Ella es una persona que grita mucho, sus explicaciones dejan mucho que desear y para cada examen (que solo son 2: medio termino y final) te deja demasiadas filminas que estudiar (para el primero fueron mas de 150). Sus examenes son complicados, confusos y no puedes sacar una buena calificación a menos que seas un nerd. Las calificaciones de cada parcial se basan solamente en los trabajos en clase y las tareas. Deja demasiadas tareas individuales y en equipo, pero no es mala para calificarlas, ahi sí que te va bien. De vez en cuando hace \"actividades\" de puntos extra que te ayudan un poco a subir la calif. si es que has estudiado. En general la clase es interesante y no es dificil pero la maestra no ayuda mucho.','DG','','2008-05-08 05:29:56',0),(4276,149,582,'10','Nos dió esta clase durante el primer mes solamente (era co-titular de la clase) el resto del semestre la dió Bertha Garcia, pero durante ese primer parcial que impartió clases fue la mejor, explicaba suuuuper bien, se notaba que sabía de lo que hablaba y te resolvía las dudas que tenias de una excelente manera, además es una persona muy agradable dentro y fuera de la clase. Se las recomiendo demasiado.','DG','','2008-05-08 05:32:39',0),(4277,11,313,'9','Cada quien comenta según le va en la feria. Yo puedo decir que el profe es bueno, explica bien las cosas aunque sólo basado en las filminas. Deja muuuy pocas tareas durante el semestre, y la clase más que nada es sentarse a escuchar la explicación, resuelve dudas e intenta hacerlo de la mejor manera. Sus examenes son algo complicados sobre todo si no has leído nada o te duermes en las clases. Yo reporbé el primer examen pero no por eso lo detesto, realmente fue que no estudié, porque los siguiente saqué 9O y 1OO. La clase es dificil sólo si destestas la economía.','DG','','2008-05-08 05:37:30',0),(4278,607,392,'9','Bueno pues esta miss es muy buena persona, trata de hacer amena la clase y no es dificil de pasar. Algo que en lo personal no me agrada es que siempre trata de ventilar su vida personal haciendo chistes que la vdd no dan risa (salvo algunos) en ocasiones como que te cuenta los mismos LOL. Las tareas son algo complicadas porque es de investigar significados y uso de palabras para elegir la correcta y cosas así, pero son 2 tareas por parcial aproximadamente. En general es una buena maestra, mejor que muchas otras que dan esta misma materia.','DG','','2008-05-08 05:44:59',0),(4279,474,205,'10','LA MEJOR! no hay duda de eso, si les aparece su gpo no lo piensen i métan la materia con ella. Sus examenes son algo complicados porque siempre pone algo para confundirte, pero hay mafia de examenes porque siempre pone los mismos. Así que si los consigues ya la armaste. Te deja muchas tareas en el periodo pero te pone 1OO en ellas si las entregas, sin importar lo que respondiste. Por cada capítulo del libro te pone un examen rápido de 2 preguntas y al final te deja un trabajo de investigación (que también puedes copiarte y no pasa nada). Pero no pienses que por eso es buena. Ella es la mejor porque explica excesivamente bien. Sino fuera así, ni teniendo los examenes los pasas. ','DG','','2008-05-08 05:50:36',0),(4280,742,385,'5','No se las recomiendo, muy estricta con los trabajos...solo acepta fuentes de biblioteca y esta super aburrida la clase....cero recomendable ','NA','201.172.45.16','2008-05-08 07:11:04',0),(4281,292,1050,'9','pues la clase de taller es aburridaa pero el profe es buena onda...cae muy bien yy califica bien...no es barcoo pero no es perro..hace que la materia no sea tan pesada...','NA','201.172.45.16','2008-05-08 07:16:15',0),(4282,905,722,'7','Omite muchas cosas de cursos anteriores y eso dificulta mas la materia.','NA','','2008-05-08 20:26:30',667985972),(4283,453,55,'2','JAMAS LA METAS CON ELLA! asi de simple! lleva 20 años dando la materia y nunca nadie ha sacado 100! EN 20 ANOS!!','NA','','2008-05-09 04:16:08',0),(4284,239,25,'1','es gay','yogas','','2008-05-09 05:11:34',0),(4285,598,243,'8','el profesor es muy mamon si sabe pero nada mas tienes que poner atencion en clase y puedes llegar a la hora que quieres y los examenes 