ientemente bien para entenderle honestamente, encarga la suficiente tarea para que practiques.\r\n\r\nSi batallas en mate, peinsala dos veces en meterla con el.','NA','','2008-05-09 19:19:03',637760176),(4299,283,1110,'9','Areté y paideia! \r\n\r\nEs muy consentidora con los alumnos de primeros semestres de letras.  Cuando da textos clásicos, su clase es agradable y amena, nada estresante.  ','NA','','2008-05-09 19:19:06',520345127),(4300,813,923,'8','pues es buen maestro.. un poco de mas centrado en su propia teoria (conductual) y es debido a eso que no te hace conocer mucho de las otras. Ameno\r\nsus examenes suelen ser de 15 a 20 preguntas.','NA','','2008-05-09 19:21:42',637760176),(4301,44,923,'10','Me dio introducción a la psicología.  Es excelente maestro, de esos que disfrutan mucho dar su clase y te contagian su entusiasmo.  ','NA','','2008-05-09 19:22:34',520345127),(4302,935,922,'8','pues digamos que el es un tipo que no le importa si le estas o no poniendo atencion a su clase. Y debido a eso es facil distraerse.\r\nDomina perfectamente los temas y es facil negociar con el (fechas de examenes, ponderacion del mes, etc)','NA','','2008-05-09 19:23:43',637760176),(4303,195,602,'7','Nunca le gustó como hacía mis Kanjis, y siempre me bajaba puntos porque estaban chuecos.  :-(','NA','','2008-05-09 19:25:15',520345127),(4304,371,992,'8','Para seminario de literatura española es, por lo menos, muchísimo mejor que Fidel Chávez.  (Aunque Fidel es lo mejor para metodología y crítica literaria)','NA','','2008-05-09 19:29:55',520345127),(4305,396,836,'8','Es muy estricta, pero por lo menos su manera de evaluar es bastante clara.   Lo malo es que es muy apegada a su método (el PROPLAN), y toda su clase se trata de eso.  \r\n\r\nNo es muy buena maestra, pero creo que es la única opción para llevar esta manteria. ','NA','','2008-05-09 19:32:49',520345127),(4306,41,64,'10','Buenísima maestra.  Debería haber más profesores que hagan investigación y publiquen, como lo hace ella.  Conoce muy bien su área, y se emociona con los trabajos de sus alumnos. ','NA','','2008-05-09 19:38:23',520345127),(4307,163,679,'4','Lo peor.   \r\nNi siquiera da su clase, sino que deja que alumnos de LRI expliquen de qué se trata un libro sin siquiera haberlo leído (con lo que encontraron después de googlear).  \r\nEs un viejo cachondo que se la pasa coqueteando con sus alumnas. \r\n','NA','','2008-05-09 19:42:34',520345127),(4308,342,723,'8','Su clase es demasiado repetitiva y lenta.  No se avanza mucho de una clase a otra.  El ejercicio que se supone ya hiciste de tarea lo vuelve a poner en clase y toda la clase se le va en explicarle a los que no le entienden.  Quizá sea el maestro indicado para aquellos que  batallan con las matemáticas, pero los que entienden a la primera se van a aburrir muchísimo. ','NA','','2008-05-09 19:48:55',520345127),(4309,163,677,'9','Es un buen maestro de Literatura. No le vas a entender si no lees e investigas por tu parte. Es buen tipo, como profe es medio raro. Pero vale la pena intentarlo. ','NA','','2008-05-09 23:40:10',0),(4310,507,5,'5','Los que digan que este profe es de lo mejor porque habla super fresa y porque sus presentaciones son de primaria, es porque no se dan cuenta de lo pueril que es realmente esta clase. No aprendes nada, te la pasas en blanco, es una soberana pérdida de tiempo. No está chido. ','NA','','2008-05-09 23:51:01',0),(4311,298,435,'10','Si vas a llevar fundamentos, no la metas con ningun otro profesor, Jakeline es la mejor para enseñarte. Las actividades y tareas que pone son bastante justos y te ayudan un buen a entender los temas. NO LAS DEJES DE HACER. Si te gusta la programación, pones atención en clase y realizas tus actividades, con Jakeline seguro sacas una muy buena calificación. Los examenes no están imposibles, pero si haces tareas y estás al corriente, estudiar para ellos no es nada tedioso. Muy recomendable.','hugo','','2008-05-10 00:44:18',0),(4312,348,308,'10','creo k no se llama a