'NA','','2008-05-10 09:40:10',513953857),(4327,928,236,'8','jaja este profe es conmadre, es bien raza, para las mujeres puede ser algo incomoda la forma en que da la clase porque es maldiciento y dice mamada i media ke incomoda a las mujeres, jaja \"ahora si ahi viene lo bueno muchachos!!\" cuando vemos los delitos sexuales jaja en fin, los examenes son kmo 10 preguntas abiertas, no estan tan dificiles.','NA','','2008-05-10 11:05:12',0),(4328,894,1027,'4','la vdd es imposible, pues su voz, porte, tono, rebas y demás gesto producen un efecto somnífero casi imposible de evitar....el cuate es super fan de la revista esa en la q siempre tiene q publicar algo, a tal grado de q el cuate tiene los dos libreros de su oficina llenos de copias de eso....y ps si, todo viene en el manual la vdd pero ps suerte con eso\r\n\r\nlexis nexis!!! jajajajaja!\r\n\r\n','NA','','2008-05-10 11:08:17',0),(4329,97,400,'4','Muy exigente, y no sabe explicar bien. Aunque uno sea amante de los problemas en donde se ven puras variables en lugar de números no la arma... sus exámenes tienen problemas de todo tipo: perrones, capciosos e imposibles.','NA','131.178.245.238','2008-05-10 11:12:58',0),(4330,815,40,'7','Dicen que antes era muy buena onda...pero este semestre se dio cuenta que no debe de ser tan buena onda y hasta ella lo dice\r\nsu clase esta ekis no mas haces el libro\r\nno esta dificil pero no esta facil\r\nes media mamona nomas encarga 2 tareas en el parcial\r\nno le gusta que estes platicando','NA','','2008-05-10 20:19:57',0),(4331,422,935,'10','buenisima maestra super linda\r\nse preocupa por ti y siempre esta abierta a asesoria\r\ncasi nadie reprueba sus trabajos mensuales estan faciles\r\nlos examenes si estan medios complicados pero si vas a la asesoria que da un fin antes ya la hiciste\r\nsu clase si esta aburridisma pero si estas en la laptop o platicando no te dice nada\r\nes la mejor opcion para quimica analitica','NA','','2008-05-10 20:23:52',0),(4332,6,1050,'10','la materia 