re, y si no lees, fácil, repruebas.\r\n\r\nSus examenes no están dificil, obviamente tienes que estudiar, pero tienen truco, ya que repite la pregunta dos o tres veces, o en su caso, en la primera pregunta te pide algo, y en la siguiente está la respuesta.\r\n\r\nCómo cálifica: cada parcial son 70 % examen, y lo demás quizzes, pero sus quizzes están dificiles, pocas veces sacarás 100, pero no es imposible.\r\n\r\nAl final, con su clase, te das cuenta si en verdad quieres ser LRI, sino compañeros, están en la carrera equivocada.','NA','','2008-05-10 22:20:12',0),(4338,259,213,'7','La verdad es buen profesor porque sí sabe y te explica bien. Reprobé en primer parcial con 47 pero fue por que yo no iba a clases y era bien flojo. en segundo tercero sí me fue muy bien. Aunque la verdad sí califica medio ogete y nunca quiere dar asesorías y te tira al león y como que siempre está enojado con todo. si pueden metan con otro pero no está como para reprobarla con él. al menos no esta materia.','NA','','2008-05-10 22:27:25',528165716),(4339,354,723,'8','Te deja sacar apuntes laptop messenger TODO en el parcial, y no pone exámenes difíciles ni deja tareas ni toma lista, es buen profe y aunque habla mucho y da la clase aburrida, sí está bien. te baja puntos por muchos detallitos aunque tengas las respuestas bien, pero también da puntos. si pueden meter con uno mejor métanlo, pero él no es mala opción,','NA','','2008-05-10 22:31:52',528165716),(4340,276,392,'8','da hueva pero es buena maestra, si le haces caso y no haces mucho relajo te va bien. te puedes salir a comprar papitas o mugrero a media clase y cosas así y no pasa nada.','NA','','2008-05-10 22:37:11',528165716),(4341,410,397,'9','Es buen profe y puedes hacer desmadre en su clase, yo nunca puse atención y pasé con 90. sus exámenes están siempre bien fáciles si llevas un buen formulario.','NA','','2008-05-10 22:39:46',528165716),(4342,6,1050,'10','La mejor maestra de todas!! es buena en todo lo que una persona podría ser buena.','NA','','2008-05-10 23:02:42',528165716),(4343,942,762,'1','Es el peor maestro de la licenciatura de Letras. ','NA','','2008-05-11 00:26:08',729155625),(4344,84,935,'10','A mi la verdad si me gusto mucho como da la clase, explica muy bien, solo es cuestion de que le pongas atencion, como a todas las materias, la neta ni esta dificil y pues sabiendote bien los conceptos si es que la escuchas, los examenes ni se te hacen dificiles. No se porque a muchos les va mal, a mi no me fue excelente pero si me fue bien y si me encanto como da la clase. Si quieres aprender bien la quimica analitica Blanquita es la opcion','NA','','2008-05-11 01:18:57',0),(4345,645,1040,'9','Es muy buen maestro, su clase puede parecer sin sentido, pero conforme avanzas te das cuenta que su clase asi es, es su manera de enseñar, puede parecer crítico y hasta duro, pero si escuchas lo que te dice aprendes muchas cosas. Eso si debes de ser amable y cuidar tus comentarios frente a el, pues si te pones de su lado equivocado no disfrutarás la clase... si te pones a platicar con el de otras cosas encuentras que sabe mucho sobre los temas de jovenes. \r\nSi te impulsa a explorar diferentes cosas y metodos, te deja ser y encontrar tu estilo, es una clase 100 porciento artística. Con mi grupo se adapto muy fácil y se genero un ambiente muy relajado y agusto para trabajar. Los retardos no importan puedes trabajar a tu ritmo con tal de que entregues un buen trabajo. ','NA','','2008-05-11 01:21:55',0),(4346,645,1040,'9','Es muy buen maestro, su clase puede parecer sin sentido, pero conforme avanzas te das cuenta que su clase asi es, es su manera de enseñar, puede parecer crítico y hasta duro, pero si escuchas lo que te dice aprendes muchas cosas. Eso si debes de ser amable y cuidar tus comentarios frente a el, pues si te pones de su lado equivocado no disfrutarás la clase... si te pones a platicar con el de otras cosas encuentras que sabe mucho sobre los temas de jovenes. \r\nSi te impulsa a explorar diferentes cosas y metodos, te deja ser y encontrar tu estilo, es una clase 100 porciento artística. Con mi grupo se adapto muy fácil y se genero un ambiente muy relajado y agusto para trabajar. Los retardos no importan puedes trabajar a tu ritmo con tal de que entregues un buen trabajo. ','NA','','2008-05-11 01:24:35',0),(4347,606,797,'8','la clase es MUY poco dinamica, si no te pone a hacer algo, te duermes LITERALMENTE... y para esta materia se tiene que estar atento. Ayer tuve el examen final de esta materia. y me da miiedo lo que pueda llegar a sacar... no tengo mal promedio pero si es muy estrcito con las tareas, ademas es una persona muy especial. Es muy buen maestro y sabe muchisimo, pero si tienes que llevartela bien con el y hacer todo lo que te pida! No da puntos extras ni nada... pero el junto con Mendoza son los unicos que dan la materia.','NA','','2008-05-11 01:25:51',0),(4348,673,108,'10','Encarga MUCHAS tareas y te consumen las tardes del semestre... ESTOY DE ACUERDO\r\n\r\npero eso de que ella expluca mal la verdad NO eso solo lo dicen los que andan tragando CAMOTE... lo que dicen de que pone algo que esta mal y luego lo BORRA ES CIERTOOOOOOO!! pero lo hace para que TU NO LO HAGAS Y TE LO REPITEE UN CHORRO, por favor mas atencion!!!! y luego lo hace como debe de ser!!!\r\n\r\nYo lleve balance de materia con ella y termodinamica de procesos y creanme que Termodicanica de Equilibrio NI LA SENTI y en Tranfserencia de Masa y en todas las meterias que requieren de todo esto, la verdad esque esta super dificil que te atores! si quieres meter con Darinka para pasar, pues esta bien, cada quien. PERO PARA BALANCE DE ENERGIA, EQUILIBRIO, CALOR, MOMENTUM, MASA, ETC no hay muchas opciones entonces esta bien facil que te atoren y que en el peor de los casos, dejes la materia asi que ustedes saben si \"Batallar\" con BdM o con todo lo demas!!','NA','','2008-05-11 01:34:48',0),(4349,167,772,'9','Pinche profe te la mete todo el semestre , pinches tareas dificiles y aun que leas el libro muchas cosas ni vienen para resolverlas. No tienes salvacion si eres economista pasas por el y es una preparacion para el verdadero infierno (Teoria micro con ibarra)','NA','','2008-05-11 01:44:53',0),(4350,259,205,'3','lo peooor!!!!!!!!\r\nnuncaa la metaan con él, por que para el ya todoos somos expertoos en contabilidad, habla super bajito y no se le entiende ni lo que habla, escribe horrible en el pizarron, en los examenes lo unico que toma en cuenta es el resultado final, y si  fallas en un numero ya valistee!!\r\n','NA','','2008-05-11 01:50:39',0),(4351,474,205,'10','la mejooor!!!!!!!\r\nexplicaa super bieeen, si te pasan los examenes ya estas del otro lado, por que lo maximo que hace es cambiar los numeros, las teras son muchas, pero con que las entregues ya la hicistee!!.\r\nes super buena personaa..peroo lo vuelvoo a repetiir\r\nexplicaaa spr bieeen!!!!....y si no le entiendes a algoo..estaa siempre dispuestaa a aydudaaar!!','NA','','2008-05-11 01:53:02',0),(4352,182,726,'10','esta maestra es lo mejor que le pudo haber pasado a las matematicas en el tec, yo aprendi y no sabia ni madres, eso si, le caigo muy bien, y me lleve conmadre con ella desde el principio, y pues aunque tengas probabilidades de reprobar haya manera para subirte puntos, eso solo si le caes bien, porque hay raza que de plano si no le cae bien, ya valio, pero la verdad metanla con ella, esta y la que tengan oportunidad de meter, la clase se va rapido y de verdad aprendes','NA','','2008-05-11 03:00:39',0),(4353,548,942,'10','Es uno de los mejores maestros que he tenido en toda la carrera =) yo a este maestro lo quiero mucho, da la clase muy interesante. Cero aburrida como otra persona que dicen que es muy bipolar y que te duerme ademas de que sabe muchiisimoo tiene mucha experiencia es una persona muy valiosa definitivamente METANLA CON EL!! aunque si le tienen que estudiar pero VALE LA PENA =)\r\n','NA','','2008-05-11 05:54:10',0),(4354,746,404,'1','EL PEOOR MAESTRO QUE HE TENIDO EN MI VIDA!!!\r\n\r\nFENOMENOS, fue la materia que menos me gusto de la carrera, el tipo es un nefasto ademas es de lo mas flojo que te puedas imaginar. Ni siquiera revisa los examenes, sus alumnos le valen madre, te puedes copiar y no dice nada no le interesa que aprendas. NO NO NOOOOO\r\n\r\nSI ERES FLOJO Y QUIERES BUEN PROMEDIO ADELANTE!! pero pues que webaaaaaaa de maestro neta!!','NA','','2008-05-11 05:59:21',0),(4355,676,798,'10','uno de los mejores maestros que he tenido =)\r\nyo lo quiero muchoo!! es una persona super noble! te puedes llevar de lo mejor con el ademas explica super bien me encanta su clase quiero llevar reactores con el =) jajajaja me encantoooooo quede fascinada!!!','NA','','2008-05-11 06:03:27',0),(4356,290,723,'10','Esta maestra es la mejor dando Mate II, aprendes todos los temas del curso, la clase es muy dinámica y divertida :P, con las tareas refuerzas lo visto en clase, cada tema pone un quiz, siempre tienes k estar atento, pero te ayuda con algunos puntos extra cada parcial, en general aprendí bastante, la considero la mejor maestra de Mate!!! ojala de Mate III','NA','189.152.114.233','2008-05-11 06:19:02',0),(4357,676,404,'9','WOW qué profesor, es buenísimo. Su inglés es como de Wyoming, sus exámenes simples y concisos, su clase es detallada, y da una atención personalizada. Buena opción para Fenómenos.','NA','189.153.86.219','2008-05-11 07:34:54',0),(4358,814,1041,'10','Muy muy bueno, puede ser algo estresante en veces y desesperante cuando te hace repetir dibujos, pero con ninguno de los profesores que hay ahorita dando esta clase vas a aprender lo que con el. Es buena onda cuando quiere, es muy bromista y algo amanerado. A lo largo del semestre puede que te quejes pero al final terminas amando al chalequitos.','NA','','2008-05-11 08:34:58',0),(4359,397,392,'8','Es de lo mas ekis esta maestra, te deja salir temprano y da un chorro de puntos extras. No es mala opción, pero si pueden meterla con alguien más','NA','','2008-05-11 10:01:41',0),(4360,512,496,'10','Esta maestra es lo mejor, siempre esta de buen humor, explica muy bien y sabe mucho del tema. Te da la clase como si el mundo fuera de color de rosa y te explica como si fueras un niño. Muy Buena Maestra. ALTAMENTE RECOMENDABLE','NA','','2008-05-11 10:03:20',0),(4361,167,850,'8','El profe sabe mucho del tema. Los examenes si estan dificiles, tienes que echarle muchas ganas si kieres pasar. Como kiera en el final se aliviana','NA','','2008-05-11 10:05:40',0),(4362,186,771,'5','es supeer mal maestro..no me refiero a q es perroo..ni nada de esoo..si no que simplemente no sabee ni lo que está explicandoo\r\npuedo definir esta materia como autoestudio, sus examenes son en linea, menos el final, pero los de linea están muy fáciles siempre y cuando leas.\r\nsales super temprano, y te da puntos si das clase\r\n\r\nsi quieres aprender bieen bieen microeconomía no la metaan con él\r\nes muy buena persona, pero pésimo maestro','NA','','2008-05-11 10:20:31',0),(4363,453,1050,'9','es buena maestra, pero la vrd la materia no es padre, por eso resulta un poco aburrida, pero es fácil sacar la materia con ella y con buen promedio\r\nyo realmente sí la recomiendo!!','NA','','2008-05-11 10:23:09',0),(4364,476,1038,'1','al principio suuuper buena onda el maestro, te la pasas atacado de la risa en sus clases.. pero nada mas llega el primer parcial y madres,, la vdd no ves nada en sus clases, no explica en sí los capitulos del libro porque se la pasa hablando de que si cuando ustedes se casen y no se que.. puros ejemplos bobos que nada que ver con la clase,, pero ya sabes, tipico de esos maestros que se creen superiores a ti.. los examenes son un machete vil, y no nada mas de conceptos.. todos son abiertos y son preguntas de que \"menciona las 20 recomendaciones para una negociacion distributiva\" y tu como que no mancheess, como te vas a machetear todo eso??.. y son facil 25 preguntas asi.. no no, horribleee.. eso si, tiene favoritos, asi que si eres mega hooker y les coqueteas a los maestros a fuerza que te pasa y nada mas te deja hablar a ti en clase.. \r\nes mega subjetivo para calificar, super webo para subir calificaciones, las sube sin enseñarte el examen.. o sea, estamos en finales y todavia no me dan calif del 3er parcial.. y si encarga tareas, no tienen NADA que ver con la clase, si hace ejercicios como el de juego de negocios, naaaaaada que ver con lo que ves en clase.. en fin, yo no lo recomiendo para nada, lo termine odiando y lo sigo odiando, digo no me iba mal pero era porque de plano me trague el libro,, segun yo debe ser una clase para aplciar a la vida y noo jamas ves eso.. yo no lo recomiendo pero dicen que es el mejorcito, pero neta noo jamas con elll','NA','','2008-05-11 22:08:49',0),(4365,597,174,'10','de vdd es la mejor maestra, con ella te das cuenta que la mercadotecnia es tu pasion.. sabe un chorro, mega linda y mega accesible.. califica super justo, eso si tienes que leer bastante, pero de vdd aprendes muchisimo, los slides de ella estan medio pobres de informacion, pero con que tomes apuntes de lo que dice te ayuda bastante.. los examenes por lo general son abiertos pero nada del otro mundo, te pone cosas que ves y que se comentan en clase, por eso digo que anotes mucho en su clase de lo que dice y explica porque es una super maestra!','NA','','2008-05-11 22:13:40',0),(4366,771,561,'10','Super buena maestra,  cubrió todo el  material de la clase mas unos temas extras super interesantes, en la clase hay que leer para aprender, las tareas son resumenes criticos de las lecturas, y es my justa al calificar, NO FALTES NUNCA, porque cuenta mucho para la participación al final veras,  LLEVA todos los resumenes cada uno vale 2.5 puntos SOBRE calificación final. Si quieres aprender mucho y divertire mete esta materia con ella.\r\n','NA','','2008-05-11 22:17:51',1259190045),(4367,291,32,'10','aprendes bastante en su clase.. eso si, es de ponerse las pilas porque es una materia de dedicale tiempo, te hace ver la aplicacion a la vida real de lo que ves.. haces las tareas y la siguiente clase te las explica.. MEGA accesible para asesorias.. de repente te aburres en sus clases, pero nada como para que te quedes dormido y no pongas atencion,, de vdd te hace super amena la clase, si te lelvas bien con el, participas y le demuestras tu interes en la clase, es super lindo contigo y a veces hasta si le preguntas en el examen, te da una super pista que ya puedes hacer el problema.. si pone trampas en el examen, pero pues es para que aprendas bien.. te da 10% mas en el parcial si participas, si no te suena el celular y asi.. mega lindo, yo odiaba las finanzas, pero con el me gustaron jejejeje','NA','','2008-05-11 22:18:38',0),(4368,108,521,'10','Es super buena maestra, como es estadounidense habla ingles  perfecto, encarga tarea todos los dias pero es muy senclla  ysi no la lelvas te da chance de llevarla otro día. Sus clases son muy entretenidas y si todos en concenso se ponen de acuerdo para ir 20 min mas los dias martes y jueves los viernes NUNCA hay clase..  ya que ella es muy comprensiva y sabe que los foraneos se van a sus ranchos.','NA','','2008-05-11 22:22:09',1259190045),(4369,447,253,'10','la mejoooooooorrr maestra con la que puedes meter derechooo !!!!!!! la adoras asi mal plan.. se la pasa platicando de sus hijos y de todas las mensadas que hace.. da las clases a las 7 y 8:30, o sea mega temprano, pero vale la pena porque es super dinamica y tiene una energiaaaaaaaaaa jajajaja que se te quita el sueño, te la pasas riendote con ella bastante.. si no faltas te da puntos al final,, ademas en el examen si le preguntas te dice la respuesta jajaja tambien puedes copiar facilmente, pero no es necesario porque vas con ella y te la dice asi sin rogarle jajajajaja mega recomendable, la mejor maestra de derecho.. es de 1 hora y media la clase.. pero te dice que ella empieza 15 minutos despues y casi siempre sales media hora temprano y te puedes ir a desayunar, el ultimo dia de clases lleva tacos,, en resumen,, aprendes muchisimo y te la pasas fregonnn jajajaja','NA','','2008-05-11 22:23:04',0),(4370,308,700,'8','BARCCO BARCOO BARCO ¡¡\r\nSi no  quieres aprender mucho y  te la queires llevar TRANQUILAMENTE, porque tuviste un semestre pesadoo .... metale con el. De todas formas lo máxmo que puedes asprar con el es un 85, HACIENDO NADA.','NA','','2008-05-11 22:24:14',1259190045),(4371,633,1001,'9','No se porqué algunos califican mal a la profesora la verdad es super buena, te ayuda un chorro, sus clases son bien interesantes te contesta todas las pregutnas que tengas, es un amor con patas¡¡. Los examenes si son algo dificil pero pues tienes que estudiar NO ES BARCO. pero es accesible.','NA','','2008-05-11 22:26:41',1259190045),(4372,232,194,'10','Es un pan de dios la profe,  lastima que se accidento y a pesar de eso fue a visitarnos el último día de clases para despedirse.. la clase es algo complicada en si pero ella la hace mucho mas fácil, muy accesible, spero esté dando clases el sig semestre','NA','','2008-05-11 22:28:23',1259190045),(4373,511,392,'9','dicen que es la mas barca en su area, tiene cara de amargada pero es bien accesible, hazle creer que te mega interesa su clase,, yo te recomiendo que cuando hagas tus ensayos le lleves de perdido la tesis o algunas ideas principales del desarrollo para que te los cheque y te oriente para ver hacia donde, y veras como te la ganas,, la vdd si es barca para calificar, no muy perra, con que le hagas ver que te gusta su clase se interesa por ti y contigo se porta mega linda y hasta bromea contigo,, la vdd la clase en si, si es medio aburrida pero es porque asi es la materia, pero siempre hace retroalimentaciones por parcial y de vdd aplica lo que le dices con tal de mejorarse.. la vdd aunque no lo veas, si aprendes bastantes cosas que te ayudan a tu vida..','NA','','2008-05-11 22:28:28',0),(4374,202,5,'3','Buen maestro la clase es divertida te ries mucho, aprendes poco, te tienes que machetear el libro para pasar los examanes, es justo al calificar,  la clase esta basada en puros chismes, ideas extrañas en mente, siempre se la pasa criticando gente y me toco en varis ocasiones que mencioara gente conocida y me sentí ofendido, segun el trata de no decir nombre pero muchas de las cosas que dice son OBVIAS, de quien esta hablando. de todos modos  te ries mucho ajajajaj. Solo deberia concentrarse mas en la clase.','NA','','2008-05-11 22:34:24',1259190045),(4375,185,392,'10','MUY buena maestra. La verdad es bien buena onda (siempre y cuando seas respetuoso y le pongas algo de atención), se preocupa por sus alumnos (nos avisa de trabajos desde mucho tiempo antes, te explica perfecto lo que tienes que hacer). La clase es super amena y la materia está super light (no te la va a complicar en lo más mínimo). Y lo más bonito jaja...el promedio del salón siempre está arriba de 90! Está cañón que te vaya mal. Conclusión: LLÉVENLA CON ELLA!','NA','','2008-05-11 22:35:03',0),(4376,203,365,'9','es muy buena maestra sabe bastante, de repente se pierde, pero es bieeeeeeeeeeenn paciente para explicar, le puedes preguntar algo y te lo explica mil veces hasta con palitos y bolitas para que entiendas, lo mismo en asesoria, yo me la pase con ella ahi por las tareas y suuuper bien, mega linda y paciente,, igual si le mandas dudas por mail te las responde.. eso si las tareas si estan medias pesadas, pero como te digo, te da bastante tiempo para hcerlas asi que adelantalas y ve con ella a asesoria.. pone muchos ejercicios de diferentes formas para que en el examen no te traumes, da muchos puntos extras.. lo unico malo es que como es toda tarnquila muchas veces no lleva el control del grupo y te la pasas platicando y no pones atencion jajajajajaja pero sientate mas o menos adelante para que de perdido se te pegue algo, y te ira muy bien..','NA','','2008-05-11 22:37:01',0),(4377,353,751,'7','Si van a meter esta materia con este profesor tiene que llegar con una mentalidad bien especial. Vas a trabajar BASTANTE (no porque te encargue miles de cosas sino porque las va a checar con lupa, entonces lo poco que entregues hazlo lo mejor que puedas y SIEMPRE siguiendo sus intrucciones), muchas veces vas a toparte con pared pero de nada te sirve frustrarte...solo haz lo que te pide y te ira decente. El programa esta de flojera (con todos los maestros hay que tomar quizzes cada semana y leer capitulos larguisimos). Es cierto que pone miles de requisitos y tiene su manera particular de calificar, dar la clase, tomar lista, etc etc...pero si ya la inscribiste y no la vas a dar de baja: ACOPLATE. Si le das la contra, el va a terminar ganando. Conclusión: no esta imposible pero si no te interesa la materia ni dedicarle tiempo, definitivamente el no es la opcion','NA','','2008-05-11 22:45:12',0),(4378,759,108,'10','Mis respetos. De los mejores maestros que he tenido y de las mejores personas que he conocido. Definitivamente es la mejor opción para esta materia, explica muy bien, nunca te niega una asesoría, los parciales no están tan difíciles y no encarga muchas tareas. ','NA','','2008-05-11 22:49:39',0),(4379,876,49,'10','Esta profe es de lo mejor si sabe explicar y da puntos si participas mucho \r\nRecomendada 100%','NA','','2008-05-11 23:21:36',0),(4380,655,934,'10','Un poco menos estricta que la profe Cruz Glz, con un método para calificar más flexible.\r\nRealmente se preocupa por que aprendas y tiene bien diseñada su clase. Si eres regular estudiando en el semestre, vas a lograr una buena calificación haciendo tus tareas y asistiendo a clase... si eres otro tipo de estudiante síguele buscando, esta no es tu maestra.','Manuel Arellano','','2008-05-12 02:43:21',673590024),(4381,616,280,'10','si es muy extricta pero vale la pena.,, las cositas que nos enseña que uno piensa que son sonsadas , a la larga vas a aplicarlas y valorarlas muchisimo. te conviene mucho llevarte con ella y ponerle atencion.. si se recomienda mucho','lily','','2008-05-12 05:18:17',0),(4382,673,108,'1','Para los IIAs NO METAN CON ELLA. ella ayuda a los IQ y parale, a ellos los ama y a los iias y el resto los trata de la v.. hay muchas mejores opciones ','NA','','2008-05-12 05:25:20',618250500);
